{"department_text": "Value of the Day", "level": 1, "url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "text": "Value of the Day", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Value of the Day", "keyword_count": {"day": 11, "value": 14, "value of the day": 6}, "description_wc": 218, "description_text": "Value of the day. Save money every day with our Value of the Day feature items. Check back often to find a different Value of the Day right here, each and every day. It's a great opportunity to learn about special values on the things you want and need, but act quickly because these prices are good for just one day. In addition to our Value of the Day, you'll find thousands of other terrific values available at Walmart, including rollbacks on popular toys, special buys on hot electronics, exercise and fitness rollbacks, home value bundles, video game value bundles, baby gear rollbacks, appliances rollbacks, cold weather shop savings, special buys on storage and organization systems and much more. So in fact, you'll discover many great values each day at Walmart. It's easy to shop for Values of the Day, rollbacks, special buys and value bundles at Walmart.com by category, brand, price range, customer rating, or best sellers. Many Value of the Day items at Walmart.com are available for free in-store pickup at your nearby Walmart store when you use Site to Store online ordering. You never know what kind of terrific values you'll find, so visit often to see the value of the day and more ways to save at Walmart.com.", "keyword_density": {"day": "5.0", "value": "6.4", "value of the day": "11.0"}, "department_id": 41}
{"department_text": "Toys", "level": 1, "url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "text": "Toys", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "Toys Cost Less at Walmart", "keyword_count": {"walmart": 2, "toys": 13}, "description_wc": 236, "description_text": "From action figures and stuffed animals to kids' electronics and outdoor play , you'll find wonderful toys for kids of all ages at Walmart.com. We feature everyday low prices on dolls and dollhouses, pretend play, arts and crafts, development and learning toys, vehicles, trains and remote control toys and more. Kids can stay active and healthy while having fun with our outdoor play toys, as well as swing sets , bikes and riding toys. You can shop for toys by brand to choose from Disney, Fisher-Price, LEGO, Little Tikes, Leap Frog, Nerf and more. Or browse by age group to find toys for everyone from babies to kids who are 12 and up. You can also shop for toys by price range, customer rating or special offers. For even more ideas, our Toy Finder can help you find the perfect gift and gift ideas, while our Birthday Shop lets you plan a party and find great gifts, too. You'll also want to take advantage of free Site to Store shipping on many outdoor play toys, bikes and riding toys, scooters and more eligible toys. So get that climber and slide set they've always wanted, set up your home for hours of creative pretend play, find toys that will help them learn, or outfit your backyard for some seriously fun outdoor play. Shop for toys at Walmart.com to save money and live better.", "keyword_density": {"walmart": "0.9", "toys": "5.6"}, "department_id": 39}
