{"department_text": "Pets", "level": 1, "url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "text": "Pets", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Spoil your pet for less at Walmart", "keyword_count": {"pet": 13, "walmart": 2}, "description_wc": 292, "description_text": "Keep your pets happy and healthy with quality pet supplies from Walmart.com. We carry a huge selection of pet food and pet supplies, including dog food, cat food, fish food, bird seed, rabbit food and more. In addition to the pet food your pet needs for the best nutrition, you'll also find a full range of pet supplies like bird cages, hamster cages, fish tanks, dog houses, bunny cages and cat baskets. Basically, all the supplies you need for your pets are right here at your fingertips. In dog supplies , shop for dog food from makers you know and trust, like Purina, Puppy Chow, Pedigree, Iams, Milk Bone and others. For your kitty, we carry cat food from Friskies, Meow Mix, Purina and Fancy Feast, to name a few. Cat litter, too, of course. Bird seeds and bird feeders, as well as feeders for small animals like hamsters and rabbits, are just a sampling of the other pet supplies we carry at great prices. Oh, and don't let us forget an ocean's worth of fish food and fish supplies for goldfish, bettas and other freshwater and tropical fish species. To keep your pets from destroying your shoes or furniture, we also offer a huge selection of fun, safe dog toys, chew toys, cat scratchers and other cat supplies that'll keep them busy for hours on end. Even your pet goldfish will enjoy the cool aquarium decorations you can add to his fish tank or fish bowl. And to ward off common pet pests like fleas and ticks, be sure to pick up some of our effective flea and tick control products. Best of all, you'll save a bundle when you get your pet supplies at Walmart.com", "keyword_density": {"pet": "4.5", "walmart": "0.7"}, "department_id": 33}
