{"level": 0, "url": "http://brands.walmart.com/halloween/ominous-flaky-owls-recipe/?povid=cat615760-env999999-moduleA090713-lLinkLHNHalloweenTipsIdeas_Recipes_OminousFlakyOwls", "text": "Ominous Flaky Owls", "department_url": "http://www.walmart.com/cp/615760?povid=cat121828-env999999-moduleA82713-lLinkGNAV1_Campaign_Halloween", "parent_url": "http://www.walmart.com/cp/615760?povid=cat121828-env999999-moduleA82713-lLinkGNAV1_Campaign_Halloween", "description_wc": 168, "description_text": "Used with permission. \u00a9 Copyright General Mills. All Rights Reserved. Important Walmart Disclaimer: The recipes appearing on the Site are either user-submitted or content generated from another third party. Walmart.com does not sponsor, recommend, or endorse any specific recipe third party, product, service or information provided on this Site. All content provided herein is for educational purposes only. Such content is not intended to substitute for the diagnosis, treatment and advice of a medical professional. Consult your medical professional for guidance before changing or undertaking a new diet or exercise program; especially if you are under eighteen (18) years old, pregnant, nursing, or have health problems.\u00a0Neither the author nor Walmart.com assumes any responsibility for errors, omissions or contrary interpretation of the subject matter herein. If you have dietary restrictions and/or allergies, always read the ingredient list carefully for all food products prior to consumption. If the ingredient list is not available on the food product, check with the food manufacturer, or do not consume the product.", "parent_text": "Halloween", "department_text": "Halloween", "department_id": 1}
{"department_text": "Video Games", "level": 0, "url": "http://www.walmart.com/cp/1096069?povid=cat2636-env428896-moduleA071013-lLinkLHNRelatedCategories4YouthElectronics", "text": "Youth Electronics", "department_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "description_title": "Save on Kids' and Teen Electronics at Walmart", "parent_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "keyword_count": {"teen": 6, "kids": 5, "kids and teen electronics at walmart": 1, "kids and teen": 2, "walmart": 5, "electronics at walmart": 2, "electronics": 6, "save": 1}, "description_wc": 305, "description_text": "It's time to have fun and learn with tech for tots, 'tweens and teens from Walmart. We've got everything from Apptivity and iTikes educational toys for tots to Coolpix digital cameras and iPads for teens at Every Day Low Prices. Preschoolers and toddlers love electronics and will love watching television on a HANNspree 19\" LCD TV that's built into a polar bear, giraffe or zebra. They'll also enjoy chatting on walkie talkie sets that feature Disney Princess, Monster High or Dora and Boots. Browse through our selection of learning systems and interactive toys for more terrific ideas. Kids from 5 to 7 are into electronics and are sure to have fun with Fijit Friends, the SpongeBob SquarePants motion TV game, Barbie Rockstar Electronic Beats and the Hipstreet MoviePix kids digital camcorder. And look for more electronics, such as MP3 players and Skylanders. Take a look at our electronics for 8 to 11-year-olds . Kids in this age group are sure to be into video games on Wii, Nintendo 3DS, PlayStation 3 or Xbox 360 and Kinect. But they'll also appreciate the Hello Kitty digital video recorder and digital MP3 player, as well as remote control toys. Teens are all about everything electronic . Some good examples at Walmart are iPods for audio and portable DVD players for video. When it comes to computers, teens like to stay connected and even do homework on tablets and laptops. It's easy to shop by price range, customer rating, best sellers or special offers to find just the right kids' and teens electronics at Walmart.com. Many products qualify for free Site to Store shipping, too, so you can pick them up at your closest Walmart store. So shop for kids' and teen electronics at Walmart to save money and live better.", "parent_text": "Video Games", "keyword_density": {"teen": "2.0", "kids": "1.7", "kids and teen electronics at walmart": "2.0", "kids and teen": "2.0", "walmart": "1.7", "electronics at walmart": "2.0", "electronics": "2.0", "save": "0.3"}, "department_id": 42}
