{"department_text": "Party & Occasions", "level": 1, "url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "text": "Party & Occasions", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "description_title": "Get decorations, party supplies and gifts for less at Walmart.com", "keyword_count": {"party supplies": 4, "gifts": 8, "walmartcom": 3, "decorations": 4, "supplies": 6, "decorations party supplies and gifts": 1}, "description_wc": 231, "description_text": "Whether you're shopping for party supplies , holiday decorations, or thoughtful gift ideas, Walmart.com is your Special Occasion Headquarters. With thousands of items to choose from at unbeatable prices, you can easily find what you want\u2014just search by the type of occasion, recipient, holiday or craft project you're shopping for. We offer festive party supplies and decorations for weddings, birthday parties and holidays like Christmas, Halloween and the Fourth of July. You'll also save on terrific gifts for a wide range of occasions, like birthday gifts, graduation gifts and wedding gifts. You can even make your own gifts with our big selection of do-it-yourself arts and crafts supplies or choose from our personalized gifts like jewelry, linens, mugs and more, all with your own personalized touch. So why not save on all your party supplies and decorations at Walmart.com, and have more money left over to spend on great gifts ? You'll find everything you need right here, including gift cards and gift baskets. And when you're feeling creative, be sure to explore our terrific selection of arts and crafts supplies , ranging from photo albums to scrapbooking essentials to Cricut machines. Best of all, with unbeatable prices and quick delivery, Walmart.com makes it easier than ever to save on decorations, party supplies and gifts for all occasions. Now that's cause for celebration!", "keyword_density": {"party supplies": "3.5", "gifts": "3.5", "walmartcom": "1.3", "decorations": "1.7", "supplies": "2.6", "decorations party supplies and gifts": "2.2"}, "department_id": 31}
