{"level": -2, "url": "http://wm7.walmart.com/home-improvement/air-conditioners-heaters/air-conditioner-and-fan-buying-guide/?povid=cat1072864-env449811-moduleB082113-lLinkLHNFeaturedContentAirConditionerandCoolingUnitBuyingGuide", "text": "Air Conditioner and Cooling Unit Buying Guide", "department_url": "http://www.walmart.com/cp/patio-garden/5428?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PatioGarden", "parent_url": "http://www.walmart.com/cp/1072864", "description_wc": 325, "description_text": "How to buy an air conditioner. When you're considering buying an air conditioner and aren't quite sure how to buy an air conditioner that's just right for your home, this handy air conditioner buying guide is here to help. Get smart advice on what to look for in an air conditioner and how to buy an air conditioner based on factors like what climate zone you live, the size of your home, what's best for your budget and more. There are many different types of air conditioners to choose from and knowing which air conditioner to buy can be a challenge. That's why we break the question of how to buy an air conditioner into simple categories for consideration. For example, which air conditioner type is ideal for hot, dry climates? How many BTUs should you look for in an air conditioner that's meant to cool a large room? Find the answers to these questions and more right here in our easy air conditioner buying guide, and can even compare air conditioners using our air conditioner comparison charts. Once you've learned a bit more about how to buy an air conditioner and are ready to buy an air conditioner that's right for you, you can get everything you need at Walmart for less. No matter which air conditioner you end up choosing, our entire selection of air conditioners comes with big savings. You'll also breathe even easier all year 'round with terrific low prices on ceiling fans , ventilation systems , air purifiers , thermostats and much more. So you see, figuring out which air conditioner to buy isn't really as difficult as it might seem if you have this air conditioner buying guide and our air conditioner comparison charts on your side. And when it comes to how to buy an air conditioner at great savings, Walmart really is the smart place to shop.", "parent_text": "Home Improvement", "department_text": "Patio & Garden", "department_id": 32}
