kup for many products when you shop at Walmart.com. Walmart has hundreds of options available at Every Day Low Prices. Be sure to stop by for all of your garage storage and garage supply needs, and see for yourself. Save money. Live better.", "parent_text": "Outdoor Power Equipment", "keyword_density": {"storage": "2.7", "garage": "4.3", "garage storage": "2.3", "garage supplies and garage storage": "1.9", "supplies": "1.2", "garage supplies": "1.6"}, "department_id": 32}
