{"department_text": "Party & Occasions", "nr_products": 259, "level": 0, "url": "http://www.walmart.com/browse/party-occasions/2637/?_refineresult=true&facet=special_offers%3AClearance&ic=48_0&path=0%3A2637&povid=cat2637-env202723-moduleA112912-lLinkLHNSpecialOffers1Clearance", "text": "Clearance", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "description_title": "Get decorations, party supplies and gifts for less at Walmart.com", "parent_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "keyword_count": {"party supplies": 4, "gifts": 8, "walmartcom": 3, "decorations": 4, "supplies": 6, "decorations party supplies and gifts": 1}, "description_wc": 231, "description_text": "Whether you're shopping for party supplies , holiday decorations, or thoughtful gift ideas, Walmart.com is your Special Occasion Headquarters. With thousands of items to choose from at unbeatable prices, you can easily find what you want\u2014just search by the type of occasion, recipient, holiday or craft project you're shopping for. We offer festive party supplies and decorations for weddings, birthday parties and holidays like Christmas, Halloween and the Fourth of July. You'll also save on terrific gifts for a wide range of occasions, like birthday gifts, graduation gifts and wedding gifts. You can even make your own gifts with our big selection of do-it-yourself arts and crafts supplies or choose from our personalized gifts like jewelry, linens, mugs and more, all with your own personalized touch. So why not save on all your party supplies and decorations at Walmart.com, and have more money left over to spend on great gifts ? You'll find everything you need right here, including gift cards and gift baskets. And when you're feeling creative, be sure to explore our terrific selection of arts and crafts supplies , ranging from photo albums to scrapbooking essentials to Cricut machines. Best of all, with unbeatable prices and quick delivery, Walmart.com makes it easier than ever to save on decorations, party supplies and gifts for all occasions. Now that's cause for celebration!", "parent_text": "Party & Occasions", "keyword_density": {"party supplies": "3.5", "gifts": "3.5", "walmartcom": "1.3", "decorations": "1.7", "supplies": "2.6", "decorations party supplies and gifts": "2.2"}, "department_id": 31}
{"department_text": "Pharmacy", "nr_products": 41, "level": -1, "url": "http://www.walmart.com/browse/beauty/flower-cosmetics/1085666_1007040_1101184?povid=cat1085666-env438844-moduleA012213-lLinkLHNNewBrands1Flower", "text": "FLOWER", "department_url": "http://www.walmart.com/cp/Pharmacy/5431?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pharmacy", "description_title": "FLOWER by Drew Barrymore \u2013 Exclusively at Walmart", "parent_url": "http://www.walmart.com/cp/1085666?povid=cat5431-env198764-moduleB120712-lLinkLHNRelatedTopics5Beauty", "keyword_count": {"drew": 4, "drew barrymore": 2, "flower": 1, "walmart": 3}, "description_wc": 185, "description_text": "You know her name, you know her style \u2013 and now you\u2019ll know her beauty secrets, too. Drew Barrymore\u2019s new premium \u2013 cosmetics line is exclusive to Walmart and is custom formulated with the same quality ingredients found in department store luxury brands, but sold for a fraction of the price. Actress, Producer, Director and former Co-Creative Director of her own CoverGirl campaign (2007-2012), Drew Barrymore has a true passion for makeup. FLOWER encompasses Drew's favorite cosmetics that she's used throughout her career. The portfolio consists of more than 181 eye, face, lip and nail products ranging from $4.98 to $13.98, and is available in more than 1,500 Walmart stores and on Walmart.com. A few standouts sure to brighten up your beauty bag include: \u2022 Ultimate Mascara with three settings to create your perfect length, thickness and curl. \u2022 Color Play Cr\u00e8me Eyeshadow for a long-wearing, ultra-shimmering finish. \u2022 Ready, Set, Glow! Blush-Bronzer Duo for a custom blush and contoured look. So do like Drew: Take care of yourself, nurture your inner beauty and love the way you look!", "parent_text": "Beauty", "keyword_density": {"drew barrymore": "2.2", "walmart": "1.6", "flower": "0.5", "drew": "2.2"}, "department_id": 34}
{"department_text": "Party & Occasions", "level": -1, "url": "http://www.walmart.com/cp/112776?povid=cat1089445-env435925-moduleA071013-lLinkLHNSpecialtyShops6WeddingShop", "text": "Wedding Shop", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "description_title": "Wedding Products Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/1089445?povid=cat2637-env202723-moduleA051212-lLinkLHNRelatedCategories3GiftShop", "keyword_count": {"walmart": 2, "wedding products": 1, "wedding": 5}, "description_wc": 109, "description_text": "Create an elegant and modern wedding without breaking the bank at Walmart.com. Whether you're deciding on save-the-date cards and invitations or shopping for an engagement ring and wedding band, and organizing a gift registry, we've got it covered. You'll find all the wedding products you're looking for, such as ring sets in gold, silver and platinum; wedding favors; and photo albums. Celebrate this joyous day with personalized gifts, including engraved wine boxes, split key chains, vows heart canvas and more. You can shop by category, by price point, and more at everyday low prices. So discover your wedding needs at Walmart.com \u2014 and save.", "parent_text": "Gift Shop", "keyword_density": {"walmart": "1.8", "wedding products": "1.8", "wedding": "4.6"}, "department_id": 31}
