{"level": -1, "url": "http://pin.walmart.com/sparkstudio-mancave/?povid=cat1089445-env435925-moduleA071013-lLinkLHNSpecialtyShops3ManCave", "text": "Man Cave", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "parent_url": "http://www.walmart.com/cp/1089445?povid=cat2637-env202723-moduleA051212-lLinkLHNRelatedCategories3GiftShop", "description_wc": 254, "description_text": "Save on everything you need to create your own Man Cave with Man Cave specials from Walmart. Every man needs a place that's all his own, a place to unleash his inner he-man and do man stuff like watch sports and play games with his buddies. Some people call it a game room. Others call it a workout room. For others, it's a work shop. At Walmart, we simply call it a Man Cave. Create your very own Man Cave at home with man-sized savings on our full selection of Man Cave essentials. Whether you're looking to set up a Gamer's Man Cave, Sports Fan's Man Cave , an Automotive Buff's Man Cave , a Rock-n-Roll Man Cave or a Man Cave just for movie buffs , you'll find everything you need to build the perfect Man Cave sanctuary. Discover stuff like home gym equipment, tools and workbench supplies, sports memorabilia, video game consoles and more, at big, manly savings. And of course, what Man Cave would be complete without a solid audio system and big-screen TV? Those are just a few of the Man Cave necessities you'll find here. When it comes right down to it, few things are more manly than saving money on the stuff you love most. So go ahead. Set up your Man Cave and have fun doing it. You'll feel good knowing you got all the stuff you need at great prices from Walmart.", "parent_text": "Gift Shop", "department_text": "Party & Occasions", "department_id": 31}
