ls to Cricut machines. Best of all, with unbeatable prices and quick delivery, Walmart.com makes it easier than ever to save on decorations, party supplies and gifts for all occasions. Now that's cause for celebration!", "parent_text": "Party & Occasions", "keyword_density": {"party supplies": "3.5", "gifts": "3.5", "walmartcom": "1.3", "decorations": "1.7", "supplies": "2.6", "decorations party supplies and gifts": "2.2"}, "department_id": 31}
{"department_text": "Party & Occasions", "nr_products": 176, "level": -1, "url": "http://www.walmart.com/browse/party-amp;-occasions/crafts/2637_667479?_refineresult=true&catNavId=667479&ic=32_0&path=0%3A2637&povid=cat667479-env202755-moduleA060212-lLinkLHNSpecialOffers3OnlyatWalmart&facet=special_offers%3AOnly+at+Walmart", "text": "Only at Walmart", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "description_title": "Crafts and Hobby Supplies", "parent_url": "http://www.walmart.com/cp/crafts/667479?povid=cat2637-env202723-moduleA051212-lLinkLHNRelatedCategories4Crafts", "keyword_count": {"supplies": 8, "hobby supplies": 1, "hobby": 2, "crafts": 3}, "description_wc": 234, "description_text": "From a wide selection of art supplies and paper craft items to fabric for crafts and sewing craft supplies, the craft and hobby supplies you are looking for are available at Walmart. Choose from a variety of kids' crafts , craft storage, art craft items, construction paper, craft pens and pencils and sewing and craft patterns at Walmart. You'll find the supplies you need for scrapbooking and jewelry making. Our extensive array of craft supplies and products includes sewing and craft tables , needlecraft supplies and much more. Whether you're shopping for Crayola washable markers, Lalaloopsy Drawing Portfolios, National Geographic paper craft kits, Pacon poster board or Simplicity patterns, Walmart has the supplies for your craft projects. You'll find a wide selection of items, including Art Bin Super Satchels or Inkssentials Craft Spinners. Walmart also stocks a variety of crochet kits, ribbons and buttons for your convenience. Look for Every Day Low Prices on craft and hobby supply value bundles and sort online by brand, price, customer preference or special offers, such as rollbacks and clearance. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. Our selection of arts and crafts can match your needs. You can find Cricut machines and cartridges, photo organization products and the supplies you need to create keepsakes at Walmart. Save money. Live better.", "parent_text": "Crafts", "keyword_density": {"crafts": "1.3", "supplies": "3.4", "hobby supplies": "0.9", "hobby": "0.9"}, "department_id": 31}
