{"department_text": "Party & Occasions", "level": -1, "url": "http://photos.walmart.com/walmart/storepage/storePageId=Photo+Gifts?povid=cat1089445-env435925-moduleA071013-lLinkLHNGreatGiftIdeas4PhotoGifts", "text": "Photo Gifts", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "description_title": "Photo Cards and Gifts", "parent_url": "http://www.walmart.com/cp/1089445?povid=cat2637-env202723-moduleA051212-lLinkLHNRelatedCategories3GiftShop", "keyword_count": {"gifts": 7, "photo": 14, "photo cards and gifts": 3, "cards": 5}, "description_wc": 222, "description_text": "Everyone is sure to appreciate photo cards and gifts from Walmart. And you'll appreciate the extensive selection of hundreds of holiday photo greeting cards and many more wonderful items that can feature your favorite photo to make them one of a kind. Greeting cards and invitations let you share your photos and messages for less. Our photo gifts range from books to blankets for memories that they will cherish forever. And you can get quality prints at picture perfect prices from Walmart. Our selection of custom photo gifts includes photo books, photo blankets, photo calendars, faux canvas enlargements, wall art, clothing, jewelry, photo Christmas tree ornaments, accessories, home and office products, coffee mugs, posters, prints, seasonal gifts, and licensed content gifts that feature Mickey Mouse, SpongeBob and NASCAR. Walmart also offers the benefits of free membership when you create your own Photo Center account. You'll receive 25 free 4x6 prints that are processed in one hour at your local Walmart store and free unlimited secure online photo storage for your valuable digital pictures. In addition to our Every Day Low Prices, you can take advantage free shipping to your home or local Walmart store on all holiday photo cards and gifts for a limited time. So shop for photo cards and gifts at Walmart.com to save money and live better.", "parent_text": "Gift Shop", "keyword_density": {"gifts": "3.2", "photo": "6.3", "photo cards and gifts": "5.4", "cards": "2.3"}, "department_id": 31}
{"department_text": "Party & Occasions", "level": -1, "url": "http://www.walmart.com/cp/home-decor/133012", "text": "Home Decor", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "description_title": "Home Decor", "parent_url": "http://www.walmart.com/cp/633379?povid=cat2637-env202723-moduleA051212-lLinkLHNHolidays4Christmas", "keyword_count": {"home": 14, "decor": 10, "home decor": 6}, "description_wc": 246, "description_text": "Find home decor, home furnishings and even home decorating ideas at Walmart.com. Whether you're shopping interior design for a cozy cottage or a luxurious vacation home, we've got you covered. From kitchen accessories to bedroom decor, the home furnishings you are looking for are available at Walmart. We carry a wide variety of home decor collections, including Better Homes and Gardens, Canopy, Colchester Ave, Hometrends, Mainstays and many more top brands. At Walmart, you'll find a varied selection for your home decorating needs, including stylish rugs, elegant candle holders , wax warmers, decorative pillows , wall art and colorful slipcovers. Choose a new decorative theme for your living and dining spaces or revamp the decor of a guest room. With the convenience of Walmart.com, you can do it all at once. Browse our selection for home furnishings that complement your existing style, or mix and match colors to try something new. Filter search results by categories, such as window coverings , room dividers or lighting, or compare by customer ratings and price points \u2014 all without needing an interior designer. It's always easy to shop for home decor at Walmart.com by brand, price range, customer rating or best sellers. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. Finding the right home furnishings has never been easier. Enhance your home for less, with home decor at Walmart. Save money. Liv