{"department_text": "Party & Occasions", "level": -1, "url": "http://www.walmart.com/cp/1088666?povid=cat1089445-env435925-moduleA071013-lLinkLHNSpecialtyShops1BirthdayShop", "text": "Birthday Shop", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "description_title": "Birthday Shop at Walmart", "parent_url": "http://www.walmart.com/cp/1089445?povid=cat2637-env202723-moduleA051212-lLinkLHNRelatedCategories3GiftShop", "keyword_count": {"walmart": 4, "birthday shop at walmart": 2, "birthday": 7}, "description_wc": 166, "description_text": "Children love to celebrate birthdays so make their big day even more special with the Birthday Shop at Walmart. It's easy to find gift ideas for every age group and any budget at Walmart. You can browse through fun and fascinating gifts for babies and toddlers, as well as children from 5 to 7, 8 to 11, and 12 and up. Choose from popular gifts under $15, under $30, and under $50. We even have birthday gift cards, too. It's easy to pick the best gift for that special boy or girl with our convenient online Toy Finder that searches for gift ideas based on characteristics that you select. We also have everything you need to throw the perfect party, from decorations to the right cake. And our Celebrations Center on Walmart.com offers valuable information and tips on how to plan, host and celebrate birthdays. So when it's time for the next birthday and birthday party, save with the Birthday Shop at Walmart.", "parent_text": "Gift Shop", "keyword_density": {"walmart": "2.4", "birthday shop at walmart": "4.8", "birthday": "4.2"}, "department_id": 31}
