{"department_text": "Party & Occasions", "level": -1, "url": "http://www.walmart.com/cp/133224?povid=cat1089445-env435925-moduleA071013-lLinkLHNGreatGiftIdeas5PersonalizedGifts", "text": "Personalized Gifts", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "description_title": "Personalized Gifts", "parent_url": "http://www.walmart.com/cp/1089445?povid=cat2637-env202723-moduleA051212-lLinkLHNRelatedCategories3GiftShop", "keyword_count": {"gifts": 11, "personalized gifts": 10}, "description_wc": 230, "description_text": "Everyone is sure to appreciate something special from the selection of personalized gifts at Walmart. And you'll appreciate the extensive selection of items that feature free personalization. Shop for gifts by occasion that include wonderful personalized gifts for weddings, housewarming celebrations, baby showers, anniversaries, religious events, Valentine's Day and Christmas. You can choose personalized gifts for her such as jewelry, apparel and accessories, bedding and bath, decor, kitchen and dining. Browse personalized gifts for him from our selection of jewelry, apparel and accessories, kitchen and dining, decor or even doormats. You can shop for personalized gifts for babies and kids that are arranged in categories for girls, boys, babies, and teens, as well as a category of toys and games. Our personalized gifts for grandparents include picture frames, apparel and accessories, decor, bedding and bath, and kitchen and dining. It's also easy to shop for personalized gifts at Walmart.com by color, price range, customer rating or best sellers. In addition to our Every Day Low Prices, you can take advantage of Home Free shipping to your door on many personalized gifts with a minimum $45 order of eligible Home Free items. Some personalized gifts are available for free store pickup, too, at your nearby Walmart store when you use Site to Store online ordering. So shop for personalized gifts at Walmart.com to save money and live better.", "parent_text": "Gift Shop", "keyword_density": {"gifts": "4.8", "personalized gifts": "8.7"}, "department_id": 31}
