{"department_text": "Party & Occasions", "nr_products": 377, "level": -2, "url": "http://www.walmart.com/browse/home/decor/mainstays/4044_133012?catNavId=133012&ic=0_0&povid=cat133012-env444056-moduleA121312-lLinkLHNFeaturedBrands5Mainstays&tab_value=Online&facet=brand%3AMainstays", "text": "Mainstays", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "description_title": "Home Decor", "parent_url": "http://www.walmart.com/cp/home-decor/133012", "keyword_count": {"home": 14, "decor": 10, "home decor": 6}, "description_wc": 246, "description_text": "Find home decor, home furnishings and even home decorating ideas at Walmart.com. Whether you're shopping interior design for a cozy cottage or a luxurious vacation home, we've got you covered. From kitchen accessories to bedroom decor, the home furnishings you are looking for are available at Walmart. We carry a wide variety of home decor collections, including Better Homes and Gardens, Canopy, Colchester Ave, Hometrends, Mainstays and many more top brands. At Walmart, you'll find a varied selection for your home decorating needs, including stylish rugs, elegant candle holders , wax warmers, decorative pillows , wall art and colorful slipcovers. Choose a new decorative theme for your living and dining spaces or revamp the decor of a guest room. With the convenience of Walmart.com, you can do it all at once. Browse our selection for home furnishings that complement your existing style, or mix and match colors to try something new. Filter search results by categories, such as window coverings , room dividers or lighting, or compare by customer ratings and price points \u2014 all without needing an interior designer. It's always easy to shop for home decor at Walmart.com by brand, price range, customer rating or best sellers. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. Finding the right home furnishings has never been easier. Enhance your home for less, with home decor at Walmart. Save money. Live better.", "parent_text": "Home Decor", "keyword_density": {"home": "5.8", "decor": "4.1", "home decor": "4.9"}, "department_id": 31}
