{"department_text": "Party & Occasions", "nr_products": 119, "level": -2, "url": "http://www.walmart.com/browse/sports-amp;-outdoors/sports-fan-shop/4125_1063984?_refineresult=true&ic=16_0&path=0%3A4125&povid=cat1063984-env269716-moduleA120711-lLinkLHNSpecialOffers2Rollback&facet=special_offers%3ARollback", "text": "Rollback", "department_url": "http://www.walmart.com/cp/Gifts/2637?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_PartyOccasions", "description_title": "The Sports Fan Shop Saves You Money at Walmart", "parent_url": "http://www.walmart.com/cp/1063984?povid=cat1089445-env435925-moduleA071013-lLinkLHNSpecialtyShops4SportsFanShop", "keyword_count": {"shop": 8, "walmart": 2, "sports fan shop": 7, "sports": 8}, "description_wc": 233, "description_text": "Get the most stylish and fun apparel, decor, and tailgating essentials featuring your favorite NFL teams, NCAA teams, and more in the Sports Fan Shop at Walmart.com. Whether you're following your top NCAA basketball team during March Madness or pulling for your favorite NFL team in the Super Bowl, our Sports Fan Shop has got you covered. You'll find everything you need, including Jerseys , Hoodies and Sweatshirts , T-Shirts , Bedding , Auto Accessories , and more. We have every NFL team covered, so you can show your football team pride. We also carry merchandise from many NCAA teams to get you ready for NCAA basketball March Madness. Our Sports Fan Shop is tailored to match your needs, and won't cost a bundle. Also, you can shop the Sports Fan Shop by league (NFL, MLB, NHL, NBA, NCAA, NASCAR), by category (football, basketball, baseball, hockey, soccer, and more), and even by price point. And that's not all. You'll find every type of item in the Sports Fan Shop to show your team pride. Choose from grills, coolers, watches, pillow pets, and even lawn gnomes sporting your team's uniform. Whether it's NFL football, NCAA basketball, or so many other sports, you'll find what you're looking for in our Sports Fan Shop. Stock up on Sports Fan Shop at Walmart.com and save.", "parent_text": "Sports Fan Shop", "keyword_density": {"shop": "3.5", "walmart": "0.9", "sports fan shop": "9.3", "sports": "3.5"}, "department_id": 31}
