 fashionable, functional and versatile entertainment centers for the home. With top brands and Every Day Low Prices, Walmart helps you save money and live better.", "parent_text": "TV Stands & Entertainment Centers", "keyword_density": {"tv": "4.6", "entertainment centers": "2.5", "tv stands": "5.9", "entertainment": "2.9"}, "department_id": 28}
