ate or special offers. Save even more with our TV special buys, TV value bundles and refurbished TVs. At Walmart.com, you can take advantage of free Site to Store shipping for most TVs and video equipment, as well as many accessories. Dozens of models are also available for same-day pickup in Walmart stores. So get your new TV and video equipment from Walmart to save money and live better.", "parent_text": "TV & Video", "keyword_density": {"video gear": "0.7", "tvs": "4.4", "walmart": "2.0", "video": "1.7", "save": "1.0", "tvs and video": "2.0"}, "department_id": 28}
