price from Walmart. Our selection and values on TV stands are pretty hard to beat.", "parent_text": "TV Stands & Entertainment Centers", "keyword_density": {"tv": "7.6", "tv stands": "8.5"}, "department_id": 28}
{"department_text": "Movies", "nr_products": 1560, "level": 0, "url": "http://www.walmart.com/browse/movies-amp;-tv/4096?_refineresult=true&catNavId=4096&selected_items=+&ic=48_0&depts=Mo&path=0%3A4096&search_sort=5&tab_value=All&facet=new_releases%3ASee+All&povid=cat4096-env204450-moduleB071313-lLinkLHNCategory1NewReleases", "text": "New Releases", "department_url": "http://www.walmart.com/cp/movies-tv/4096?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Movies", "description_title": "Get movies and top TV shows for less at Walmart.com.", "parent_url": "http://www.walmart.com/cp/movies-tv/4096?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Movies", "keyword_count": {"tv shows": 5, "tv shows for less": 1, "get": 2, "tv": 6, "less": 2, "movies": 10, "walmartcom": 2, "shows": 6}, "description_wc": 261, "description_text": "All the biggest movies and TV shows are right here at Walmart.com, for a lot less than you might expect. Whether you're looking for the latest summer blockbusters or all-time classics, you'll find thousands of movies and TV shows in every category, in your choice of DVD or Blu-Ray format. From classic series like Star Wars , Harry Potter and James Bond to newer phenomena like the Twilight movies and The Hunger Games , they're all waiting for you right here. Older viewers will find plenty to love, too, with classic films from the good old days of cinema. Action movies, comedies, romances, sports movies, period movies, chick flicks, cop movies, westerns, dramas\u2014they're all here for your enjoyment at prices you're going to love. We also have full seasons of the latest TV shows on DVD and Blu-Ray, so you can get caught up on every episode of your favorite show. You can preorder upcoming DVD and Blu-Ray new releases to ensure you'll be the first in your neighborhood to have the hottest movies and shows. Plus, with our new Video On Demand by VUDU technology, you can upload your favorite movies and TV shows to the cloud and watch them anywhere,