{"department_text": "Video Games", "level": -3, "url": "http://www.walmart.com/cp/1102672", "text": "PlayStation 4", "department_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "description_title": "Sony PlayStation 4 is\u2026", "parent_url": "http://see.walmart.com/gamecenter/?povid=cat1102672-env506344-moduleA022713-lLinkLHNRelatedContentGamecenter", "keyword_count": {"playstation": 12, "playstation 4": 8, "sony playstation": 4, "4": 13, "sony": 5, "sony playstation 4": 3}, "description_wc": 419, "description_text": "Infinite gaming, limitless worlds, imaginative stories, all just for you. The new Sony PlayStation 4 launches a new era in video gaming where gameplay is more intuitive and on-screen environments are endlessly expanding. Working with some of the most creative minds in the industry, PlayStation 4 delivers breathtaking and unique gaming experiences. Simple, elegant design, inside and out, means seamless, engaging and immersive gameplay into worlds never before imagined. Gaming wherever you are and on whatever device. Using cloud storage, video games for the new PlayStation 4, as well as games from older PlayStation consoles ,can be easily and quickly downloaded, and, using Sony's Remote Play, can be accessed across multiple devices including tablet PCs, smartphones and the Sony PlayStation Vita. Social sharing made easy. On the new PS4, social gaming is easy and encouraged as essential to gaming on the new PlayStation 4. The new DualShock 4 controller features a Share button that allows you quick and easy access to your online network friends on the social media sites you already use. Share gaming highlights, high scores, game-changing plays, or reach out to friends for a helping hand. Simply push the share button on the new DualShock 4 controller and you're instantly connected. Get gaming faster. Using the new Suspend Mode, the power button delivers instant-pause and instant-on so you can start gaming right where you left off with no delay. The new PlayStation 4 features 8GB memory, a local hard drive and x86 CPU, alongside a secondary custom chip. This custom chip lets you start playing games while downloading is still in process. No more waiting, way more playing. It's all about you. The DualShock 4 controller features a six-axis sensor, a top-side touchpad and a light bar that uses different colors to interact with the Eye, a 3D camera that adds another dimension to your gameplay by supporting the PlayStation Move motion controller. This newly developed PlayStation Camera for PlayStation 4 incorporates two high-sensitive cameras that have wide-angle lenses with 85-degree diagonal angle views that can recognize the depth of space precisely. The Sony PlayStation 4 makes the gamer the center of the game. Not just gaming, entertainment. Beyond gaming, PS4 continues in the footsteps of its predecessors with integrated apps that allow you to access the Internet, stream your favorite movies, videos and music including VUDU . Simple, immediate, social, integrated and personal. The new Sony PlayStation 4: Push the Boundaries of Play.", "parent_text": "Gamecenter - Exclusive content & reviews", "keyword_density": {"playstation": "2.9", "playstation 4": "3.8", "sony playstation": "1.9", "4": "3.1", "sony": "1.2", "sony playstation 4": "2.2"}, "department_id": 42}
