{"level": -2, "url": "http://wm7.walmart.com/electronics-learning-center/tech-news?povid=cat1104695-env523392-moduleA051713-lLinkLHNRelatedContent2Geeks_GadgetsBlog", "text": "Geeks & Gadgets Blog", "department_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "parent_url": "http://www.walmart.com/cp/1104695?povid=cat1096069-env457079-moduleA062613-lLinkLHNComingSoonXBoxOne", "description_wc": 112, "description_text": "More exciting pictures from day 1 of what appears to be the largest video game expo on earth, E3. Nintendo promised to keep us busy with a regular release schedule of predominantly family games. Every other software develop made no such promise. E3 was filled to overflowing with an endless supply of over-the-top displays ranging from cute and charming to graphic and full of zombies. What you see here has been cleaned up and vetted to keep it safe-for-all (well most). For some the \"good stuff\", head over to GameCenter and check out their exclusive interviews and video trailers... if you dare! Can you dig it?", "parent_text": "XBox One", "department_text": "Video Games", "department_id": 42}
