{"level": -1, "url": "http://www.walmart.com/ip/Beats-by-Dr.-Dre-Studio-High-Definition-Headphones/21633561?povid=cat96469-env459356-moduleA062813-lLinkLHNWhatsNewBeatsStudio", "text": "Beats by Dr. Dre Studio now just $249", "department_url": "http://www.walmart.com/cp/Music/4104?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Music", "parent_url": "http://www.walmart.com/cp/96469?povid=cat4104-env205212-moduleA092911-lLinkLHNRelatedCategories2iPods_MP3Players", "description_wc": 241, "description_text": "Processing time for an item is the time from when you submit your order to when the item leaves the warehouse. You can usually find an item's processing time when you click \"See estimated arrival date\" on the item page. Shipping time is from when the item leaves the warehouse to when it arrives at your door. See shipping time below. The arrival date-range of each item is determined by adding the minimum of the processing time to the minimum of the shipping time and the maximum of the processing time to the maximum of the shipping time. For instance, if you bought a music CD that took 1 to 2 business days to process before shipping and you had it sent by Standard shipping (3 to 5 business days), the CD would arrive in 4 to 9 business days. You will usually see the estimated arrival date-range when you click \"See estimated arrival date\" on the item page. You will see the actual arrival date-range during checkout. Standard Shipping times apply to items being sent to the 48 contiguous states. For Standard Shipping to Alaska, Hawaii or Puerto Rico, add 2-4 days. Shipments to APO / FPO addresses should arrive in 3-6 weeks. Please note: Delivery of oversize items is limited to street addresses in the 48 contiguous states. You will see the estimated arrival date during checkout after you choose a shipping address.", "parent_text": "iPods & MP3 Players", "department_text": "Music", "department_id": 29}
