{"department_text": "Office", "nr_products": 102, "level": 0, "url": "http://www.walmart.com/browse/electronics/office/3944_546952?ic=16_0&refineresult=true&povid=cat546952-env202760-moduleA120811-lLinkLHNSpecialOffers1Rollback&facet=special_offers%3ARollback", "text": "Rollback", "department_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "description_title": "Home Office Products Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "keyword_count": {"office": 13, "less": 3, "home office": 12, "walmart": 2, "home": 16, "home office products": 2}, "description_wc": 252, "description_text": "Whether you run a serious business from home or just want a comfortable, well-equipped home office to catch up on emails and prepare your taxes, Walmart.com has all the home office supplies and home office equipment you'll need to get set up. You'll find the most useful home office supplies and home office equipment at Walmart.com. Our extensive selection of home office products features all the essentials for maximizing productivity without hurting your bottom line. You'll find everything you need for your home office including printers, computers, phones and wireless home network equipment, plus ink toner, keyboards, stationary, and paper shredders. Choose from brands such as Canon, Dell, Linksys, HP, and many others at everyday low prices. You can shop for your home office products by category, such as printers and ink, accessories, networking equipment, scanners, home safes and so on. And you already know you'll find the best prices on home office supplies like tape, staples, toner and printer paper, not to mention cutting-edge home office technology like a new printer, fax machine or wireless home networking system. You'll want to be comfortable, of course, so we have a full suite of modern and classic home office furniture to choose from, including desks, file cabinets, lamps, office chairs and much more. So if you're ready to set up your home office and don't want to break your budget doing it, we're here to help you get the job done for less.", "parent_text": "Office", "keyword_density": {"office": "5.2", "less": "1.2", "home office": "9.5", "walmart": "0.8", "home": "6.3", "home office products": "2.4"}, "department_id": 30}
