{"department_text": "Office", "nr_products": 3, "level": -1, "url": "http://www.walmart.com/browse/furniture/office-furniture/your-zone/4044_103150_97116?_refineresult=true&ic=29_0&path=0%3A4044&povid=cat97116-env200909-moduleA060212-lLinkLHNFeaturedBrands3yourzone&facet=brand%3AYour+Zone", "text": "your zone", "department_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "description_title": "Desks and Office Furniture", "parent_url": "http://www.walmart.com/cp/Office-Furniture/97116?povid=cat546952-env202760-moduleA080911-lLinkLHNRelatedCategories4HomeOfficeFurniture", "keyword_count": {"office": 16, "office furniture": 9, "desks": 13, "desks and office furniture": 6, "furniture": 10, "desks and office": 7}, "description_wc": 284, "description_text": "Desks and office furniture cost less at Walmart. From home office desks to a wide assortment of office chairs and stylish file cabinets , the office furniture accessories you're looking for are available here for less. Choose from a wide selection of home office desks and office furniture, including desks , bookcases, office chairs , kids' study desks and work station armoires at Walmart. You'll find everything you need for a modern office, like stylish organizers, comfortable desk chairs and contemporary work centers. Our office furniture and desks will complement your personal needs and style, without costing a bundle. We have all the home office furniture and desk brands you know and trust, whether you're shopping for desks and office furniture by Boss, Mainstays, Phoenix, TechniMobili, Altra, South Shore workstations or Hokku and Sauder bookcases. In addition to desks and office furniture, you'll also find Cleartex chair mats, CommClad or HON file cabinets, a Quartet privacy screen, Rubbermaid waster receptacles, a Safco wall coat rack or a Suncast recycle bin. Walmart also stocks a variety of carts and stands, office tables, seating accessories and much more. You can shop desks and office furniture online by category, by price point, by color, by customer preference or by special offers, such as rollbacks and clearance. Be sure to look for money-saving shipping offers and free store pickup for many desks and office products when you shop at Walmart.com, too. You can find the desks , workstations, kids' study desks, bookshelves and furniture accessories that are just right for you at Walmart. Low prices on desks and office furniture. Just another way we help you save money so you can live better.", "parent_text": "Home Office Furniture", "keyword_density": {"office": "5.7", "office furniture": "6.4", "desks": "4.6", "desks and office furniture": "8.6", "furniture": "3.6", "desks and office": "7.5"}, "department_id": 30}
{"department_text": "Office", "nr_products": 777, "level": -1, "url": "http://www.walmart.com/browse/computers/printers,-scanners-supplies/xerox/3944_3951_37807/YnJhbmQ6WGVyb3gie?_refineresult=true&povid=cat37807-env460100-moduleA040313-lLinkLHNFeaturedBrands10Xerox", "text": "Xerox", "department_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "description_title": "Computer Printers, Copiers and Scanners", "parent_url": "http://www.walmart.com/cp/37807?povid=cat546952-env202760-moduleA080911-lLinkLHNRelatedCategories5Printers_Ink", "keyword_count": {"computer printers copiers and scanners": 1, "copiers": 2, "computer printers": 2, "computer": 5, "printers": 7, "scanners": 3}, "description_wc": 222, "description_text": "Computer printers, copiers and scanners. The new computer printer, copier or scanner you want is waiting for you right here, at a terrific low price. Come get a new printer with all the features you need for work, hobby or school. We carry printers by the top brands you know and trust, like HP, Canon, Brother, Lexmark and many more. And thanks to our Every Day Low Prices, you can get your choice of printer for less. What sort of computer printer or scanner do you want? We have laser printers, inkjet printers, photo printers and color printers. So no matter what kind of laser printer, inkject printer, photo printer or color printer you're looking for, you'll get it here at an awesome low price. Of course, our selection of copiers, scanners and all the printer accessories you need cost less at Walmart, too, so be sure to stock up on ink, paper and other needs while you're here. When you've picked out the computer printer, copier or scanner you want, don't miss our selection of other low-priced, top-quality electronics , including networking gear , TV and video equipment and everything else you can imagine. Computer printers and scanners cost less at Walmart, period, so get your new printer, copier or scanner here and save.", "parent_text": "Printers & Ink", "keyword_density": {"computer printers": "1.8", "copiers": "0.9", "computer printers copiers and scanners": "2.3", "computer": "2.3", "printers": "3.2", "scanners": "1.4"}, "department_id": 30}
