{"department_text": "Sports, Fitness & Outdoors", "nr_products": 358, "level": -1, "url": "http://www.walmart.com/browse/sports-fan-shop/apparel-fan-shop/4125_1063984_1063985?_refineresult=true&ic=32_0&povid=cat1064348-env271614-moduleA052212-lLinkLHNApparel&facet=league%3ANHL", "text": "Apparel", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Sports Apparel Fan Shop Saves You Money at Walmart", "parent_url": "http://www.walmart.com/cp/1064348?povid=cat4125-env449821-moduleA060813-lLinkLHNSportFanShops5NHL", "keyword_count": {"apparel": 5, "walmart": 2, "sports apparel fan shop": 4}, "description_wc": 209, "description_text": "Show your team spirit with stylish and fun apparel, jewelry, and accessories from the sports apparel fan shop at Walmart.com. Whether you're cheering on your alma mater during March Madness of the NCAA basketball tournament or showing support for your NFL football Super Bowl team, our sports apparel fan shop has got it all covered. You'll find everything you need, including Jerseys , T-Shirts , Hoodies and Sweatshirts , Jackets , Caps and Hats , Women's Clothing , Purses and Wallets , Jewelry , and Shoes and Slippers . Find the clothing you're looking for emblazoned with your favorite team logo. Search by league (NFL, NBA, MLB, NCAA, NHL), favorite team (Dallas Cowboys, New York Yankees, Green Bay Packers, Detroit Red Wings, LA Lakers, Notre Dame Fighting Irish, and more), sport (football, basketball, baseball, college), and price point. Our sports apparel fan shop lets you be as subtle or as bold as you like and won't cost a bundle. You can sport a hoodie and sweatpants with your favorite team's logo, or go with something a little smaller like a watch or cufflinks. So find your favorite team gear at the sports apparel fan shop at Walmart.com \u2014 and save.", "parent_text": "NHL", "keyword_density": {"apparel": "2.5", "walmart": "1.0", "sports apparel fan shop": "8.1"}, "department_id": 38}
