{"department_text": "Sports, Fitness & Outdoors", "level": -1, "url": "http://www.walmart.com/cp/4161?povid=cat1064347-env463336-moduleA101012-lLinkLHNRelatedCategories1TeamSports", "text": "Team Sports", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Team Sports Gear", "parent_url": "http://www.walmart.com/cp/1064347?povid=cat4125-env449821-moduleA060813-lLinkLHNSportFanShops4NFL", "keyword_count": {"team sports gear": 9, "team": 16, "gear": 12, "team sports": 15, "sports": 16}, "description_wc": 286, "description_text": "Team sports gear. Get fantastic team sports gear at Walmart. Perhaps watching big sporting events such as the Super Bowl, March Madness or the World Series gets you inspired? Why not channel your own inner NFL, NBA, MLB or NCAA star with awesome team sports gear and team sports equipment from Walmart? Whether you're shopping for football, basketball or baseball gear, we've got the team sports equipment you need. Our selection of team sports equipment gets you ready for indoor and outdoor recreational fun, from tumbling mats to aluminum bats, without costing a bundle. You'll find everything you need, including air pumps, sports training equipment, coaching tools and more. You can also find deals on official licensed professional team sports equipment ? choose from a wide selection of NFL and NCAA footballs, mini helmets and safety gear. When it comes to team sports gear, we offer balls, bats, gloves, cleats, protective pads, helmets and uniforms for less. Our extensive selection of team sports gear includes lacrosse equipment , soccer gear and football equipment at terrific low prices. And that's just a small taste of the team sports gear we offer. It's easy to shop for team sports equipment and team sports gear by brand. Choose from brands like Adidas, Nike, Easton, Rawlings, Starter, Wilson, Spalding and many more. You'll find team sports gear and team sports supplies for boys and girls playing at any level from kids' leagues to the most advanced local leagues. So whether your kids are playing for the school varsity team or just starting out in junior soccer or little league, you'll always score big on savings when you shop for team sports gear at Walmart.", "parent_text": "NFL", "keyword_density": {"sports": "5.6", "team sports gear": "9.5", "team sports": "10.5", "gear": "4.2", "team": "5.6"}, "department_id": 38}
