{"department_text": "Office", "level": -1, "url": "http://www.walmart.com/cp/microsoft-office-2010/1064728?povid=cat3951-env201969-moduleA061811-lLinkLHNFeaturedContent2MicrosoftOffice2010", "text": "Microsoft Office 2010", "department_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "description_title": "Introducing Microsoft Office 2010 at Walmart", "parent_url": "http://www.walmart.com/cp/computers/3951?povid=cat546952-env202760-moduleA080911-lLinkLHNRelatedCategories2Computers_Accessories", "keyword_count": {"microsoft office 2010": 3, "walmart": 2, "microsoft office 2010 at walmart": 1, "2010": 14, "office": 6}, "description_wc": 162, "description_text": "Upgrade your PC with Microsoft Office 2010 from Walmart.com. You can choose from Office Home and Student 2010, Office Home and Business 2010, Office Professional 2010. All three of these Microsoft Office 2010 suites include Word 2010, Excel 2010, PowerPoint 2010 and OneNote 2010. Word 2010 provides powerful writing tools to help you create outstanding documents along with improved SmartArt graphics, dynamic text effects and photo-editing tools. Whether you're working on the family budget or your company's financial statement, Excel 2010 gives you the tools to easily analyze your finances at home and at work. PowerPoint 2010 enables you to captivate your audience with dynamic presentations using new easy-to-use audio, video and photo-editing tools that let you crop, control brightness and contrast, sharpen or soften, and add artistic visual effects. OneNote 2010 provides you with a single place to collect, store, and share all your information. So start taking advantage of Microsoft Office 2010 at Walmart.com.", "parent_text": "Computers & Accessories", "keyword_density": {"microsoft office 2010": "5.6", "walmart": "1.2", "microsoft office 2010 at walmart": "3.1", "2010": "8.6", "office": "3.7"}, "department_id": 30}
