{"department_text": "Sports, Fitness & Outdoors", "nr_products": 6706, "level": -1, "url": "http://www.walmart.com/browse/sports-fan-shop/for-the-home-fan-shop/4125_1063984_1063994/?_refineresult=true&facet=league%3ANFL&povid=cat1064347-env463336-moduleA053113-lLinkLHNShopByCategoryForTheHome", "text": "For the Home", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "For the Home Fan Shop", "parent_url": "http://www.walmart.com/cp/1064347?povid=cat4125-env449821-moduleA060813-lLinkLHNSportFanShops4NFL", "keyword_count": {"shop": 5, "fan shop": 4, "home fan shop": 2, "fan": 8, "home": 4}, "description_wc": 257, "description_text": "Show your team spirit with affordable sports fan collectibles, such as sports watches, sports jerseys, sports furniture, sports dining accessories and more at the sports fan shop at Walmart.com. Whether you're heading out to root for your alma mater or planning the ultimate tailgating party, our For the Home Fan Shop has something for you. Display your team pride with our selection of team apparel, or accent your home decor with sports furniture, sports storage , sports bath products or sports bedding , like a Dallas Cowboys comforter set. You can root for your favorite team while you cook with a sports fan apron and matching oven mitt, or pack your meal in a St. Louis Cardinals lunchbox. Kids can get in on the action, too, with our selection of sport fan wall art and team mascot pillows or the Walmart NFL Stationary Supplies Bundle with team-themed school supplies. You can even decorate a bathroom with an NCAA or NFL team shower curtain. Walmart.com makes it easy to score your favorite sports fan gear and home accessories online. Browse by team, price point and league, including MLB, NBA, NCAA, NFL, NHL, NASCAR, Soccer or the Olympics. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. If you have a favorite sport or team, Walmart's For the Home Fan Shop has the accessories to make you cheer. With the Walmart sports fan shop, you can save money and live better \u2014 a winning combination.", "parent_text": "NFL", "keyword_density": {"shop": "2.0", "fan shop": "3.1", "home fan shop": "2.4", "fan": "3.1", "home": "1.6"}, "department_id": 38}
{"department_text": "Sports, Fitness & Outdoors", "nr_products": 1432, "level": -1, "url": "http://www.walmart.com/browse/sports-fan-shop/apparel-fan-shop/4125_1063984_1063985/?_refineresult=true&facet=league%3ANFL&povid=cat1064347-env463336-moduleA053113-lLinkLHNShopByCategoryApparel", "text": "Apparel", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Sports Apparel Fan Shop Saves You Money at Walmart", "parent_url": "http://www.walmart.com/cp/1064347?povid=cat4125-env449821-moduleA060813-lLinkLHNSportFanShops4NFL", "keyword_count": {"apparel": 5, "walmart": 2, "sports apparel fan shop": 4}, "description_wc": 209, "description_text": "Show your team spirit with stylish and fun apparel, jewelry, and accessories from the sports apparel fan shop at Walmart.com. Whether you're cheering on your alma mater during March Madness of the NCAA basketball tournament or showing support for your NFL football Super Bowl team, our sports apparel fan shop has got it all covered. You'll find everything you need, including Jerseys , T-Shirts , Hoodies and Sweatshirts , Jackets , Caps and Hats , Women's Clothing , Purses and Wallets , Jewelry , and Shoes and Slippers . Find the clothing you're looking for emblazoned with your favorite team logo. Search by league (NFL, NBA, MLB, NCAA, NHL), favorite team (Dallas Cowboys, New York Yankees, Green Bay Packers, Detroit Red Wings, LA Lakers, Notre Dame Fighting Irish, and more), sport (football, basketball, baseball, college), and price point. Our sports apparel fan shop lets you be as subtle or as bold as you like and won't cost a bundle. You can sport a hoodie and sweatpants with your favorite team's logo, or go with something a little smaller like a watch or cufflinks. So find your favorite team gear at the sports apparel fan shop at Walmart.com \u2014 and save.", "parent_text": "NFL", "keyword_density": {"apparel": "2.5", "walmart": "1.0", "sports apparel fan shop": "8.1"}, "department_id": 38}
{"department_text": "Office", "level": -1, "url": "http://www.walmart.com/cp/1077504?povid=cat3951-env201969-moduleA061811-lLinkLHNRelatedCategories3PCGaming", "text": "PC Gaming", "department_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "description_title": "PC Gaming", "parent_url": "http://www.walmart.com/cp/computers/3951?povid=cat546952-env202760-moduleA080911-lLinkLHNRelatedCategories2Computers_Accessories", "keyword_count": {"pc": 11, "gaming": 5, "pc gaming": 3}, "description_wc": 198, "description_text": "With best-selling selections in PC gaming, you'll be immersed in a world of adventure and action-packed fun with the PC games available at Walmart. Choose from popular PC games, including the hottest new releases. You will also enjoy games from our featured genres, including PC adventure games and more. From social games and PC strategy games to PC racing games and PC shooting games , the PC games you are looking for can be found at Walmart. We also carry a large assortment of PC gaming accessories . We offer gaming mice and gaming keyboards from brands like Kensington and Steel Series, as well as an array of controllers from brands like Saitek. At Walmart.com, it's a breeze to shop for PC gaming products by genre, console, motion controller, game collections, bundles, ESRB rating, brand, price, customer rating, special offers, coming soon and new releases. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. When you're looking for PC games and accessories, you can find what you need and more at Every Day Low Prices from Walmart. Save money. Live better.", "parent_text": "Computers & Accessories", "keyword_density": {"pc": "5.6", "pc gaming": "3.1", "gaming": "2.6"}, "department_id": 30}
