{"department_text": "Office", "level": -2, "url": "http://www.walmart.com/cp/microsoft-office-2010/1064728", "text": "MS Office 2010", "department_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "description_title": "Introducing Microsoft Office 2010 at Walmart", "parent_url": "http://www.walmart.com/cp/Introducing-Windows-7/559890?povid=cat3951-env201969-moduleA061811-lLinkLHNFeaturedContent1MicrosoftWindows7", "keyword_count": {"microsoft office 2010": 3, "walmart": 2, "microsoft office 2010 at walmart": 1, "2010": 14, "office": 6}, "description_wc": 162, "description_text": "Upgrade your PC with Microsoft Office 2010 from Walmart.com. You can choose from Office Home and Student 2010, Office Home and Business 2010, Office Professional 2010. All three of these Microsoft Office 2010 suites include Word 2010, Excel 2010, PowerPoint 2010 and OneNote 2010. Word 2010 provides powerful writing tools to help you create outstanding documents along with improved SmartArt graphics, dynamic text effects and photo-editing tools. Whether you're working on the family budget or your company's financial statement, Excel 2010 gives you the tools to easily analyze your finances at home and at work. PowerPoint 2010 enables you to captivate your audience with dynamic presentations using new easy-to-use audio, video and photo-editing tools that let you crop, control brightness and contrast, sharpen or soften, and add artistic visual effects. OneNote 2010 provides you with a single place to collect, store, and share all your information. So start taking advantage of Microsoft Office 2010 at Walmart.com.", "parent_text": "Microsoft Windows 7", "keyword_density": {"microsoft office 2010": "5.6", "walmart": "1.2", "microsoft office 2010 at walmart": "3.1", "2010": "8.6", "office": "3.7"}, "department_id": 30}
{"department_text": "Office", "nr_products": 8, "level": -2, "url": "http://www.walmart.com/browse/Computers/Desktop-Computers/_/N-96fgZ1yzjr65?catNavId=3951&fromPageCatId=3951&ic=48_0&ref=428236+4292340557&refineresult=true&catNavId=3951&povid=cat1077504-env450948-moduleA061113-lLinkLHNRelatedCategories1GamingDesktops", "text": "Gaming Desktops", "department_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "description_title": "Desktop Computers", "parent_url": "http://www.walmart.com/cp/1077504?povid=cat3951-env201969-moduleA061811-lLinkLHNRelatedCategories3PCGaming", "keyword_count": {"computers": 9, "desktop computers": 4, "desktop": 11}, "description_wc": 255, "description_text": "Whether you want a desktop computer for email, social networking, schoolwork, home finances, Web surfing or gaming, you'll find a broad selection of desktop PCs at Every Day Low Prices from Walmart. Our selection of desktop PCs includes all-in-one computers, refurbished computers, touchscreen computers, Windows computers and desktop computer bundles. Choose Intel PCs or AMD PCs from HP, Dell, Acer, Lenovo, Compaq, Gateway, CyberPower, iBuyPower, ASUS, Sony, Vizio and more popular brands. It's easy to shop for desktop computers at Walmart.com when you search by type, brand, processor, hard drive size, system RAM, price range, customer ratings or best sellers. In addition to desktop computers, you may also want to take a look at the latest laptop computers and tablet PCs and iPads that you can take anywhere. Of course, you'll find a complete selection of desktop computer peripherals, such as flat-panel computer monitors , printers and scanners , modems, NAS devices, USB adapters and hard drives at Walmart.com. We also offer a full range of desktop computer accessories , such as headsets, speakers, keyboards, mice, connection cables and surge protectors. You can save on shipping costs because most desktop computers qualify for free in-store pickup at your nearby Walmart store when you use Site to Store online ordering. You can also save when you choose a desktop PC bundle that includes a monitor, printer or other peripherals. Shop for desktop computers and more electronics at Every Day Low Prices from Walmart to save money and live better.", "parent_text": "PC Gaming", "keyword_density": {"computers": "3.6", "desktop computers": "3.2", "desktop": "4.4"}, "department_id": 30}
