l. At Walmart.com, you can take advantage of free Site to Store shipping on most computers. And some models are also available for same-day pickup in Walmart stores. So get your new computer from Walmart to save money and live better.", "parent_text": "Computers & Accessories", "keyword_density": {"save": "1.2", "walmart": "2.8", "computers": "0.8"}, "department_id": 30}
