{"department_text": "Office", "nr_products": 47, "level": -3, "url": "http://www.walmart.com/browse/computers/computer-accessories/3944_3951_132959?catNavId=132959&ic=48_0&facet=special_offers%3ASpecial+Buy&povid=cat132959-env503770-moduleA030213-lLinkLHNSpecialOffers1SpecialBuys", "text": "Special Buys", "department_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "description_title": "Computer Accessories", "parent_url": "http://www.walmart.com/cp/computer-accessories-peripherals/132959", "keyword_count": {"computer": 12, "computer accessories": 6}, "description_wc": 257, "description_text": "From colorful external hard drives and powerful audio and video components to computer monitors and USB flash drives, the computer accessories you're looking for are available at Walmart. We've got a wide selection of computer accessories, including web cameras, external hard drives, keyboards, computer screens and computer speakers . Plus, you'll save with our value bundles \u2014 choose from a camera, computer or television bundled with a variety of computer accessories or carry cases. Choose from a great selection of USB flash drives , cables, keyboards, mice and other computer accessories that complete the package. Whether you're shopping for a digital hard drive or checking out the latest Toshiba batteries, Walmart has you covered. You'll find the computer accessories you want, including Buffalo and Seagate hard drives, Western Digital hard drives, Logitech and Microsoft keyboards, Ergoguys large-print keyboards, Inland Pro foldable USB keyboards, Gear Head and Vantage webcams, Canon and Kodak printers and BlackBerry, Filemate or HP computer cases . Walmart also stocks a variety of mouse pads, microphones and headsets, scanners, cables and connectors and much more. You can filter results by type, brand, condition, price, customer rating or special offers, such as rollbacks and clearance. Be sure to look for Walmart's money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. Stock up on batteries, surge protectors and computer cases , and find the computer, accessories and software that are just right for you and your family at Walmart. Save money. Live better.", "parent_text": "Computer Accessories", "keyword_density": {"computer": "4.7", "computer accessories": "4.7"}, "department_id": 30}
