{"department_text": "Office", "nr_products": 49, "level": -3, "url": "http://www.walmart.com/browse/cell-phones/accessories/plantronics/1105910_133161/YnJhbmQ6UGxhbnRyb25pY3Mie?_refineresult=true&povid=cat133161-env498920-moduleB032813-lLinkLHNPlantronics", "text": "Plantronics", "department_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "description_title": "Cell Phone Accessories", "parent_url": "http://www.walmart.com/cp/133161?povid=cat1086506-env414475-moduleA062911-lLinkLHN3CellPhoneAccessories", "keyword_count": {"cell phone accessories": 3, "cell": 18, "cell phone": 16, "phone accessories": 4, "phone": 20}, "description_wc": 291, "description_text": "From Bluetooth headsets and cell phone batteries to iPhone cases and cell phone mounts , the cell phone accessories you're looking for are available at Walmart. Choose from our wide selection of cell phone chargers , memory cards, cell phone car kits and cell phone headphones and speakers. Walmart has a variety of cell phone protectors, clips, cell phone batteries , noise-cancelling headsets, docking stations and much more. Whether you're shopping for hands-free communication or checking out the latest iPhone accessories and cell phone chargers, Walmart has you covered. You'll find what you want, including headsets from Jawbone and Motorola and handsets from Apple, Blackberry, LG, Nokia, Palm and Samsung. We also have an Arkon windshield/dashboard mount kit, Wilson cell phone cradle boosters, Just Wireless cell phone chargers, a zBoost signal booster and an iHome speaker and charging dock for Android. If you are in the market for cell phone batteries, you will find Cellular Innovations, Premiertek Sensations, Spyder PowerShadow and Wireless One batteries to suit your needs. Walmart also stocks a variety of cell phone cases from brands like Body Glove, Griffin Technology, Kensington and Targus. At Walmart.com, it's easy to shop for cell phone accessories. You can filter results by brand, price, material, category, compatible devices, customer rating or special offers, such as rollbacks and clearance. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. You can stock up on prepaid minutes and shop for Bluetooth headsets , iPhone cases and cell phone car kits at Walmart. You will find cell phone accessories that are just right for you and your family, so you can save money and live better.", "parent_text": "Cell Phone Accessories", "keyword_density": {"cell phone accessories": "3.1", "cell": "6.3", "cell phone": "11.1", "phone accessories": "2.8", "phone": "7.0"}, "department_id": 30}
