{"department_text": "Sports, Fitness & Outdoors", "nr_products": 121, "level": -1, "url": "http://www.walmart.com/browse/sports-fan-shop/sports-amp;-outdoor-play-fan-shop/4125_1063984_1064023?_refineresult=true&ic=32_0&povid=cat1064348-env271614-moduleA052212-lLinkLHNOutdoorPlay&facet=league%3ANHL", "text": "Outdoor Play", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Sports and Outdoor Play Fan Shop Saves You Money at Walmart", "parent_url": "http://www.walmart.com/cp/1064348?povid=cat4125-env449821-moduleA060813-lLinkLHNSportFanShops5NHL", "keyword_count": {"outdoor play fan shop": 4, "walmart": 2, "sports and outdoor play fan shop": 3, "sports": 5}, "description_wc": 107, "description_text": "Show your team spirit with stylish and fun tents, chairs, grills and more in the Sports and Outdoor Play Fan Shop at Walmart.com. Whether you're rooting for the home team or just hanging out in the stadium parking lot, our Sports and Outdoor Play Fan Shop has got it all covered. You'll find everything you need, including rolling coolers, binoculars, caps, helmets and more, all emblazoned with your favorite sports team logo. Our Sports & Outdoor Play Fan Shop lets you be as subtle or as bold as you like. Show your team spirit with the Sports and Outdoor Play Fan Shop at Walmart.com \u2014 and save.", "parent_text": "NHL", "keyword_density": {"outdoor play fan shop": "15.0", "walmart": "1.9", "sports and outdoor play fan shop": "16.8", "sports": "4.7"}, "department_id": 38}
{"department_text": "Sports, Fitness & Outdoors", "nr_products": 1927, "level": -1, "url": "http://www.walmart.com/browse/for-the-home-fan-shop/decor-fan-shop/4125_1063984_1063994_1064005?_refineresult=true&ic=32_0&povid=cat1064348-env271614-moduleA052212-lLinkLHNHomeDecor&facet=league%3ANHL", "text": "Home Decor", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Sports Decor", "parent_url": "http://www.walmart.com/cp/1064348?povid=cat4125-env449821-moduleA060813-lLinkLHNSportFanShops5NHL", "keyword_count": {"decor": 10, "sports decor": 5, "sports": 15}, "description_wc": 269, "description_text": "Show your enthusiasm for your favorite sports team with Walmart's wide selection of sports decor. You can cheer your team on to victory while saving on the sports team logo items you want for your home. Whether you're an avid fan or just live with one, Walmart can take care of your sports decor needs. From sports lamps and other sports lighting to set the right mood for the big game to sports wall art and sports room decor, the items you want are available for less. For the den, the dorm and more, Walmart has the sports decor you want. From Sports wall decor to sports mats and rugs, you'll find multiple options to show your team spirit at home. Support your alma mater with an NCAA team logo rug or cheer on your local NFL team with a decorative picture frame. Make your Super Bowl or World Series party more festive with sports decor from Walmart. At Walmart.com, you can find the pieces of sports themed decor you need. With the ability to search by price, customer rating, brand name, item name and more, you can shop from the comfort of your own home and enjoy Walmart's low prices. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. So redecorate your child's bedroom or get the den ready for the new sports season with Walmart's wide selection of sports decor. Walmart makes it easy to show your team spirit at home, allowing you to save money and live better.", "parent_text": "NHL", "keyword_density": {"decor": "3.7", "sports decor": "3.7", "sports": "5.6"}, "department_id": 38}
