{"department_text": "Office", "nr_products": 498, "level": -1, "url": "http://www.walmart.com/browse/computers/printers,-scanners-supplies/brother/3944_3951_37807/YnJhbmQ6QnJvdGhlcgieie?_refineresult=true&povid=cat37807-env460100-moduleA040313-lLinkLHNFeaturedBrands1Brother", "text": "Brother", "department_url": "http://www.walmart.com/cp/home-office-products/546952?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Office", "description_title": "Computer Printers, Copiers and Scanners", "parent_url": "http://www.walmart.com/cp/37807?povid=cat546952-env202760-moduleA080911-lLinkLHNRelatedCategories5Printers_Ink", "keyword_count": {"computer printers copiers and scanners": 1, "copiers": 2, "computer printers": 2, "computer": 5, "printers": 7, "scanners": 3}, "description_wc": 222, "description_text": "Computer printers, copiers and scanners. The new computer printer, copier or scanner you want is waiting for you right here, at a terrific low price. Come get a new printer with all the features you need for work, hobby or school. We carry printers by the top brands you know and trust, like HP, Canon, Brother, Lexmark and many more. And thanks to our Every Day Low Prices, you can get your choice of printer for less. What sort of computer printer or scanner do you want? We have laser printers, inkjet printers, photo printers and color printers. So no matter what kind of laser printer, inkject printer, photo printer or color printer you're looking for, you'll get it here at an awesome low price. Of course, our selection of copiers, scanners and all the printer accessories you need cost less at Walmart, too, so be sure to stock up on ink, paper and other needs while you're here. When you've picked out the computer printer, copier or scanner you want, don't miss our selection of other low-priced, top-quality electronics , including networking gear , TV and video equipment and everything else you can imagine. Computer printers and scanners cost less at Walmart, period, so ge