{"department_text": "Sports, Fitness & Outdoors", "level": 0, "url": "http://www.walmart.com/cp/1064346?povid=cat4125-env449821-moduleA060813-lLinkLHNSportFanShops3NCAA", "text": "NCAA", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "NCAA Fan Shop Saves You Money at Walmart", "parent_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "keyword_count": {"shop": 7, "ncaa fan shop": 5, "ncaa": 7, "walmart": 2}, "description_wc": 207, "description_text": "Show your team spirit with stylish and fun apparel, jewelry, and accessories from the NCAA Fan Shop at Walmart.com. Whether you're headed out to root for your home team or just sitting on your lucky couch watching the big game, our NCAA Fan Shop has got everything covered. Maybe your NCAA school was one of the dominant teams during the college football bowl season. Perhaps your school team is primed to make a run at the title during March Madness. Or maybe neither is the case, but you still have a lot of school pride. No matter the case, our NCAA Fan Shop has what you're looking for. You'll find hoodies, jerseys, t-shirts, hats, watches, cufflinks and more emblazoned with your favorite NCAA team logo. Our NCAA Fan Shop lets you be as subtle or as bold as you like, and it won't cost a bundle. You can shop by school: Alabama Crimson Tide , Duke Blue Devils , Kentucky Wildcats , Michigan Wolverines , Notre Dame Fighting Irish , Oregon Ducks , USC Trojans , and many more. Or you can shop by price and/or category. So show your team spirit with the NCAA Fan Shop at Walmart.com \u2014 and save.", "parent_text": "Sports, Fitness & Outdoors", "keyword_density": {"shop": "3.5", "ncaa fan shop": "7.5", "ncaa": "3.5", "walmart": "1.0"}, "department_id": 38}
