hen you shop at Walmart.com. If you have a favorite sport or team, Walmart's For the Home Fan Shop has the accessories to make you cheer. With the Walmart sports fan shop, you can save money and live better \u2014 a winning combination.", "parent_text": "NCAA", "keyword_density": {"shop": "2.0", "fan shop": "3.1", "home fan shop": "2.4", "fan": "3.1", "home": "1.6"}, "department_id": 38}
