{"department_text": "Sports, Fitness & Outdoors", "nr_products": 181, "level": -2, "url": "http://www.walmart.com/browse/sports-amp;-outdoors/fishing-amp;-marine/4125_111667?_refineresult=true&ic=32_0&povid=cat111667-env296908-moduleB052612-lLinkLHNSpecialOffers2Rollbacks&facet=special_offers%3ARollback", "text": "Rollbacks", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Fishing and Marine Gear Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/111667?povid=cat4155-env458156-moduleA091813-lLinkLHNRelatedCategories5FishingMarine", "keyword_count": {"fishing and marine gear": 1, "walmart": 2, "cost": 1, "gear": 4, "fishing": 5}, "description_wc": 108, "description_text": "Get the very best fishing and marine gear at Walmart.com. Whether you're preparing for a quick trip to the lake or packing for an extended fishing trip, we've got you covered, from spincast reels to mini trolling motors. Our selection of fishing gear gets you out on the water, without costing a bundle. You'll find everything you need including rods, reels, motors, boats, boating electronics, and tools. Plus, you can also get versatile fishing gear that is perfect for camping, too \u2014 choose from a wide selection of coolers, knives, multi-tools, lanterns, chairs and folding tables. So shop for fishing gear at Walmart.com \u2014 and save.", "parent_text": "Fishing & Marine", "keyword_density": {"fishing and marine gear": "3.7", "walmart": "1.9", "cost": "0.9", "gear": "3.7", "fishing": "4.6"}, "department_id": 38}
