{"level": -2, "url": "http://brands.walmart.com/fishing/turn-a-kid-on-to-flyfishing/", "text": "Fly Fishing for Kids", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "parent_url": "http://www.walmart.com/cp/111667?povid=cat4155-env458156-moduleA091813-lLinkLHNRelatedCategories5FishingMarine", "description_wc": 402, "description_text": "Schooling your kids on flyfishing doesn't have to be as trying as helping them with their math homework. Start by limiting the time on the pond to a half-hour chunk. That prevents the kid from getting frustrated and the teacher from blowing a fuse. Here's how to optimize those minutes. KNOW YOUR STUDENTS Tailor your comments to your kids' age levels. A 14-year-old might understand what you mean by feel the rod load, but an 8-year-old won't. Remember to bring your own rod so you don't take the rod from the kid; that feels like punishment. Don't wait for perfection. Instead, introduce new concepts quickly to battle boredom. TEACH TIMING Start off with sidearm casts so that the kids can watch the fly line and better understand the physics of casting. Emphasize that fly casting is about timing, not strength. MAKE A CASTING CALL Tell your kids to treat the rod like a ringing telephone: Bring the rod up close to their ear, say, Hello, this is Drew Smith, and then set the phone down. That's the basic fly-casting movement: Sweep the rod back, stop it, let the rod load, and then make a forward cast. KEEP THINGS ROLLING If the kids struggle with the basics, switch to roll casting for the time being. It's easier to learn, and with a bit of success, they'll be ready to tackle a standard cast. TIME TO FISH Find a likely spot: Choose a time and place where the fish are willing. Bream beds are perfect. GO PRO Do your kids bristle at every suggestion you make? Sign up for a casting school, or hire a guide for a half day and outsource the tricky parts. CHOOSE A ROD A soft action helps kids feel the rod flex and load. Be wary of supershort rods, which can be difficult to cast. Go for an 8-foot, 6-weight, two-piece outfit. CONSIDER LINE WEIGHT Overline the rod by one line weight for easier turnover. GO EASY WITH FLIES Get a barbed fly stuck in your child's forehead and you can forget about him or her as a future fishing buddy. Only use flies with barbless hooks. For practice, tie orange egg yarn next to the fly to make it visible. On the water, cast big high-floating flies like Stimulators.", "parent_text": "Fishing & Marine", "department_text": "Sports, Fitness & Outdoors", "department_id": 38}
{"department_text": "Sports, Fitness & Outdoors", "nr_products": 32, "level": -2, "url": "http://www.walmart.com/browse/sports-amp;-outdoors/camping/4125_4128?_refineresult=true&ic=16_0&path=0%3A4125&povid=cat4128-env452043-moduleA052412-lLinkSpecialOffers1Clearance&facet=special_offers%3AClearance", "text": "Clearance", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Camping Gear Costs Less at Walmart", "parent_url": "http://www.walmart.com/cp/4128?povid=cat4155-env458156-moduleA091813-lLinkLHNRelatedCategories1Camping", "keyword_count": {"camping gear": 3, "walmart": 2, "gear": 6, "camping": 7}, "description_wc": 127, "description_text": "Next time you're at the campsite, you'll be glad you got camping and backpacking gear at Walmart.com. Whether you're shopping for tents and shelters, hiking and fishing gear, or searching for a comfortable air bed or sleeping pad, we've got the camping gear you need, from cookware to coolers and flashlights to lanterns. Our wide selection of camping gear gets you ready for any outdoor survival adventure, from tailgating to camping, without costing a bundle. You'll find everything you need, including camping furniture, grills, camping knives, coolers, backpacks, Coleman products and more. Plus, you can also find gear to use around your home, such as carports, emergency preparedness products, lights, and outdoor heaters. So get your camping gear at Walmart.com \u2014 and save.", "parent_text": "Camping", "keyword_density": {"camping gear": "4.7", "walmart": "1.6", "gear": "4.7", "camping": "5.5"}, "department_id": 38}
{"department_text": "Sports, Fitness & Outdoors", "nr_products": 242, "level": -2, "url": "http://www.walmart.com/browse/sports-amp;-outdoors/camping/4125_4128?_refineresult=true&ic=16_0&path=0%3A4125&povid=cat4128-env452043-moduleA052412-lLinkSpecialOffers2Rollback&facet=special_offers%3ARollback", "text": "Rollback", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Camping Gear Costs Less at Walmart", "parent_url": "http://www.walmart.com/cp/4128?povid=cat4155-env458156-moduleA091813-lLinkLHNRelatedCategories1Camping", "keyword_count": {"camping gear": 3, "walmart": 2, "gear": 6, "camping": 7}, "description_wc": 127, "description_text": "Next time you're at the campsite, you'll be glad you got camping and backpacking gear at Walmart.com. Whether you're shopping for tents and shelters, hiking and fishing gear, or searching for a comfortable air bed or sleeping pad, we've got the camping gear you need, from cookware to coolers and flashlights to lanterns. Our wide selection of camping gear gets you ready for any outdoor survival adventure, from tailgating to camping, without costing a bundle. You'll find everything you need, including camping furniture, grills, camping knives, coolers, backpacks, Coleman products and more. Plus, you can also find gear to use around your home, such as carports, emergency preparedness products, lights, and outdoor heaters. So get your camping gear at Walmart.com \u2014 and save.", "parent_text": "Camping", "keyword_density": {"camping gear": "4.7", "walmart": "1.6", "gear": "4.7", "camping": "5.5"}, "department_id": 38}
{"level": -2, "url": "http://brands.walmart.com/fishing/essential-lures/", "text": "5 Lures You Need", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "parent_url": "http://www.walmart.com/cp/111667?povid=cat4155-env458156-moduleA091813-lLinkLHNRelatedCategories5FishingMarine", "description_wc": 619, "description_text": "CHOOSE THE RIGHT BASS LURE Bass lures can be divided into five broad categories depending on the lure's design and how the angler manipulates the bait. Pack a tackle box with a few lures from each of these categories, and you'll catch bass in any weather, from any water. SURFACE LURE Otherwise known as topwater lures, these hard-bodied baits kick up a fuss. They gurgle, pop, jerk, waddle, and dart across the water surface and can draw explosive strikes from hungry bass. Surface lures with a cupped face are known as poppers, and pop and spray water as the angler snaps the rod tip. Poppers can imitate anything from dying baitfish to frantic frogs. Thin, lightweight pencil poppers skitter like a minnow on its last legs and few bass will turn down such an easy meal. One of the best retrieves for cigar-shaped surface lures is called walking the dog, in which the lure glides back and forth with a zigzag action as the angler twitches the rod tip low to the water.SOFT PLASTIC Few baits have changed the fishing world as much as soft plastics. Introduced as a large worm imitation in 1951, the realistic, lifelike baits now come in a dizzying array of shapes worms, salamanders, baitfish, crayfish, snakes, slugs, frogs, lizards, mice, and more. Fishing tactics for soft plastics are just as varied. Many are threaded on to a lead jig. Others are rigged with no weight on a weedless, wide-gap hook. And some of the most popular soft plastics are among the most pungent many of these baits are manufactured with natural or artificial scents and oils that prompt bass to chow down. If you ever feel overwhelmed by soft-plastic selections, it's hard to go wrong with a purple or black worm slow-twitched across the bottom. CRANK BAIT These hard-bodied diving lures imitate a wide range of tantalizing fish foods, most often baitfish such as shad or bluegill, but they can also imitate crayfish when worked right off the bottom. Made of wood or plastic and clad in realistic paints and holographic finishes, most crankbaits sport a hard plastic lip that forces them to dive and wobble when cranked through bass water. Crankbaits come in shallow, medium, and deep-diving versions, depending on the size of the plastic diving bill. SPINNERBAIT Safety-pin style spinnerbaits look nothing like a natural food but they catch bass like crazy. Built on a V-shaped wire frame, the baits have one or more revolving blades threaded to one wire shaft, while the other is tipped with a weighted hook dressed with an often garish skirt of brightly colored rubber or silicone. The spinning blades produce flash and vibration, while the wild, undulating rubber skirts often glittering with metal flakes give bass a temptation they often can't resist. Depending on the rate of retrieve, spinnerbaits can be skittered across the water's surface, helicoptered straight down through the water column, or bumped along the bottom. Many anglers consider spinners search baits, because they allow you to cover lots of water fast and help you figure out where bass are holding in short order. STICKBAIT Imitating everything from long, slender minnows to full-grown trout, stickbaits are most often fished with a twitching, stop-and-start motion that looks like prey species darting in and out of cover, or an injured and crippled baitfish struggling to stay alive. That herky-jerky death dance action spawns vicious strikes by feeding bass and can coax even the most close-mouthed largemouth to open wide. Many stickbaits come in a jointed version for even more emphatic action. THE ONE LURE YOU NEED FOR", "parent_text": "Fishing & Marine", "department_text": "Sports, Fitness & Outdoors", "department_id": 38}
