{"department_text": "Sports, Fitness & Outdoors", "nr_products": 120, "level": -2, "url": "http://www.walmart.com/browse/camping/metal-detectors/4125_4128_78781?catNavId=4128&ic=48_0&povid=cat4128-env452043-moduleA082113-lLinkLHNRelatedCategories7MetalDetectors&tab_value=35532_All", "text": "Metal Detectors", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Metal Detectors", "parent_url": "http://www.walmart.com/cp/4128?povid=cat4155-env458156-moduleA091813-lLinkLHNRelatedCategories1Camping", "keyword_count": {"metal": 7, "metal detectors": 6}, "description_wc": 234, "description_text": "Find coins and other possible treasure with a metal detector from Walmart.com at an Every Day Low Price. You can shop for a wide variety of metal detectors from Bounty Hunter, Fisher Labs, Garrett, Teknetics, Tesoro, Wildgame Innovations and other brands. It's easy to browse for metal detectors at Walmart by brand, price range, customer ratings or best sellers. In addition to metal detectors, you can browse a wide selection of more outdoor gear and sporting goods at Walmart.com. Our assortment of camping gear includes air beds, backpacks, camping furniture, canopies, shelters, cooking equipment, coolers, handheld GPS units, knives, camping tools, lights, lanterns, sleeping bags and tents. If you're into fishing, you can shop for boats, kayaks, fishing apparel, fishing gear, fishing rods and reels, fishing knives and tools, marine electronics and trolling motors at Walmart.com. Hunters will want to take a look at our hunting gear section that features hunting apparel, decoys, game feeders and scent lures, game calls, rifles, shotguns, lights and lanterns, plus optics and binoculars. You can take advantage of money-saving shipping offers on select metal detectors and other products throughout the sports and outdoors section of Walmart.com. Many metal detectors qualify for free in-store pickup at your nearby Walmart store when you use Site to Store online ordering. Shop for metal detectors and more outdoor recreation products at Walmart to save money and live better.", "parent_text": "Camping", "keyword_density": {"metal": "3.0", "metal detectors": "5.1"}, "department_id": 38}
{"department_text": "Sports, Fitness & Outdoors", "nr_products": 279, "level": -2, "url": "http://www.walmart.com/browse/sports-outdoors/fishing-marine/4125_111667/?_refineresult=true&facet=special_offers%3ANew&povid=cat111667-env296908-moduleB082312-lLinkLHNSpecialOffers1NewArrivals", "text": "New Arrivals", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Fishing and Marine Gear Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/111667?povid=cat4155-env458156-moduleA091813-lLinkLHNRelatedCategories5FishingMarine", "keyword_count": {"fishing and marine gear": 1, "walmart": 2, "cost": 1, "gear": 4, "fishing": 5}, "description_wc": 108, "description_text": "Get the very best fishing and marine gear at Walmart.com. Whether you're preparing for a quick trip to the lake or packing for an extended fishing trip, we've got you covered, from spincast reels to mini trolling motors. Our selection of fishing gear gets you out on the water, without costing a bundle. You'll find everything you need including rods, reels, motors, boats, boating electronics, and tools. Plus, you can also get versatile fishing gear that is perfect for camping, too \u2014 choose from a wide selection of coolers, knives, multi-tools, lanterns, chairs and folding tables. So shop for fishing gear at Walmart.com \u2014 and save.", "parent_text": "Fishing & Marine", "keyword_density": {"fishing and marine gear": "3.7", "walmart": "1.9", "cost": "0.9", "gear": "3.7", "fishing": "4.6"}, "department_id": 38}
{"level": -2, "url": "http://brands.walmart.com/fishing/get-salty-with-your-bass-skills/", "text": "Saltwater Fishing", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "parent_url": "http://www.walmart.com/cp/111667?povid=cat4155-env458156-moduleA091813-lLinkLHNRelatedCategories5FishingMarine", "description_wc": 308, "description_text": "Your largemouth tactics can come in handy during a week at the beach. You can adapt them to fishing in a saltwater marsh and you could be pulling trout, flounder, and redfish from the water instead of sulking at your 10th round of miniature golf. GEAR UP Spool a medium-weight spinning reel with 8- to 10-pound monofilament line. Stay away from braided lines; the mouths of marsh fish such as trout and flounder are surprisingly soft, and you'll need some stretch to keep from tearing hooks out. For a basic tackle kit, carry a dozen leadhead jigs in white and red, and a handful of curly-tailed jig bodies in colors that imitate shrimp and in chartreuse (1). POUND THE STRUCTURE Every dock piling, patch of oysters, bulkhead, rock pile, and abandoned crab pot is a potential reef full of fish. Target these areas just as you would fish around the tree stumps in the farm pond back home (2). AMBUSH HOLDING FISH Analyze each stretch of tidal current as if it were a river and then fish accordingly. Marshy points, undercut banks, and deep water beside oyster beds and sandbars are great places to cast for fish holding in the lee of the tides (3). BE THE BAIT In most cases, your lure will mimic shrimp or small baitfish. Lift and twitch your rod tip to allow the lure to rise and fall (4). CHECK THE TIDES Tides affect fish movements and feeding times to a huge degree because moving tides sweep a buffet of prey\u2014shrimp, small crabs, and baitfish into the feeding lanes of holding fish. In most coastal regions, two high tides and two low tides come in and out of the marsh each day. Fish the hour or so before and after each change of tide.", "parent_text": "Fishing & Marine", "department_text": "Sports, Fitness & Outdoors", "department_id": 38}
