{"department_text": "Sports, Fitness & Outdoors", "nr_products": 1055, "level": -1, "url": "http://www.walmart.com/browse/sports-outdoors/4125/?_refineresult=true&facet=special_offers%3AClearance&povid=cat4134-env434177-moduleA073013-lLinkLHNSpecialOffers3Clearance", "text": "Clearance", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Sports and Outdoor Equipment Costs Less at Walmart", "parent_url": "http://www.walmart.com/cp/4134?povid=cat4125-env449821-moduleA060813-lLinkLHNExerciseFitness13SeeAllExercise_Fitness", "keyword_count": {"equipment": 3, "outdoor": 2, "walmart": 2, "sports": 1}, "description_wc": 224, "description_text": "From durable camping gear to serious bikes and treadmills, we've got all the sporting goods and exercise equipment you're looking for at Walmart.com. Hit the home gym and get in shape with our vast assortment of sporting goods, treadmills, trampolines, team sports gear and outdoor items. Going camping? We've got a terrific selection of camping gear, including tents, canopies, coolers and air beds. You'll find bikes of every kind, too, from kids' bikes to adult bicycles to exercise bikes. Best of all, you'll enjoy big savings on your new bicycle compared to other bike shops. If it's camping you love, we have tents, camping stoves, sleeping bags, coolers and all the other outdoor gear and camping supplies you need. Same goes for fishing, with boatloads of fishing gear, fishing rods, fishing lures, tackle boxes, boating equipment and much more. For your home gym, we carry a full complement of weights, weight sets, exercise bikes, treadmills, workout clothes and more. And if you're a team player, we have all the team sporting goods you'll ever need, including soccer gear and softball gear . You can browse our bikes and sporting goods and camping equipment by brand to choose from Everlast, Gold's Gym, Pinnacle, Schwinn and all