{"department_text": "Sports, Fitness & Outdoors", "nr_products": 26, "level": -1, "url": "http://www.walmart.com/browse/sports-amp;-outdoors/exercise-amp;-fitness/4125_4134?catNavId=4134&ic=48_0&refineresult=true&povid=cat4134-env434177-moduleA073013-lLinkLHNSpecialOffers2AsSeenOnTV&facet=special_offers%3AAs+Seen+On+TV", "text": "As Seen On TV", "department_url": "http://www.walmart.com/cp/sports-outdoors/4125?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_SportsFitnessOutdoors", "description_title": "Exercise and Fitness Equipment", "parent_url": "http://www.walmart.com/cp/4134?povid=cat4125-env449821-moduleA060813-lLinkLHNExerciseFitness13SeeAllExercise_Fitness", "keyword_count": {"fitness": 11, "equipment": 8, "exercise and fitness equipment": 5, "exercise": 12, "exercise and fitness": 7}, "description_wc": 272, "description_text": "There are lots of good reasons to start working out at home on exercise and fitness equipment from Walmart.com. Many people want to get in shape or lose weight, while others may want to improve their health or simply have fun. Whatever the reason, you'll find an extensive assortment of exercise and fitness equipment to suit your needs at Walmart.com. You'll find a wide variety of exercise machines at Walmart.com. Popular exercise and fitness equipment choices include exercise bikes, exercise treadmills, steppers and rowers, and ellipticals, as well as home gyms. In addition to these exercise equipment categories, you'll also find strength and weight training equipment, ab and core toners, boxing gear , fitness accessories, fitness apparel, and Yoga and Pilates products. It's easy to shop for exercise and fitness equipment at Walmart.com by type, brand, price range, customer rating or best sellers. Many fitness product categories at Walmart.com are grouped by different fitness goals, such as goals to build muscle, enhance flexibility, increase cardio, lose weight, strengthen core or tighten and tone. The Calorie Burn Calculator on our website can be a useful resource to help you choose the right exercise and fitness products. You can choose from our selection of featured exercise equipment brands that includes Bowflex, Everlast, Gold's Gym, Nautilus, ProForm, Schwinn and many more. In addition to our Every Day Low Prices, you'll find money-saving shipping offers on many exercise and fitness products, as well as free store pickup for a number of items. Shop for exercise and fitness equipment at Every Day Low Prices from Walmart. Save money. Live better.", "parent_text": "See all Exercise & Fitness", "keyword_density": {"exercise and fitness": "7.7", "equipment": "3.0", "exercise and fitness equipment": "7.4", "exercise": "4.4", "fitness": "4.1"}, "department_id": 38}
