{"level": 0, "url": "http://instoresnow.walmart.com/article.aspx?Center=Pets&id=120071", "text": "The best food for your puppy", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "parent_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_wc": 247, "description_text": "Important Walmart Disclaimer: All content, including but not limited to, recipe and health information provided in In Stores Now, is for educational purposes only. Such content is intended to supplement, not substitute for, the diagnosis, treatment and advice of a medical professional. Such content does not cover all possible side effects of any new or different health program. Consult your medical professional for guidance before changing or undertaking a new diet or exercise program. Advance consultation with your physician is particularly important if you are under eighteen (18) years old, pregnant, nursing, or have health problems. If you have dietary restrictions and/or allergies, always read the ingredient list carefully for all food products prior to consumption. Allergens and their derivatives can have various names and may be present in some food brands but not others. If the ingredient list is not available on the food product, check with the food manufacturer, or do not consume the product. If you have a food allergy, speak to your physician and/or a registered dietitian for a comprehensive list of foods and their derivatives to avoid prior to using any recipe from Walmart.com. Neither the author nor Walmart.com assumes any responsibility for errors, omissions or contrary interpretation of the subject matter herein. Product information is provided by the supplier or manufacturer of the product and should not be construed as advice. Walmart does not sponsor, recommend or endorse any third party, product, service or information provided on this site.", "