ed outdoor play structures complete with swings and slides for the kids. So make the most of your outdoor living spaces with unbelievable savings on grills, grilling equipment and everything else you need for outdoor cooking and outdoor dining. Outdoor grills and grilling supplies cost less at Walmart.", "parent_text": "Patio & Garden", "keyword_density": {"outdoor grilling": "4.0", "grills": "4.4", "outdoor": "5.6", "grilling": "4.8", "grills and outdoor grilling": "3.2"}, "department_id": 32}
{"department_text": "Pets", "nr_products": 33, "level": 0, "url": "http://www.walmart.com/browse/vacuums-floor-care/vacuums-and-floor-care/4044_90548_4047_12787?catNavId=4047&ic=48_0&refineresult=true&path=0:4044&povid=cat5440-env194149-moduleA070612-lLinkLHNRelatedCategories2PetVacuums&browsein=true&facet=category%3AVacuums%7C%7Ctype%3APet", "text": "Pet Vacuums", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Vacuum Cleaners and Floor Care Products", "parent_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "keyword_count": {"floor": 6, "cleaners": 7, "vacuum cleaners": 5, "floor care products": 5, "products": 7, "vacuum cleaners and floor care products": 3, "vacuum": 6}, "description_wc": 235, "description_text": "When you're looking for vacuum cleaners and floor care products, Walmart has you covered. From carpet cleaners, dry vacuums and lightweight vacuum cleaners to floor care products, floor polishing machines and more, the selection of vacuum cleaners and floor care products available at Walmart has what you need. Whether you're shopping for a home or business, you can find the cleaning equipment you need to get the job done. At Walmart, you can choose from top brands such as Bissell, Dirt Devil, Dyson, Eureka, Hoover, McCulloch, Shark, Shop-Vac, Swiffer and more. You'll also discover a wide selection of cleaning supplies and steam cleaners available to help keep your home or office clean. Be sure to also browse our selection of carpet shampooers to find other items that may be right for you and your household. It's easy to shop for vacuum cleaners and floor care products at Walmart.com. You can filter your search by brand, price, customer rating, category, type, special offers and more to help find the items you want. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. When you need new vacuum cleaners or floor care products to keep your living and working spaces clean, you'll find that many of the products you want are available for less at Walmart. Save money. Live better.", "parent_text": "Pets", "keyword_density": {"floor": "2.6", "cleaners": "3.0", "vacuum": "2.6", "floor care products": "6.4", "products": "3.0", "vacuum cleaners and floor care products": "7.7", "vacuum cleaners": "4.3"}, "department_id": 33}
{"department_text": "Pets", "nr_products": 48, "level": 0, "url": "http://www.walmart.com/browse/pets/purina-one/5440?catNavId=5440&ic=48_0&path=0%3A5440&povid=cat5440-env194149-moduleA092011-lLinkLHNFeaturedBrands6PurinaOne&facet=brand%3APurina+One", "text": "Purina One", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Spoil your pet for less at Walmart", "parent_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "keyword_count": {"pet": 13, "walmart": 2}, "description_wc": 292, "description_text": "Keep your pets happy and healthy with quality pet supplies from Walmart.com. We carry a huge selection of pet food and pet supplies, including dog food, cat food, fish food, bird seed, rabbit food and more. In addition to the pet food your pet needs for the best nutrition, you'll also find a full range of pet supplies like bird cages, hamster cages, fish tanks, dog houses, bunny cages and cat baskets. Basically, all the supplies you need for your pets are right here at your fingertips. In dog supplies , shop for dog food from makers you know and trust, like Purina, Puppy Chow, Pedigree, Iams, Milk Bone and others. For your kitty, we carry cat food from Friskies, Meow Mix, Purina and Fancy Feast, to name a few. Cat litter, too, of course. Bird seeds and bird feeders, as well as feeders for small animals like hamsters and rabbits, are just a sampling of the other pet supplies we carry at great prices. Oh, and don't let us forget an ocean's worth of fish food and fish supplies for goldfish, bettas and other freshwater and tropical fish species. To keep your pets from destroying your shoes or furniture, we also offer a huge selection of fun, safe dog toys, chew toys, cat scratchers and other cat supplies that'll keep them busy for hours on end. Even your pet goldfish will enjoy the cool aquarium decorations you can add to his fish tank or fish bowl. And to ward off common pet pests like fleas and ticks, be sure to pick up some of our effective flea and tick control products. Best of all, you'll save a bundle when you get your pet supplies at Walmart.com", "parent_text": "Pets", "keyword_density": {"pet": "4.5", "walmart": "0.7"}, "department_id": 33}
