ite.", "parent_text": "Dogs", "department_text": "Pets", "department_id": 33}
{"department_text": "Rollback", "nr_products": 632, "level": 0, "url": "http://www.walmart.com/search/browse-ng.do?ic=48_0&ref=125871.125871+500501.500682&catNavId=130306", "text": "Toys", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_title": "Toys Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "keyword_count": {"walmart": 2, "toys": 13}, "description_wc": 236, "description_text": "From action figures and stuffed animals to kids' electronics and outdoor play , you'll find wonderful toys for kids of all ages at Walmart.com. We feature everyday low prices on dolls and dollhouses, pretend play, arts and crafts, development and learning toys, vehicles, trains and remote control toys and more. Kids can stay active and healthy while having fun with our outdoor play toys, as well as swing sets , bikes and riding toys. You can shop for toys by brand to choose from Disney, Fisher-Price, LEGO, Little Tikes, Leap Frog, Nerf and more. Or browse by age group to find toys for everyone from babies to kids who are 12 and up. You can also shop for toys by price range, customer rating or special offers. For even more ideas, our Toy Finder can help you find the perfect gift and gift ideas, while our Birthday Shop lets you plan a party and find great gifts, too. You'll also want to take advantage of free Site to Store shipping on many outdoor play toys, bikes and riding toys, scooters and more eligible toys. So get that climber and slide set they've always wanted, set up your home for hours of creative pretend play, find toys that will help them learn, or outfit your backyard for some seriously fun outdoor play. Shop for toys at Walmart.com to save money and live better.", "parent_text": "Rollback", "keyword_density": {"walmart": "0.9", "toys": "5.6"}, "department_id": 36}
{"level": -2, "url": "http://instoresnow.walmart.com/article.aspx?Center=Pets&id=103855", "text": "Safe use of flea & tick products", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "parent_url": "http://www.walmart.com/cp/202072?povid=cat1095032-env451909-moduleA011813-lLinkLHNRelatedCategories2Dogs", "description_wc": 274, "description_text": "Hundreds of pesticides, repellents, and growth inhibitors are available to protect your pet from flea and tick bites. Some of these products are avail\u00adable only from a veterinarian; others can be bought over the counter. Flea and tick products range from pills given by mouth to collars, sprays , dips, shampoos, powders and \u201c spot-ons ,\u201d liquid products squeezed onto the dog\u2019s or cat\u2019s skin usually between the shoulder blades or down the back. A few spot-on products are available for flea control in ferrets, and fly and tick control in horses. Pet owners need to be cautious about using flea and tick products safely, says Ann Stohlman, V.M.D., a veterinarian in the Food and Drug Administration\u2019s (FDA) Center for Veterinary Medicine. \u201cYou need to take the time to carefully read the label, the package insert and any accompanying literature to make sure you\u2019re using the product correctly.\u201d It\u2019s best to treat your pet at the begin\u00adning of flea and tick season, says Stohlman. The length of flea season, which peaks during warm weather months, varies depending on where you live. \u201cIt can last four months in some places, but in other places, like Florida, fleas can live all year long,\u201d says Stohlman. And fleas can live inside a warm house year-round no matter where you live. Ticks are found in some places year-round. The Centers for Disease Control and Prevention report that in most parts of the United States, the greatest chance of infection by a tick bite is spring and summer. Read the full article at http://www.fda.gov/downloads/ForConsumers/ConsumerUpdates/UCM172781.pdf.", "parent_text": "Dogs", "department_text": "Pets", "department_id": 33}
