{"level": -2, "url": "http://instoresnow.walmart.com/article.aspx?Center=Pets&id=97978", "text": "Welcoming your new puppy", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "parent_url": "http://www.walmart.com/cp/202072?povid=cat1095032-env451909-moduleA011813-lLinkLHNRelatedCategories2Dogs", "description_wc": 574, "description_text": "Do your shopping in advance. If your choice is a puppy, you'll need a collar and leash , a crate (a great aid in housebreaking), a brush or hand mitt for grooming, toys that will be safe for the puppy, a bed for the puppy, and non-tippable, easy-to-clean food and water bowls . If the puppy is to be housed outdoors, choose a well-insulated doghouse large enough to accommodate the puppy at its full-grown size. It should be located on a high, well-drained site protected from the wind. Choose a location that provides outdoor shade during the summer. You'll want the proper diet on hand to meet the special nutritional needs of your rapidly growing newcomer. Look for foods that are formulated to provide the proper amounts of protein, calcium, phosphorus and other nutrients puppies require for their development. Please remember: Puppies have unique nutritional needs and benefit from a food formulated for those needs. Select a veterinarian for your new puppy as soon as possible. Ask dog-owning friends and neighbors for recommendations. Choosing a veterinarian who is located nearby is a convenience and saves time if an emergency should occur. The best time to bring your newcomer home is at the beginning of a weekend. If possible, add a few vacation days. This gives you time to acquaint your puppy with its new home and to begin housebreaking and other training. Make arrangements with the person from whom you are getting the puppy as to the time you will pick him up. Avoid bringing home a new pet during busy times, such as birthdays and holidays. Family members are generally too busy with the festivities to devote adequate time to help a puppy become comfortable in his new home. Ask that the puppy not be fed prior to pickup time. This helps avoid the puppy's becoming car sick on his way to its new home. Once in his new home, remember that your puppy needs to adjust to strange new surroundings and people. Children can become especially excited. Explain to them that their new companion needs time out for naps. Show children how to pet the newcomer and the proper way to pick him up. A puppy should be closely supervised and taken outside to relieve itself after eating, following naps and play periods. As soon as possible after you adopt your puppy, take him to your veterinarian. At this time, a schedule can be worked out for needed vaccinations to protect your newcomer from a number of viral and infectious diseases. He should also be examined and treated, if necessary, for external and internal parasites. Bring any immunization information you may have received when you adopted your puppy to your veterinarian to begin a case history for future reference. It's a good idea to keep your own medical record. You may need it for reference if your pet's veterinarian is not available. Choose a name for your newcomer, and use only that name in calling the puppy. In teaching a puppy its name, as in all training matters, 100 percent cooperation of all family members is essential. When a puppy is sent mixed signals, he can become confused and may not respond to any of the contradictory signals. Remember these key words and you'll enjoy your new friends for years to come: Gentleness. Care. Patience. Consistency. Praise. Love.", "parent_text": "Dogs", "department_text": "Pets", "department_id": 33}
