{"level": -2, "url": "http://instoresnow.walmart.com/article.aspx?Center=Pets&id=104218", "text": "Facts about feeding dogs", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "parent_url": "http://www.walmart.com/cp/202072?povid=cat1095032-env451909-moduleA011813-lLinkLHNRelatedCategories2Dogs", "description_wc": 159, "description_text": "Some dog owners forget that humans require a variety of foods to ensure the consumption of nutritionally balanced meals. A quality dog food has a proper balance of all the nutrients a dog requires, together with a high level of palatability. Adding human food to a nutritionally balanced commercial dog food may upset the nutrient balance of your dog\u2019s diet. Ideally, table scraps should not be fed. You may also be creating behavior problems. Your dog may begin to steal food from the table or the food-preparation area. Try feeding your dog at regularly scheduled times, such as when the family is having breakfast or dinner. Feed only enough to maintain your dog in good body condition. Ignore its coaxing for additional food, or give hugs instead. Here are some of the foods to watch out for: Feeding Dogs for Life Stages: Puppies Feeding Dogs for Life Stages: Adult Dogs Feeding Dogs for Life Stages: Older Dogs", "parent_text": "Dogs", "department_text": "Pets", "department_id": 33}
