{"department_text": "Pets", "nr_products": 67, "level": -1, "url": "http://www.walmart.com/browse/Puppy-Supplies/_/N-97jh?_refineresult=true&ic=16_0&path=0%3A5440&ref=+429677&CatId=202072", "text": "Puppy Supplies", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Puppy Supplies", "parent_url": "http://www.walmart.com/cp/Pure-Balance/1097490?povid=cat5440-env194149-moduleA082112-lLinkLHNFeaturedBrands5PureBalance", "keyword_count": {"supplies": 7, "puppy": 16, "puppy supplies": 5}, "description_wc": 217, "description_text": "At Walmart, you'll find the puppy supplies you need for less. From puppy treats to puppy crates , the supplies you are looking for are available in store and online. When it comes to puppy supplies, Walmart has what you need to take care of your pet. You'll find puppy kennels , puppy training pads and more. Treat your beloved pet to puppy biscuits and toys. With a wide selection of supplies, Walmart is sure to have what you want for your growing puppy. At Walmart, you'll find a variety of puppy bowls and other essentials. We also carry puppy vitamins and puppy supplements to help keep your puppy healthy. With Walmart's Every Day Low Prices, you can stock up on the puppy supplies you need to help your pet thrive. When you shop for puppy supplies online at Walmart.com, you can sort by price, brand, customer rating and type of product. Browse our list of best sellers and featured items. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. You want what's best for your puppy, and Walmart can help make that happen. With our wide selection of puppy supplies for less, you can save money and live better.", "parent_text": "Pure Balance", "keyword_density": {"supplies": "3.3", "puppy": "7.4", "puppy supplies": "4.7"}, "department_id": 33}
