{"department_text": "Pets", "level": -1, "url": "http://www.walmart.com/cp/202073?povid=cat1095032-env451909-moduleA011813-lLinkLHNRelatedCategories1Cats", "text": "Cats", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Cat Supplies Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/1095032?povid=cat5440-env194149-moduleA070612-lLinkLHNRelatedCategories1PetMedications", "keyword_count": {"cat supplies": 4, "walmart": 2, "supplies": 6, "cat": 11}, "description_wc": 116, "description_text": "Keep your cats happy and healthy with the very best cat supplies from Walmart.com. We carry a huge selection of cat supplies including furniture, scratch pads, grooming supplies, kitten products and more. We've also got plenty of cat toys, cat games, health care solutions, flea medication, travel carriers and feeding supplies. Looking for a litter box, collar bell, or travel carrier? Forget the kennel; we've got you covered. You can also browse cat supplies by category, by price point, and by customer rating. Best of all, we offer a wealth of cat information on grooming, cat food, kitten concers and more in our Pet Center. Stock up on cat supplies at Walmart.com ? and save.", "parent_text": "Pet Medications", "keyword_density": {"cat supplies": "6.9", "cat": "9.5", "walmart": "1.7", "supplies": "5.2"}, "department_id": 33}
{"department_text": "Pets", "nr_products": 108, "level": -1, "url": "http://www.walmart.com/browse/Dogs/Dog-Houses/_/N-98ks?_refineresult=true&_refineresult=true&ic=16_0&path=0%3A5440&ref=+431020", "text": "Dog Houses", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Dog Houses", "parent_url": "http://www.walmart.com/cp/Pure-Balance/1097490?povid=cat5440-env194149-moduleA082112-lLinkLHNFeaturedBrands5PureBalance", "keyword_count": {"houses": 10, "dog": 19, "dog houses": 7}, "description_wc": 212, "description_text": "Dog houses. Get a new dog house or pet house for less here at Walmart. We have a terrific selection of doghouses to choose from and our doghouse prices are hard to beat, too. When you need a new doghouse for your beloved pet, you'll find the dog house or pet house you're looking for right here, where we do all we can to help you save on things like dog houses. The size of your dog will help determine the type of dog house you need. We have large dog houses for large dogs and smaller dog houses for small dogs. We also have small dog houses and pet houses that cats can use. Whatever kind of dog house you're looking for, you can be sure you'll save by getting it at Walmart. Dog houses are the only things you'll find here for your pets. In addition to doghouses, we carry a vast selection of pet supplies for pets of all kinds, including cat supplies and fish supplies , to name just a few. Best of all, our dog houses are priced low to save you money. You'll feel good knowing you've found the best doghouse for your pet at the best possible price.", "parent_text": "Pure Balance", "keyword_density": {"houses": "4.7", "dog": "9.0", "dog houses": "6.6"}, "department_id": 33}
{"department_text": "Pets", "nr_products": 147, "level": -1, "url": "http://www.walmart.com/browse/Dogs/Flea-Tick/_/N-58fa?_refineresult=true&_refineresult=true&ic=16_0&path=0%3A5440&ref=+244198", "text": "Flea & Tick", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Get flea and tick control for less at Walmart", "parent_url": "http://www.walmart.com/cp/Pure-Balance/1097490?povid=cat5440-env194149-moduleA082112-lLinkLHNFeaturedBrands5PureBalance", "keyword_count": {"flea and tick control": 1, "flea": 13, "tick": 9, "walmart": 2, "flea and tick": 5}, "description_wc": 229, "description_text": "Keep your dog (and your family) free of pesky fleas and ticks with big savings on flea and tick prevention from walmart. Whether you've tried flea collars, flea spray or any other flea and tick control system, Walmart is where you'll find the best prices on the very latest in safe, effective flea prevention for dogs. We carry all the top brands you know and trust in flea and tick protection, like Frontline for fleas and ticks, Pet Armor, Hartz Ultra Guard and more. Besides the itching and discomfort, there are flea and tick-borne diseases that can harm your pets and your family. Keep fleas and ticks away for good with the top flea and tick prevention and flea killers for dogs at the lowest prices. Safe, effective systems for preventing fleas and ticks isn't all we carry, of course. We also offer everything else your four-legged pal could possibly need, including dog food , chew toys for dogs, leashes of all lengths and strengths, grooming kits for dogs, dog shampoo and so many other essentials for dogs . And since puppies have their own unique needs, we have a special collection of puppy supplies . Plus, if you have a cat, a bird, a fish or any other pet, you'll find a complete menagerie of pet supplies for every kind of critter.", "parent_text": "Pure Balance", "keyword_density": {"flea and tick control": "1.8", "flea": "5.8", "tick": "4.0", "walmart": "0.9", "flea and tick": "6.6"}, "department_id": 33}
