{"level": -2, "url": "http://instoresnow.walmart.com/pets-center-cats-food-nutrition.aspx", "text": "Food & Nutrition", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "parent_url": "http://www.walmart.com/cp/202073?povid=cat1095032-env451909-moduleA011813-lLinkLHNRelatedCategories1Cats", "description_wc": 41, "description_text": "Some pet owners forget that humans require a variety of foods to ensure the consumption of nutritionally balanced meals. A quality cat food has the proper balance of all the nutrients a cat requires together with a high level of palatability.", "parent_text": "Cats", "department_text": "Pets", "department_id": 33}
