{"department_text": "Pets", "nr_products": 837, "level": -1, "url": "http://www.walmart.com/browse/Dogs/Carriers-Kennels/_/N-58f4?_refineresult=true&_refineresult=true&ic=16_0&path=0%3A5440&ref=+244192", "text": "Carriers & Kennels", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Get a dog carrier or kennel for less at Walmart", "parent_url": "http://www.walmart.com/cp/Pure-Balance/1097490?povid=cat5440-env194149-moduleA082112-lLinkLHNFeaturedBrands5PureBalance", "keyword_count": {"dog carrier": 4, "dog": 19, "kennel": 6}, "description_wc": 225, "description_text": "Keep your dog safe and sound and out of trouble with one of our high-quality dog kennels. We offer terrific savings on wire dog kennels and chain-link dog kennels of all shapes and sizes, and even pop-up portable dog kennels of tough nylon. While you're looking, be sure sure to check out our other necessary dog accessories, too, like a Weatherguard kennel cover to ward off the elements outside. Since we know that traveling with a dog can be a challenge, we make it easier with a large selection of durable and comfortable dog crates and dog carriers of all sizes. We have big dog carriers, small dog carriers, and everything in-between, suitable for road trips and flying with a dog. Dog kennels and dog carriers aren't all we carry, of course. We also offer everything else your four-legged pal could possibly want, including dog food , chew toys for dogs, leashes of all lengths and strengths, grooming kits for dogs, flea killer, dog shampoo and so many other essential things for dogs . And since puppies have their own unique needs, we have a special collection of puppy supplies . Plus, if you have a cat, a bird, a fish or any other pet, we have a complete menagerie of pet supplies for every kind of critter.", "parent_text": "Pure Balance", "keyword_density": {"dog carrier": "3.6", "dog": "8.6", "kennel": "2.7"}, "de