{"level": -2, "url": "http://instoresnow.walmart.com/article.aspx?Center=Pets&id=97979", "text": "Welcoming your new kitten", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "parent_url": "http://www.walmart.com/cp/202073?povid=cat1095032-env451909-moduleA011813-lLinkLHNRelatedCategories1Cats", "description_wc": 955, "description_text": "The thought of bringing home a new kitten can be at once exciting and overwhelming. Here are some kitten-specific suggestions that will help make your new friend's welcome a warm and lasting one. Keep small items, such as tinsel, rubber bands, buttons and beads out of reach \u2014 your kitten could choke on them. Place all electric cords out of reach. Also, be aware of those household products and plants that may be harmful to your new kitten. Bring your new kitten home in a cat carrier. Cat carriers are a safe and familiar place for your kitten when you visit the veterinarian or travel, and they can keep your curious kitten out of trouble when need be. You can help your kitten to understand what is expected by placing her in the litter box after feeding. Kittens do not need a full-size litter box and might do better in a box with lower sides (about 1 inch). Watch your kitten closely. When she begins nosing in corners or squatting, place her in the litter box. Gently scratch the kitten's front paws in the filler, so she begins to learn that this is the place to deposit and bury waste. If your kitten has an accident, wipe it up with a paper towel and place the paper towel in the litter box. Then, place the kitten in the litter box and repeat the process of scratching with her front paws. Do not punish your cat for having an accident. This won't help her to learn to use the litter box, it will only teach her not to eliminate in front of you. When your kitten begins to understand, don't take her good behavior for granted. Continue to praise her for using the litter box. It is important to make your kitten feel comfortable about grooming from an early age. Look into her ears, eyes, nose and mouth regularly. Look at her paws to prepare her for claw trimming when she needs it. Brush or comb your kitten regularly. Kittens can benefit from a different kind of diet than adult cats, as their stomachs are smaller and their nutritional needs somewhat different. Feed your kitten a kitten food that is specially designed to meet her nutritional requirements. Feed her in small amounts, several times a day. The most desirable age to adopt a kitten is between 8 and 12 weeks of age. Kittens obtained after 12 weeks may be more difficult to manage. The experiences of kittens during their first few months of life are important in helping to shape their temperaments and personalities as adults. Your kitten will need time to adjust to her new environment, and understanding this is the first step in getting off to a positive start. Place your kitten in a small, quiet place with food and a litter box. As she becomes more comfortable, you can gradually allow her access to other rooms in the house. Talk quietly to your kitten and gently pet her. Set a regular time and place for feeding your kitten. A kitten separated from her litter-mates and deprived of play activity may demonstrate some behavior problems in later life. Play helps introduce her to her environment and is very important in her behavioral development. Stalking and pouncing on imaginary prey aids in a kitten's neural and muscular development. Your kitten\u2019s socialization can be enhanced by frequent petting and handling, as studies show that petting a young kitten can make her more responsive as an adult cat. Exposing kittens to as many people as possible is important in helping to lessen their fear of strangers as adult cats. Kittens should also be introduced to children. Show children how to pet the kitten. A kitten not socialized with children may reject or even bite them after she has matured. Keep your kitten confined to one room of the house for the first few days, giving your other pet(s) a chance to grow accustomed to her smell. Make the first introduction short and sweet, removing the kitten after a few minutes. Most pets will work things out in their own way, which may take about a week. If your pets are having more difficulty adjusting, supervise their time together and be patient. Offer both pets a place to go when they want to be alone. Introducing a new kitten to an older animal can be very stressful on the older animal. Lavish most of your attention on the older animal, not the kitten, making sure that the old-timer doesn't feel threatened by the newcomer. Place one hand under your kitten\u2019s chest and use your other hand to support the rear. Gently lift the kitten into the crook of your arm. Your new kitten will sleep up to 16 hours a day. Establish a sleeping place for her right away, but think twice before you make that spot your bed. Once she gets comfortable, your kitten may sleep there for the rest of her life. It's not a good idea to use hands, fingers, feet or clothing when playing with a kitten, as your cute little kitten will eventually grow into a healthy-sized cat and you do not want to encourage aggressive behavior. Providing appropriate toys for exercising her natural predatory instincts of pouncing, stalking and chasing will ensure she has a safe and healthy outlet for these behaviors. Do not use toys that are too heavy for the kitten to move or that are small enough to be swallowed. A scratching post is an excellent investment for your new kitten. It will allow your kitten to scratch, stretch and exercise all at once.", "parent_text": "Cats", "department_text": "Pets", "department_id": 33}
{"level": -2, "url": "http://instoresnow.walmart.com/article.aspx?Center=Pets&id=41306", "text": "Dental care for cats", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "parent_url": "http://www.walmart.com/cp/202073?povid=cat1095032-env451909-moduleA011813-lLinkLHNRelatedCategories1Cats", "description_wc": 470, "description_text": "By four weeks of age, kittens have their incisors, the 12 small teeth in the front of the mouth. At six weeks, all 26 deciduous teeth are in. Kitten teeth should be white and clean, with the upper incisors meeting the lower incisors evenly. The gums and mouth tissue should be pink, or dark if pigmented; a pale color is a sign of anemia. If possible, accustom your kitten to having its teeth cleaned on a regular basis at home. Gently rub the pet's teeth with your finger. As she learns to accept this, use a soft cloth or a child's soft toothbrush dipped in a solution of baking soda and water or use a toothpaste especially for dogs and cats. Do not use toothpaste formulated for humans. Because cats swallow rather than spit out the preparation, this can cause stomach upset. Occasionally a kitten will retain some deciduous (baby) teeth after the permanent teeth have appeared. This may damage the soft tissues of the mouth and may even accelerate wear of permanent teeth. A veterinarian should be consulted to determine whether or not removal is necessary. Inspect your cat's mouth regularly for tartar buildup or a condition of the gums and brush your cat's teeth with the proper brush and toothpaste (made specifically for cats) once or twice a week. Consult with your veterinarian about the correct home-cleaning process or professional cleaning. Dry, crunchy foods can be helpful in keeping teeth clean by scraping against the teeth and acting like a toothbrush to help remove plaque. Still, there is no substitute for regular dental care. Lesions on your cat's gums or foul-smelling breath can be early warning signs of a potential problem. The most common dental problems cats experience result from plaque and calculus buildup. If left unchecked, plaque and calculus buildup can eventually cause inflammation of both the gums (gingivitis) and the membrane lining of the tooth socket (periodontitis). The infection resulting from these conditions may spread to other parts of the body such as the kidneys or valves of the heart. Dental problems may also result from injury, foreign bodies such as porcupine quills or foxtail, malnutrition or systemic health conditions that infect the mouth as well as other parts of the body. Common warning signs of dental problems in cats include: A cat who nibbles household plants may suffer from oral problems not related to a periodontal health condition. Diffenbachia, or \"dumb cane,\" can cause severe irritation and ulceration to a cat's mouth. The cat may salivate and have trouble swallowing. Prompt veterinary attention is needed. Click here to learn about the plants that should be kept away from your furry companion. For a more complete list of plants that are dangerous to cats, consult your veterinarian.", "parent_text": "Cats", "department_text": "Pets", "department_id": 33}
{"department_text": "Pets", "nr_products": 3, "level": -2, "url": "http://www.walmart.com/browse/pets/cats/5440_202073?catNavId=202073&ic=48_0&search_sort=+&povid=cat202073-env203389-moduleA092111-lLinkLHNSpecialOffers1NewArrivals&facet=special_offers%3ANew", "text": "New Arrivals", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Cat Supplies Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/202073?povid=cat1095032-env451909-moduleA011813-lLinkLHNRelatedCategories1Cats", "keyword_count": {"cat supplies": 4, "walmart": 2, "supplies": 6, "cat": 11}, "description_wc": 116, "description_text": "Keep your cats happy and healthy with the very best cat supplies from Walmart.com. We carry a huge selection of cat supplies including furniture, scratch pads, grooming supplies, kitten products and more. We've also got plenty of cat toys, cat games, health care solutions, flea medication, travel carriers and feeding supplies. Looking for a litter box, collar bell, or travel carrier? Forget the kennel; we've got you covered. You can also browse cat supplies by category, by price point, and by customer rating. Best of all, we offer a wealth of cat information on grooming, cat food, kitten concers and more in our Pet Center. Stock up on cat supplies at Walmart.com ? and save.", "parent_text": "Cats", "keyword_density": {"cat supplies": "6.9", "cat": "9.5", "walmart": "1.7", "supplies": "5.2"}, "department_id": 33}
