{"department_text": "Pets", "level": -2, "url": "http://health.walmart.com/", "text": "Health", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Save on Health Products at Walmart", "parent_url": "http://www.walmart.com/cp/1088604?povid=cat1095032-env451909-moduleA030813-lLinkLHNManagePrescriptions4NewPharmacyCustomer", "keyword_count": {"walmart": 5, "health": 8, "products": 5, "save": 3, "health products": 2, "health products at walmart": 1}, "description_wc": 242, "description_text": "Save money and live better with health products from Walmart. We have smart buys to keep you going strong when it comes to vitamins . Our selection features products for bone and joint health, a healthy heart, and immunity, as well as herbals, minerals, multivitamins, single vitamins and supplements. Our great brands for a healthy lifestyle include Centrum, Equate, Nature Made, One a Day, Spring Valley and many more. You can amp up or slim down to get fit with top brands and big savings from our diet and nutrition selection. It features diet foods, weight loss supplements, energy nutrition, sports nutrition, and even scales. Shop for mobility aids, diabetic supplies, daily living aids and more home health care at Walmart.com. Here you'll find useful items that offer convenience and comfort for a variety of health conditions. Our medicine cabinet enables you to save money on the relief you need. Browse through products for pain relief, ear care, eye care, first aid and sexual wellness, in addition to analgesics, allergy medicines, cold remedies, and flu treatments. It's easy to shop by price range, customer rating, or best sellers to find just the right health products at Walmart.com. Many products qualify for Home Free shipping with your $45 order of eligible items or free Site to Store shipping for pickup at your closest Walmart store. So shop for all of your health needs at Walmart to save money and live better.", "parent_text": "New Pharmacy Customer", "keyword_density": {"walmart": "2.1", "products": "2.1", "health": "3.3", "save": "1.2", "health products": "1.7", "health products at walmart": "1.7"}, "department_id": 33}
