{"department_text": "Rollback", "nr_products": 710, "level": 0, "url": "http://www.walmart.com/search/browse-ng.do?ic=48_0&ref=125872.125872+500501.500682&catNavId=130306", "text": "Sports, Fitness & Outdoor", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_title": "Sports and Outdoor Equipment Costs Less at Walmart", "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "keyword_count": {"equipment": 3, "outdoor": 2, "walmart": 2, "sports": 1}, "description_wc": 224, "description_text": "From durable camping gear to serious bikes and treadmills, we've got all the sporting goods and exercise equipment you're looking for at Walmart.com. Hit the home gym and get in shape with our vast assortment of sporting goods, treadmills, trampolines, team sports gear and outdoor items. Going camping? We've got a terrific selection of camping gear, including tents, canopies, coolers and air beds. You'll find bikes of every kind, too, from kids' bikes to adult bicycles to exercise bikes. Best of all, you'll enjoy big savings on your new bicycle compared to other bike shops. If it's camping you love, we have tents, camping stoves, sleeping bags, coolers and all the other outdoor gear and camping supplies you need. Same goes for fishing, with boatloads of fishing gear, fishing rods, fishing lures, tackle boxes, boating equipment and much more. For your home gym, we carry a full complement of weights, weight sets, exercise bikes, treadmills, workout clothes and more. And if you're a team player, we have all the team sporting goods you'll ever need, including soccer gear and softball gear . You can browse our bikes and sporting goods and camping equipment by brand to choose from Everlast, Gold's Gym, Pinnacle, Schwinn and all the other brands you love, all at low Walmart prices.", "parent_text": "Rollback", "keyword_density": {"equipment": "1.3", "outdoor": "0.9", "walmart": "0.9", "sports": "0.4"}, "department_id": 36}
{"department_text": "Pets", "level": -2, "url": "http://instoresnow.walmart.com/article.aspx?Center=Pets&id=41304", "text": "Common cat ailments", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "If your cat has persistent diarrhea \u2013 diarrhea that continues for more than two days \u2013 take your cat to the veterinarian with a stool sample.", "parent_url": "http://www.walmart.com/cp/202073?povid=cat1095032-env451909-moduleA011813-lLinkLHNRelatedCategories1Cats", "keyword_count": {"veterinarian": 5, "diarrhea": 1, "take": 2, "cat": 10}, "description_wc": 287, "description_text": "Cats can develop a variety of health conditions. Prevention is a big part of staying healthy. But you should also watch for general signs of health conditions and contact your veterinarian when you notice a problem or anything out of the ordinary. When it comes to identifying and treating problems, rely on your veterinarian and not a book or website. You should also call your veterinarian immediately if your cat is weak or listless, or refuses to take fluids. The most common allergy among cats is flea allergy. As cats get older, their sensitivity to fleabites increases. Food allergies can also manifest themselves as dermatitis and severe itching, or vomiting and diarrhea. One of the most common reasons for vomiting is hairballs, which can be minimized with regular coat brushing. Hairballs can occur even with shorthair cats. If you think your cat might be allergic to her food, try switching to another product with substantially different ingredients to see if that helps. Periodic throwing-up may also be a sign of an overactive thyroid or kidney infection. This is particularly common in older cats. Your veterinarian can do a blood test to find out about either. If your cat vomits more than usual or in some way demonstrates a departure from her normal habits, give her plenty of fluids so she does not become dehydrated and take her to the veterinarian. Signs of diabetes may include excessive thirst and urination; loss of weight or obesity. Diabetic cats should be kept indoors to avoid accidental feeding that could elevate their blood sugar. Upper respiratory conditions manifest themselves in your cat by cold or flu-like signs, such as a runny nose and sneezing combined with reddened, runny eyes.", "parent_text": "Cats", "keyword_density": {"diarrhea": "0.3", "veterinarian": "1.7", "take": "0.7", "cat": "3.5"}, "department_id": 33}
{"level": -2, "url": "http://health.walmart.com/health-tips/drug-health-care-center/118/", "text": "Drug & Health Care Center", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "parent_url": "http://www.walmart.com/cp/1088604?povid=cat1095032-env451909-moduleA030813-lLinkLHNManagePrescriptions4NewPharmacyCustomer", "description_wc": 105, "description_text": "Prescription Drugs Cost Less at Walmart From diabetes medications to drugs for high blood pressure, you'll find reliable information and great prices on all the prescription medications you need at Walmart.com. Whether you're interested in common drug side effects or need to know about possible drug interactions, Walmart\u2019s Drug and Health Care Center has you covered. Even more, you'll find the full range of Walmart Pharmacy's services \u2014 including $4 Prescriptions and Home Delivery \u2014 along with wide variety of over-the-counter medications for to meet all of your pharmacy needs. Visit the Drug & Health Care Center at Walmart.com \u2014 and save.", "parent_text": "New Pharmacy Customer", "department_text": "Pets", "department_id": 33}
{"department_text": "Pets", "nr_products": 498, "level": -1, "url": "http://www.walmart.com/browse/Dogs/Dog-Food/_/N-8zo8?_refineresult=true&_refineresult=true&ic=16_0&path=0%3A5440&ref=+419480", "text": "Dog Food", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Dog Food", "parent_url": "http://www.walmart.com/cp/Pure-Balance/1097490?povid=cat5440-env194149-moduleA082112-lLinkLHNFeaturedBrands5PureBalance", "keyword_count": {"dog food": 13, "dog": 23}, "description_wc": 221, "description_text": "When you want to keep your canine companion well-fed and healthy, Walmart has a wide selection of dog food for all types and ages of dogs to meet your needs. We carry vast array of products for your dog, including dog treats , dog snacks, dog biscuits, dry dog foods, natural dog foods, healthy dog foods, organic dog foods, canned dog foods and wet dog foods. We offer the name brand and\u00a0types that will suit your particular dog's taste and needs, including\u00a0Beneful dog food,\u00a0Iams dog food and Pedigree dog food, as well as many others. In addition to dog foods, you'll also find supplies, such as\u00a0dog beds, dog houses and flea and tick protectors at Walmart. Our products can help keep your dog healthy, comfortable\u00a0and protected. It's always easy to shop for dog foods at Walmart.com. Filter your search by type, brand, value bundles, price range, customer rating and special offers. You can also browse our selection of dog supplies and pet supplies . Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. If you're looking for the top brands of dog food to suit your pet's needs and tastes, Walmart has you covered. Save money. Live better.", "parent_text": "Pure Balance", "keyword_density": {"dog food": "11.9", "dog": "10.5"}, "department_id": 33}
{"nr_products": 70, "level": 0, "url": "http://www.walmart.com/browse/pharmacy/5431/?_refineresult=true&facet=special_offers%3ARollback&ic=16_0&path=0%3A14503%3A1058864", "text": "Pharmacy", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_wc": 0, "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "parent_text": "Rollback", "department_text": "Rollback", "department_id": 36}
{"department_text": "Rollback", "nr_products": 77, "level": 0, "url": "http://www.walmart.com/browse/pets/5440/?_refineresult=true&facet=special_offers%3ARollback&ic=16_0&path=0%3A14503%3A1058864", "text": "Pets", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_title": "Spoil your pet for less at Walmart", "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "keyword_count": {"pet": 13, "walmart": 2}, "description_wc": 292, "description_text": "Keep your pets happy and healthy with quality pet supplies from Walmart.com. We carry a huge selection of pet food and pet supplies, including dog food, cat food, fish food, bird seed, rabbit food and more. In addition to the pet food your pet needs for the best nutrition, you'll also find a full range of pet supplies like bird cages, hamster cages, fish tanks, dog houses, bunny cages and cat baskets. Basically, all the supplies you need for your pets are right here at your fingertips. In dog supplies , shop for dog food from makers you know and trust, like Purina, Puppy Chow, Pedigree, Iams, Milk Bone and others. For your kitty, we carry cat food from Friskies, Meow Mix, Purina and Fancy Feast, to name a few. Cat litter, too, of course. Bird seeds and bird feeders, as well as feeders for small animals like hamsters and rabbits, are just a sampling of the other pet supplies we carry at great prices. Oh, and don't let us forget an ocean's worth of fish food and fish supplies for goldfish, bettas and other freshwater and tropical fish species. To keep your pets from destroying your shoes or furniture, we also offer a huge selection of fun, safe dog toys, chew toys, cat scratchers and other cat supplies that'll keep them busy for hours on end. Even your pet goldfish will enjoy the cool aquarium decorations you can add to his fish tank or fish bowl. And to ward off common pet pests like fleas and ticks, be sure to pick up some of our effective flea and tick control products. Best of all, you'll save a bundle when you get your pet supplies at Walmart.com", "parent_text": "Rollback", "keyword_density": {"pet": "4.5", "walmart": "0.7"}, "department_id": 36}
