{"department_text": "Rollback", "nr_products": 102, "level": 0, "url": "http://www.walmart.com/browse/electronics/office/3944_546952?ic=16_0&refineresult=true&facet=special_offers%3ARollback", "text": "Office", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_title": "Home Office Products Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "keyword_count": {"office": 13, "less": 3, "home office": 12, "walmart": 2, "home": 16, "home office products": 2}, "description_wc": 252, "description_text": "Whether you run a serious business from home or just want a comfortable, well-equipped home office to catch up on emails and prepare your taxes, Walmart.com has all the home office supplies and home office equipment you'll need to get set up. You'll find the most useful home office supplies and home office equipment at Walmart.com. Our extensive selection of home office products features all the essentials for maximizing productivity without hurting your bottom line. You'll find everything you need for your home office including printers, computers, phones and wireless home network equipment, plus ink toner, keyboards, stationary, and paper shredders. Choose from brands such as Canon, Dell, Linksys, HP, and many others at everyday low prices. You can shop for your home office products by category, such as printers and ink, accessories, networking equipment, scanners, home safes and so on. And you already know you'll find the best prices on home office supplies like tape, staples, toner and printer paper, not to mention cutting-edge home office technology like a new printer, fax machine or wireless home networking system. You'll want to be comfortable, of course, so we have a full suite of modern and classic home office furniture to choose from, including desks, file cabinets, lamps, office chairs and much more. So if you're ready to set up your home office and don't want to break your budget doing it, we're here to help you get the job done for less.", "parent_text": "Rollback", "keyword_density": {"office": "5.2", "less": "1.2", "home office": "9.5", "walmart": "0.8", "home": "6.3", "home office products": "2.4"}, "department_id": 36}
{"department_text": "Rollback", "nr_products": 242, "level": 0, "url": "http://www.walmart.com/search/browse-ng.do?ic=48_0&ref=125862.125862+500501.500682&catNavId=130306", "text": "Outdoor Living", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_title": "Patio and Garden", "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "keyword_count": {"garden": 14, "patio": 13, "patio and garden": 3}, "description_wc": 246, "description_text": "Patio and garden. Enjoy the best of outdoor living with high-quality patio furniture, grills, garden equipment and gardening supplies from Walmart. We have all the patio and garden supplies you need to turn your outdoor spaces into beautiful havens for relaxation and family time. Whatever kind of patio or garden products you're looking for, you can find them right here for less. Our extensive selection of patio furniture, grills, gardening supplies and garden equipment includes patio decor , outdoor furniture, gas grills and outdoor cooking supplies , hot tubs, lawn mowers and lawn care. Get all the gardening supplies, patio essentials and outdoor furniture to help make your gardening projects and outdoor patio lifestyle really come together. Check out our functional, fashionable and durable patio furniture . Choose from a variety of benches, dining sets, chaises, swings, garden umbrellas and hammocks. Cooking great meals outdoors, hosting a neighborhood get-together or just lounging in your back yard, garden or patio has never been so easy. Whether you want to create the perfect patio, tackle that garden project, install a relaxing hot tub or sauna, or become the ultimate garden party host with patio dining and bistro sets, Walmart has it all at unbelievable prices. Or, you can become the most popular kid on the block with a huge selection of outdoor play structures and toys that will keep kids active outside. Shop for all your outdoor patio and garden needs at Walmart and save.", "parent_text": "Rollback", "keyword_density": {"garden": "5.8", "patio": "5.3", "patio and garden": "3.7"}, "department_id": 36}
{"department_text": "Pets", "level": -3, "url": "http://www.walmart.com/cp/5431?povid=cat1078944-env506746-moduleA030213-lLinkLHNRelatedCategories2Pharmacy", "text": "Pharmacy", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Prescriptions and More at Walmart Pharmacies", "parent_url": "http://www.walmart.com/cp/Vision/1061724", "keyword_count": {"walmart": 5, "walmart pharmacies": 1, "prescriptions": 1}, "description_wc": 112, "description_text": "Save time and money with savings programs and services at Walmart stores and Walmart.com. Walmart pharmacies accept major Rx insurance plans, such as Express Scripts, TRICARE and many others. It is easy to transfer your existing prescription by simply bringing your current Rx bottle or prescription from a plan, such as Express Scripts or TRICARE, to any Walmart pharmacy. While you are there, you can stock your medicine cabinet and find home medical equipment, too. You will also want to take advantage of $4 prescriptions, our online Wellness Shops and our online Specialty Pharmacy. So take care of all your pharmacy needs and more at Walmart to save money and live better.", "parent_text": "Vision", "keyword_density": {"walmart": "4.5", "walmart pharmacies": "1.8", "prescriptions": "0.9"}, "department_id": 33}
{"department_text": "Pets", "level": -3, "url": "http://www.walmart.com/cp/1078665?povid=cat976760-env189989-moduleA120211-lLinkLHNFeaturedContent2FlexibleSpendingAccount", "text": "Flexible Spending Account", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "About Flexible Spending Accounts", "parent_url": "http://health.walmart.com/health-tips/healthy-living-tools/104/", "keyword_count": {"flexible spending": 2}, "description_wc": 480, "description_text": "A flexible spending account (FSA) is a benefit plan set up with your employer that allows you to voluntarily withhold pre-tax dollars from your paycheck to pay for qualified health care expenses. Contributing to your FSA is a cost-effective way to reduce your taxable income and save money on health care essentials. New Restrictions: Beginning Saturday, January 1, 2011, purchases of many over-the-counter medications will only be eligible for pre-tax healthcare account reimbursement when they are purchased with a prescription. Read details here (PDF 138kb), or visit the IRS website for more information. With your FSA debit card With cash or credit What does FSA mean? FSA stands for Flexible Spending Account. An FSA allows you to voluntarily set aside a portion of your paycheck to pay for approved health care expenses. The money you put in your FSA is deducted from your paycheck before taxes are taken out, which means that you'll have less income to report at tax time and more money in your pocket. If FSA funds are not used by March 15 of the year following contribution, the funds are forfeited and cannot be rolled-over to the next year or refunded. How do I know which products are FSA-qualified? Qualifying items online are marked with an FSA symbol to make them instantly recognizable. In stores, your receipt at checkout will clearly identify qualified products with an \"H\" to the right of the item code (UPC), as well as provide a subtotal of the FSA-eligible purchases. Our systems are designed to recognize qualified items based on eligibility requirements in IRS guidelines. When a FSA debit card is used to purchase items, only items that meet the requirements will be debited from the FSA. Non-eligible items must be paid for with another form of payment. Program eligibilities vary, and only your plan administrator can tell you which products and services qualify. New Restrictions: Beginning Saturday, January 1, 2011, purchases of many over-the-counter medications will only be eligible for pre-tax healthcare account reimbursement when they are purchased with a prescription. Read details here (PDF 138kb), or visit the IRS website for more information. How do I pay for eligible health care items with my FSA funds? When you shop online at Walmart.com, you\u00b4ll email or print out and submit the purchase confirmation page to your FSA account administrator for reimbursement. When shopping in-store at your local Walmart, you\u00b4ll have two options: What is the Walmart item validation / substantiation program? Participating FSA Processors Cards and an eligible item list are maintained within the Walmart system. When a participating card is presented for payment, Walmart\u00b4s cash registers will only charge the FSA card for the eligible items. Non-eligible items will require payment with cash, check or another form of payment.*", "parent_text": "Health Resources", "keyword_density": {"flexible spending": "0.8"}, "department_id": 33}
{"department_text": "Pets", "level": -3, "url": "http://www.walmart.com/cp/976798?povid=cat1078944-env506746-moduleA030213-lLinkLHNRelatedCategories1MedicineCabinet", "text": "Medicine Cabinet", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Home Medicine Cabinet Supplies", "parent_url": "http://www.walmart.com/cp/Vision/1061724", "keyword_count": {"medicine cabinet": 2, "medicine": 3, "home": 3}, "description_wc": 222, "description_text": "Shop at Walmart.com to stock your medicine cabinet at Every Day Low Prices. Our selection of thousands of non-prescription medications includes over-the-counter drugs for allergy eye relief, cold and flu, digestive health, ear care, eye care, first aid, and smoking cessation, as well as allergy medicines, pain relievers, sleeping aids, and vitamins . We also offer braces and supports, home diagnostic tests, hot and cold therapy products, sexual wellness products, and thermometers. You can choose over-the-counter medications and wellness products from Advil, Alka-Seltzer, Band-Aid, Bayer, Claritin, Equate, Honeywell, Johnson and Johnson, Neosporin, Sunpentown, Tylenol, Zyrtec, and many other trusted brands. It's easy to browse for non-prescription drugs and health products at Walmart.com by brand, price range, customer rating, best sellers, medication form, special offers, and products for babies or children. In addition to our Every Day Low Prices, you can save even more with Home Free shipping on hundreds of over-the-counter medications with a minimum $45 order of eligible Home Free items. You'll find that many over-the-counter medications are also available for free store pickup at your nearby Walmart store when you use Site to Store online ordering. Stock your medicine cabinet with over-the-counter medications at Every Day Low Prices from Walmart. Save money. Live better.", "parent_text": "Vision", "keyword_density": {"medicine cabinet": "1.8", "medicine": "1.4", "home": "1.4"}, "department_id": 33}
