{"department_text": "Pets", "level": -3, "url": "http://www.walmart.com/cp/1005862", "text": "Personal Care", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Personal Care Products", "parent_url": "http://health.walmart.com/health-tips/drug-health-care-center/118/", "keyword_count": {"personal": 5, "products": 16, "personal care products": 3, "care products": 7, "care": 11}, "description_wc": 262, "description_text": "From a wide selection of hair care products to shaving kits and incontinence products to men's grooming products, the personal care products you're looking for are available at Walmart. Choose from a variety of the latest body products , antiperspirant, dental floss and toothpaste, shaving kits or hair removal products at Walmart. You'll find the personal items you need to stock your bathroom with all the necessities. Our extensive array of personal care products includes hand soaps and sanitizers, feminine care products, foot care balms and creams and much more. Whether you're shopping for Crest White Strips, Gold Balm Foot Cream or Depend Super Absorbency incontinence products , Walmart has you covered. We also offer a range of hair care products such as Neutrogena triple moisturizer hair mask, Pantene root lifter and TRESemme shampoo and conditioner. You'll find everything you want, including Conair and Remington hair styling tools, Just For Men hair color gel or Nice and Easy hair color, as well as Goody hair ties and brushes. Walmart also stocks a variety of bath products, Sonicare toothbrushes and deodorant for your convenience. Look for Every Day Low Prices on shaving products and search personal care products online by brand, price, customer preference or special offers, such as rollbacks and clearance. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. From oral care and hair care products to personal wellness products and sun care items, our selection can match your needs. Save money. Live better.", "parent_text": "Drug & Health Care Center", "keyword_density": {"personal": "1.9", "care products": "5.4", "care": "4.2", "products": "6.2", "personal care products": "3.5"}, "department_id": 33}
{"department_text": "Pets", "level": -3, "url": "http://www.walmart.com/cp/flexible-spending-account/555326", "text": "Flexible Spending Account", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "About Flexible Spending Accounts", "parent_url": "http://health.walmart.com/health-tips/drug-health-care-center/118/", "keyword_count": {"flexible spending": 2}, "description_wc": 480, "description_text": "A flexible spending account (FSA) is a benefit plan set up with your employer that allows you to voluntarily withhold pre-tax dollars from your paycheck to pay for qualified health care expenses. Contributing to your FSA is a cost-effective way to reduce your taxable income and save money on health care essentials. New Restrictions: Beginning Saturday, January 1, 2011, purchases of many over-the-counter medications will only be eligible for pre-tax healthcare account reimbursement when they are purchased with a prescription. Read details here (PDF 138kb), or visit the IRS website for more information. With your FSA debit card With cash or credit What does FSA mean? FSA stands for Flexible Spending Account. An FSA allows you to voluntarily set aside a portion of your paycheck to pay for approved health care expenses. The money you put in your FSA is deducted from your paycheck before taxes are taken out, which means that you'll have less income to report at tax time and more money in your pocket. If FSA funds are not used by March 15 of the year following contribution, the funds are forfeited and cannot be rolled-over to the next year or refunded. How do I know which products are FSA-qualified? Qualifying items online are marked with an FSA symbol to make them instantly recognizable. In stores, your receipt at checkout will clearly identify qualified products with an \"H\" to the right of the item code (UPC), as well as provide a subtotal of the FSA-eligible purchases. Our systems are designed to recognize qualified items based on eligibility requirements in IRS guidelines. When a FSA debit card is used to purchase items, only items that meet the requirements will be debited from the FSA. Non-eligible items must be paid for with another form of payment. Program eligibilities vary, and only your plan administrator can tell you which products and services qualify. New Restrictions: Beginning Saturday, January 1, 2011, purchases of many over-the-counter medications will only be eligible for pre-tax healthcare account reimbursement when they are purchased with a prescription. Read details here (PDF 138kb), or visit the IRS website for more information. How do I pay for eligible health care items with my FSA funds? When you shop online at Walmart.com, you\u00b4ll email or print out and submit the purchase confirmation page to your FSA account administrator for reimbursement. When shopping in-store at your local Walmart, you\u00b4ll have two options: What is the Walmart item validation / substantiation program? Participating FSA Processors Cards and an eligible item list are maintained within the Walmart system. When a participating card is presented for payment, Walmart\u00b4s cash registers will only charge the FSA card for the eligible items. Non-eligible items will require payment with cash, check or another form of payment.*", "parent_text": "Drug & Health Care Center", "keyword_density": {"flexible spending": "0.8"}, "department_id": 33}
