{"department_text": "Pets", "level": -3, "url": "http://www.walmart.com/cp/Pharmacy-Walmart-Mobile-Device/1084324", "text": "New Mobile Pharmacy", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Walmart's New Mobile Pharmacy", "parent_url": "http://health.walmart.com/health-tips/drug-health-care-center/118/", "keyword_count": {"mobile": 8, "walmart": 8, "mobile pharmacy": 2, "pharmacy": 8}, "description_wc": 144, "description_text": "Save time and money with mobile access to Walmart's Pharmacy services. Now you can use your mobile device to: Walmart's Mobile Pharmacy is available on any web-enabled phone. You will need to create a free account with Walmart.com and a Walmart Pharmacy account to enjoy the full functionality of Walmart's Mobile Pharmacy. Two Ways to Visit Us on the Go Download Our FREE App Now Visit Our Mobile Website Enter mobile.walmart.com/pharmacy in your phone's browser to visit our mobile site. Bookmark the page to easily return to Walmart's Pharmacy services whenever you need quick access. *Prescriptions must be refilled through your current Walmart Pharmacy location. Pharmacy Home Delivery is not currently eligible for refills through our mobile site. \u2020You will need an Apple App Store account and sign-in information to download the app on your iPhone.", "parent_text": "Drug & Health Care Center", "keyword_density": {"mobile": "5.6", "walmart": "5.6", "mobile pharmacy": "2.8", "pharmacy": "5.6"}, "department_id": 33}
{"department_text": "Pets", "level": -3, "url": "http://www.walmart.com/cp/1005860", "text": "Home Medical", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Save on Home Medical Supplies at Walmart", "parent_url": "http://health.walmart.com/health-tips/drug-health-care-center/118/", "keyword_count": {"home medical supplies at walmart": 1, "home medical": 3, "medical": 5, "home medical supplies": 2, "walmart": 5, "home": 4, "supplies": 4, "save": 3}, "description_wc": 205, "description_text": "Feel healthier and more comfortable with home medical supplies from Walmart. You can save time and money on diabetes management at Walmart. Our selection of diabetic supplies includes blood glucose test strips , blood glucose meters , sharp collectors , lancets and glucose supplements. Save money and stay independent with mobility aids and trolley shopping carts from Walmart. We offer hundreds of canes, walkers, wheelchairs and other mobility aids for you to choose from, as well as blood pressure monitors to track your condition. Shop for daily living aids, such as hearing aids and accessories, medical nutrition products, reading glasses and incontinence supplies. Our selection of bathroom aids features specially designed benches, chairs, grab bars and commodes. You can also browse through bedroom safety products that include alarms and bed rails. And we even have gloves, masks, stethoscopes and scrubs for medical professionals. It's easy to shop by price range, customer rating, or best sellers to find just the right home medical products. Many products qualify for Home Free shipping with your $45 order of eligible items or free Site to Store shipping for pickup at your closest Walmart store. So shop for home medical supplies at Walmart to save money and live better.", "parent_text": "Drug & Health Care Center", "keyword_density": {"home medical supplies at walmart": "2.5", "home medical": "3.0", "medical": "2.5", "home medical supplies": "3.0", "walmart": "2.5", "supplies": "2.0", "home": "2.0", "save": "1.5"}, "department_id": 33}
{"level": -3, "url": "http://www.walmart.com/cp/Specialty-Pharmacy/1078924", "text": "Specialty Pharmacy", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "parent_url": "http://health.walmart.com/health-tips/drug-health-care-center/118/", "description_wc": 1094, "description_text": "Walmart Specialty Pharmacy is an industry leader in providing specialty medications and quality services for managing complex therapies at the lowest possible price. Specialty Pharmacy serves both patients and doctors as a one-stop solution for all of your chronic care needs. Established in 2003, Walmart Specialty Pharmacy was created to meet the needs of Walmart customers with chronic, complex diseases and health conditions. Prescriptions for such conditions often require special handling and patient support above and beyond what the typical pharmacy can provide. 1. Patient Referral Form (first time only) 2. Submit a Prescription 1-877-453-4566 rx5315e@wal-mart.com Click here for more information \u2014 Linda L., Valdosta, Georgia We provide prescription services and follow-up care for individuals with a variety of conditions, including: For more information about Walmart Specialty Pharmacy services, covered medications and follow-up care, contact us at: Toll-Free Phone: 1-877-453-4566 Toll-Free Fax: 1-866-537-0877 Email: rx5315e@wal-mart.com Monday \u2013 Friday 9:00 a.m. \u2013 9:00 p.m. (EST) Saturday 9:00 a.m. \u2013 3:00 p.m. (EST) Offices closed on Sundays and major holidays, with clinical staff on call. Therapies for complex health conditions can be overwhelming \u2014 and expensive. Walmart Specialty Pharmacy can help. Our expert staff clinicians will help you manage a wide range of conditions and therapies. What's more, our financial staff can help you negotiate insurance paperwork and minimize your costs. 1. Patient Referral Form (first time only) 2. Submit a Prescription 1-877-453-4566 rx5315e@wal-mart.com Click here for more information \u2014 Susan W., Avon, Colorado First-time patients must submit the Patient Referral Form . Then, order your prescription via one of these convenient methods: For more information about Walmart Specialty Pharmacy services, covered medications and follow-up care, contact us at: Toll-Free Phone: 1-877-453-4566 Toll-Free Fax: 1-866-537-0877 Email: rx5315e@wal-mart.com Monday \u2013 Friday 9:00 a.m. \u2013 9:00 p.m. (EST) Saturday 9:00 a.m. \u2013 3:00 p.m. (EST) Offices closed on Sundays and major holidays, with clinical staff on call. *We accept most major insurance plans. Contact your insurance provider to verify coverage, or call Wal-Mart Specialty Pharmacy at 877-453-4566 and we can verify for you. The information provided in this website is for informational use only. This website and the information contained within are not intended to be used as medical advice and do not substitute for proper consultation with a physician or other healthcare professional. Complex health conditions require complex care. Walmart Specialty Pharmacy is your one-stop solution for managing chronic health conditions. Our expert staff is available 24 hours a day, 7 days a week to help your patients negotiate complex therapies. 1. Patient Referral Form (first time only) 2. Submit a Prescription 1-877-453-4566 rx5315e@wal-mart.com Click here for more information \u2014 Nancy T., Washington, Indiana Our staff of pharmacists, nurse clinicians, patient care coordinators and reimbursement specialists provides comparable, high-quality care and quick turnaround on prescriptions while maintaining low patient out-of-pocket expense. We help improve the chance of therapy success with patient education, therapy follow-up and around-the-clock clinical support. Walmart Specialty Pharmacy provides express delivery for prescriptions and free shipping nationwide to ensure medications are received on time and in optimum condition. Once a prescription arrives, we contact the patient to answer questions, provide help with managing side effects and check general progress. 1. If your patient is new to Walmart Specialty Pharmacy, just complete the Patient Referral Form and fax it to us. 2. If your patient is a Walmart customer and has filled prescriptions through Walmart in the past, just complete a Prescription Order Form and fax it to us. Chances are we can connect to that patient's local store and obtain their information electronically.* For more information about Walmart Specialty Pharmacy services, covered medications and follow-up care, contact us at: Toll-Free Phone: 1-877-453-4566 Toll-Free Fax: 1-866-537-0877 Email: rx5315e@wal-mart.com Monday \u2013 Friday 9:00 a.m. \u2013 9:00 p.m. (EST) Saturday 9:00 a.m. \u2013 3:00 p.m. (EST) Offices closed on Sundays and major holidays, with clinical staff on call. *For legal and insurance reimbursement reasons, all orders must be signed by the prescriber. The information provided in this website is for informational use only. This website and the information contained within are not intended to be used as medical advice and do not substitute for proper consultation with a physician or other healthcare professional. Walmart Specialty Pharmacy is an independent pharmacy offering patients low-cost prescriptions and high quality customer care for chronic, complex health conditions. 1-877-453-4566 rx5315e@wal-mart.com Click here for more information We provide complex therapy management through medical and pharmacy benefits. Our claims are adjudicated online through a Pharmacy Benefits Manager (PBM). We can split bill claims when necessary and will bill to Medicare Parts B and D. Walmart Specialty Pharmacy accepts most major insurance and state medical plans. We achieve cost savings through risk assessment and management. Our expert staff delivers patient training in proper treatment utilization to help control side effects and minimize the risk of error. Further cost savings are achieved through financial assistance and closely managed patient compliance. For more information about Walmart Specialty Pharmacy services, covered medications and follow-up care, contact us at: Toll-Free Phone: 1-877-453-4566 Toll-Free Fax: 1-866-537-0877 Email: rx5315e@wal-mart.com Monday \u2013 Friday 9:00 a.m. \u2013 9:00 p.m. (EST) Saturday 9:00 a.m. \u2013 3:00 p.m. (EST) Offices closed on Sundays and major holidays, with clinical staff on call. Walmart Specialty Pharmacy is an independent pharmacy offering patients low-cost prescriptions and high quality customer care for chronic, complex health conditions. 1-877-453-4566 rx5315e@wal-mart.com Click here for more information Walmart Specialty Pharmacy provides express delivery for prescriptions and free shipping nationwide to ensure medications are received on time and in optimum condition. Once a prescription arrives, we contact the patient to answer questions, provide help with managing side effects and check general progress. For more information about Walmart Specialty Pharmacy services, covered medications and follow-up care, contact us at: Toll-Free Phone: 1-877-453-4566 Toll-Free Fax: 1-866-537-0877 Email: rx5315e@wal-mart.com Monday \u2013 Friday 9:00 a.m. \u2013 9:00 p.m. (EST) Saturday 9:00 a.m. \u2013 3:00 p.m. (EST) Offices closed on Sundays and major holidays, with clinical staff on call.", "parent_text": "Drug & Health Care Center", "department_text": "Pets", "department_id": 33}
