{"department_text": "Pets", "nr_products": 186, "level": -3, "url": "http://www.walmart.com/browse/Vitamins-Herbs/Spring-Valley/_/N-8z3uZ1yzp0b3Zaq90Zaqce/Ne-aq6s?catNavId=1005863&tab_value=13982_All&ic=48_0&ref=418717.418746+500500.4292585679&search_sort=5&selected_items=+", "text": "Spring Valley", "department_url": "http://www.walmart.com/cp/pet-supplies/5440?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pets", "description_title": "Vitamins", "parent_url": "http://health.walmart.com/health-tips/healthy-living-tools/104/", "keyword_count": {"vitamins": 23}, "description_wc": 299, "description_text": "Vitamins. Get the vitamins you need to keep your mind and body healthy for less at Walmart. We have vitamins of all sorts at Every Day Low Prices you'll love. At Walmart, we strive to help keep you and your budget healthy by keeping our prices so low vitamins. Get the vitamins and vitamin supplements your body craves most at a healthy savings. Vitamins simply cost less at Walmart. No matter what sort of vitamin supplements or vitamins you're looking for, you can find them all here for less. Our multivitamin selection includes children's vitamins, kids' vitamins, prenatal vitamins and more. Save on the best childrens' vitamins, prenatal vitamins and multivitamins for you and your family right here. From children's multivitamins and vitamins A through zinc to herbal remedies and supplements and sports nutrition, you'll find all the vitamins you need at Walmart.com. Our extensive selection of vitamins includes heart health, nutritional supplements, immunity boosters, mineral supplements and more. Also, you'll save a bundle with our vitamin value bundles, get exceptional prices on multipacks of protein powder, multivitamins, children's chewables, protein bars and more. You can also shop our latest Rollbacks on vitamins to find everyday low prices on glucosamine, whey protein, calcium supplements and more. So stock up on vitamins at Walmart.com and save. Vitamins aren't the only things you'll find here to help you live healthy, of course. In addition to vitamins, check out our whole line of Health and energy supplements . Plus, to keep you looking and feeling healthy all day, see our collections of women's sportswear and men's sportswear , all at Every Day Low Prices. At Walmart, we keep our prices on vitamins low to help you save money and live better.", "parent_text": "Health Resources", "keyword_density": {"vitamins": "7.7"}, "department_id": 33}
