{"department_text": "Rollback", "nr_products": 543, "level": 0, "url": "http://www.walmart.com/browse/home/furniture/4044_103150/?_refineresult=true&facet=special_offers%3ARollback&ic=16_0&path=0%3A14503%3A1058864", "text": "Furniture", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_title": "Furniture", "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "keyword_count": {"furniture": 20}, "description_wc": 250, "description_text": "Furniture costs less at Walmart. Let us be your source for fashionable, functional and comfortable furniture at fantastic low prices. Whether you're shopping for new bedroom furniture or patio furniture, we offer furniture for every room in your home, not to mention outdoor furniture. What kind of furniture are you looking for? Discover all the furniture options you need, including beds, dining tables, office chairs, patio sets and entertainment centers from brands like Better Homes and Gardens, Canopy and Hometrends. It's all really easy to find, too, when you can shop furniture by categories, such as baby furniture, patio furniture , home office furniture , living room furniture and bedroom furniture. You can even browse furniture by price range or your favorite manufacturer, so finding exactly the furniture you want to complete your home furnishings is just a few clicks away. Maybe it's time for a complete furniture upgrade; time to refresh that worn-out dining table or replace that sagging sofa in the living room with something more comfortable and attractive. And what about that tired mattress you've been tossing and turning on for so many years? Wouldn't it be nice to finally get the good night's sleep you need? You'll find the furniture you've been dreaming about right here, from mattresses to dining tables and so much more. You'll save money on furniture at Walmart, so get all the furniture you want right here and start living better now.", "parent_text": "Rollback", "keyword_density": {"furniture": "8.1"}, "department_id": 36}
{"department_text": "Pharmacy", "level": 0, "url": "http://www.walmart.com/cp/health/976760?povid=cat5431-env198764-moduleB120712-lLinkLHNRelatedCategories1Health", "text": "Health", "department_url": "http://www.walmart.com/cp/Pharmacy/5431?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pharmacy", "description_title": "Save on Health Products at Walmart", "parent_url": "http://www.walmart.com/cp/Pharmacy/5431?povid=cat121828-env999999-moduleA072012-lLinkGNAV4_Pharmacy", "keyword_count": {"walmart": 5, "health": 8, "products": 5, "save": 3, "health products": 2, "health products at walmart": 1}, "description_wc": 242, "description_text": "Save money and live better with health products from Walmart. We have smart buys to keep you going strong when it comes to vitamins . Our selection features products for bone and joint health, a healthy heart, and immunity, as well as herbals, minerals, multivitamins, single vitamins and supplements. Our great brands for a healthy lifestyle include Centrum, Equate, Nature Made, One a Day, Spring Valley and many more. You can amp up or slim down to get fit with top brands and big savings from our diet and nutrition selection. It features diet foods, weight loss supplements, energy nutrition, sports nutrition, and even scales. Shop for mobility aids, diabetic supplies, daily living aids and more home health care at Walmart.com. Here you'll find useful items that offer convenience and comfort for a variety of health conditions. Our medicine cabinet enables you to save money on the relief you need. Browse through products for pain relief, ear care, eye care, first aid and sexual wellness, in addition to analgesics, allergy medicines, cold remedies, and flu treatments. It's easy to shop by price range, customer rating, or best sellers to find just the right health products at Walmart.com. Many products qualify for Home Free shipping with your $45 order of eligible items or free Site to Store shipping for pickup at your closest Walmart store. So shop for all of your health needs at Walmart to save money and live better.", "parent_text": "Pharmacy", "keyword_density": {"walmart": "2.1", "products": "2.1", "health": "3.3", "save": "1.2", "health products": "1.7", "health products at walmart": "1.7"}, "department_id": 34}
