Site to Store shipping for pickup at your closest Walmart store. So shop for all of your health needs at Walmart to save money and live better.", "parent_text": "Rollback", "keyword_density": {"walmart": "2.1", "products": "2.1", "health": "3.3", "save": "1.2", "health products": "1.7", "health products at walmart": "1.7"}, "department_id": 36}
{"department_text": "Rollback", "nr_products": 449, "level": 0, "url": "http://www.walmart.com/browse/gifts-registry/1094765/?_refineresult=true&facet=special_offers%3ARollback&ic=16_0&path=0%3A14503%3A1058864", "text": "Gifts & Registry", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_title": "For gifts, gift cards or a gift registry, Walmart.com is your #1 gifting resource.", "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "keyword_count": {"gift cards": 1, "gift": 20, "gifting": 1, "gifts": 7, "walmartcom": 3, "registry": 3, "gift registry": 1}, "description_wc": 201, "description_text": "Whether you're shopping for a birthday present, graduation gift, wedding gift or Christmas present, you'll find perfect gifts and gift cards for every occasion at Walmart.com. For wedding presents and baby gifts, search our Wedding Registry or Baby Registry to locate your happy couple or glowing new parents, or create a new gift registry of your own. You can also create a Wish List of presents you'd love to receive for any gifting occasion. For other gift ideas, search our Gift Shop for tons of suggestions at unbeatable prices, including personalized gifts that say you really care. And of course, a Walmart Gift Card is always a perfect choice. With a Walmart Gift Card, your lucky recipient can choose from virtually millions of gifts in categories like baby , jewelry or electronics . See our collection of gift card designs for birthday gifts, graduation presents, Christmas presents, wedding gifts, baby gifts and lots of other important gift-giving events. Each gift card can be preloaded with the amount you want to give, and redeemed at any Walmart store or here on Walmart.com. No matter what the occasion, Walmart.com is the perfect place to save on the perfect gift.", "parent_text": "Rollback", "keyword_density": {"gift cards": "1.0", "gift": "10.1", "gifting": "0.5", "gifts": "3.5", "walmartcom": "1.5", "registry": "1.5", "gift registry": "1.0"}, "department_id": 36}
{"department_text": "Rollback", "nr_products": 4, "level": 0, "url": "http://www.walmart.com/browse/_/N-aq90ZaqceZaqbu?ic=48_0&ref=+500501.500682+125868.g125868&catNavId=130306", "text": "Movies", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_title": "Get movies and top TV shows for less at Walmart.com.", "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "keyword_count": {"tv shows": 5, "tv shows for less": 1, "get": 2, "tv": 6, "less": 2, "movies": 10, "walmartcom": 2, "shows": 6}, "description_wc": 261, "description_text": "All the biggest movies and TV shows are right here at Walmart.com, for a lot less than you might expect. Whether you're looking for the latest summer blockbusters or all-time classics, you'll find thousands of movies and TV shows in every category, in your choice of DVD or Blu-Ray format. From classic series like Star Wars , Harry Potter and James Bond to newer phenomena like the Twilight movies and The Hunger Games , they're all waiting for you right here. Older viewers will find plenty to love, too, with classic films from the good old days of cinema. Action movies, comedies, romances, sports movies, period movies, chick flicks, cop movies, westerns, dramas\u2014they're all here for your enjoyment at prices you're going to love. We also have full seasons of the latest TV shows on DVD and Blu-Ray, so you can get caught up on every episode of your favorite show. You can preorder upcoming DVD and Blu-Ray new releases to ensure you'll be the first in your neighborhood to have the hottest movies and shows. Plus, with our new Video On Demand by VUDU technology, you can upload your favorite movies and TV shows to the cloud and watch them anywhere, even if your DVD or Blu-Ray collection is stored safely at home. Now's the time to update your movie and TV show collection on DVD or Blu-Ray with big savings from Walmart.com. Because even the toughest critics love getting movies and TV shows for less.", "parent_text": "Rollback", "keyword_density": {"tv shows": "3.9", "tv shows for less": "1.5", "less": "0.8", "tv": "2.3", "get": "0.8", "walmartcom": "0.8", "movies": "3.9", "shows": "2.3"}, "department_id": 36}
