{"department_text": "Rollback", "nr_products": 249, "level": 0, "url": "http://www.walmart.com/search/browse-ng.do?ic=48_0&ref=125875.125875+500501.500682&catNavId=130306", "text": "Electronics", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_title": "Save on cutting-edge electronics. We offer electronics products for less.", "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "keyword_count": {"cutting edge": 1, "electronics": 7, "electronics products": 1, "products": 5, "less": 2}, "description_wc": 216, "description_text": "When it comes to saving money on electronics, there's no better place to shop for your electronic products than Walmart.com. Looking for a specific electronics item, like a laptop with a camera? We've got it here for less. Tired of running around town to the local TV sales, searching for the best deal? No worries. We have all the best brands and models here at everyday low prices you'll love. Plus much, much more. Check out our enormous selection of high-quality, cutting-edge electronic products such as our top-brand laptops . Want a new Samsung laptop ? Look no further. Perhaps you're looking for something even bigger, like a brilliant new Samsung TV . We've got that, too. For less. We believe the wonders of modern electronics should be accessible to everyone, so we keep our prices down. We think everyone deserves to enjoy the latest electronic products. That's why you won't find any overpriced electronic products here, unlike some other high-end electronics stores we could mention. Instead, we work hard to provide the best prices anywhere on all the electronics that are making the headlines and earning spots on people's wishlists. Shop our Electronics department for unbeatable savings on the electronics products you want most.", "parent_text": "Rollback", "keyword_density": {"less": "0.9", "electronics": "3.3", "electronics products": "0.9", "products": "2.3", "cutting edge": "0.9"}, "department_id": 36}
{"department_text": "Toys", "level": 0, "url": "http://www.walmart.com/cp/Children-s-Books/582053?_mm=5up?povid=cat4171-env434412-moduleA112412-lLinkLHNRelatedCategories1ChildrensBooks", "text": "Children's Books", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "Children's Books", "parent_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "keyword_count": {"children s books": 1, "books": 16, "children": 3}, "description_wc": 221, "description_text": "Encourage the love of reading and get the most popular books for children at Walmart.com. We'll help you fill your home library with imaginative books for kids at incredible prices. Shop our complete selection of children's books, which includes picture books, chapter books, educational books, coloring books, character books and leveled readers. If you're not sure what to buy, you can read up on our selection of helpful kids' book reviews, and get ideas from readers just like you. We carry best-selling books for children, tweens and teens, including the Harry Potter series , Dr. Seuss books, Disney books , Toy Story books , Nickelodeon books , and the ever-popular Twilight series. We offer kids' books to suit every youthful interest, such as crafts, hobbies and activities , humor , history , literature and fiction , short stories , movie tie-ins and sports and recreation . If you're shopping for boys and girls of all ages, Walmart makes it easy to browse by age, gender and customer rating. Whether you're shopping for a toddler, pre-teen or a teenager, you'll find great savings on kids' books at Walmart.com. Our affordable shipping options make it easy to save on quality kids' books for the young readers in your life. Save money. Live better.", "parent_text": "Toys", "keyword_density": {"children s books": "1.4", "books": "7.6", "children": "1.4"}, "department_id": 39}
