{"department_text": "Toys", "nr_products": 1186, "level": 0, "url": "http://www.walmart.com/browse/music/children039;s-music/4104_4106?_refineresult=true&ic=32_0&povid=cat4171-env434412-moduleA112412-lLinkLHNRelatedCategories3ChildrensMusic", "text": "Children's Music", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "Children\u2019s Music", "parent_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "keyword_count": {"music": 12, "children": 14, "children s music": 6}, "description_wc": 221, "description_text": "When you are searching for children\u2019s music to keep your little ones entertained, browse our selection of children's music CDs at Walmart. Walmart has plenty of children\u2019s music CDs for your child to enjoy, including children\u2019s sing-a-long music and children\u2019s lullabies. View our children\u2019s soundtracks to see the music we have from a number of children\u2019s movies. Walmart even has a collection of children\u2019s Disney music available. Whether you are looking for international music for children to assist in developing foreign language skills or children\u2019s lullabies that will help them fall asleep, Walmart will help you find what you are looking for. Parents who are looking for religious music for children will also find a wide selection of tunes that the whole family can enjoy. Shopping for children\u2019s music CDs is easy at Walmart.com. You can search by type, name, special features, style, price and more. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. At Walmart, you'll find our Every Day Low Prices on children's music and children's music CDs. With our wide selection and top brands, Walmart helps you find music for you and your family for less. Save money. Live better.", "parent_text": "Toys", "keyword_density": {"music": "5.4", "children": "6.3", "children s music": "8.1"}, "department_id": 39}
{"department_text": "Toys", "nr_products": 382, "level": 0, "url": "http://www.walmart.com/browse/toys/lego/4171/YnJhbmQ6TGVnbwieie?_refineresult=true&ic=48_0&path=0%3A4171&povid=cat4171-env434412-moduleA082013-lLinkLHNFeaturedBrands5Lego", "text": "LEGO", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "Toys Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "keyword_count": {"walmart": 2, "toys": 13}, "description_wc": 236, "description_text": "From action figures and stuffed animals to kids' electronics and outdoor play , you'll find wonderful toys for kids of all ages at Walmart.com. We feature everyday low prices on dolls and dollhouses, pretend play, arts and crafts, development and learning toys, vehicles, trains and remote control toys and more. Kids can stay active and healthy while having fun with our outdoor play toys, as well as swing sets , bikes and riding toys. You can shop for toys by brand to choose from Disney, Fisher-Price, LEGO, Little Tikes, Leap Frog, Nerf and more. Or browse by age group to find toys for everyone from babies to kids who are 12 and up. You can also shop for toys by price range, customer rating or special offers. For even more ideas, our Toy Finder can help you find the perfect gift and gift ideas, while our Birthday Shop lets you plan a party and find great gifts, too. You'll also want to take advantage of free Site to Store shipping on many outdoor play toys, bikes and riding toys, scooters and more eligible toys. So get that climber and slide set they've always wanted, set up your home for hours of creative pretend play, find toys that will help them learn, or outfit your backyard for some seriously fun outdoor play. Shop for toys at Walmart.com to save money and live better.", "parent_text": "Toys", "keyword_density": {"walmart": "0.9", "toys": "5.6"}, "department_id": 39}
