{"department_text": "Rollback", "nr_products": 1009, "level": 0, "url": "http://www.walmart.com/search/browse-ng.do?ic=48_0&ref=181605.181605+500501.500682&catNavId=130306", "text": "Apparel", "department_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "description_title": "Clothing and apparel costs less at Walmart.", "parent_url": "http://www.walmart.com/cp/Rollback-Savings/130306?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Rollback", "keyword_count": {"apparel": 4, "walmart": 2, "clothing": 1}, "description_wc": 226, "description_text": "From women's fashions to men's wear to great-looking kid's clothes, you'll find unbeatable prices on apparel for the whole family at Walmart.com. Whether you're looking for delicate women's intimates or tough, hardworking Wranglers jeans for men, there's no better place to save on the clothes to fit your lifestyle. Check out our giant selection of comfortable everyday favorites like Hanes t-shirts and jeans such as Signature by Levi Strauss & Co. There's plenty for kids to love, too, including the most popular girls' fashions and clothes for boys , plus all their favorite characters on licensed apparel from Disney, Hello Kitty and Nickelodeon. In men's clothing , we've got you covered head-to-toe. Choose from professional styles or rugged work clothes like Dickies or Wrangler. No matter what you do for a living, we'll help you save more of your hard-earned money. On weekends, unwind in casual styles and active wear that's comfortable and looks great. Got a special occasion coming up? How about a new dress, with new shoes and a handbag to match? Shop for fabulous dresses from our complete range of women's apparel , which also includes intimates and maternity wear . Shop Walmart for clothes and apparel today, because saving money never goes out of style.", "parent_text": "Rollback", "keyword_density": {"apparel": "1.8", "walmart": "0.9", "clothing": "0.5"}, "department_id": 36}
{"department_text": "Toys", "level": -1, "url": "http://www.walmart.com/cp/1105635", "text": "LEGO", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "LEGO for Less", "parent_url": "http://www.walmart.com/cp/Shop-by-Age-5-7-Years/617941?povid=cat4171-env434412-moduleB081713-lLinkLHNShopByAge5_7Years", "keyword_count": {"lego": 25}, "description_wc": 225, "description_text": "LEGO sets and LEGO games. Get the LEGO sets and LEGO games kids adore at Walmart. There's no end to the things you can build with LEGO, but the most important thing you can build is a child's imagination. Ingenious LEGO toys and LEGO games are designed to entertain and educate children through active play, and with so many different LEGO sets to choose from at terrific prices from Walmart, the creativity and fun never end. Which LEGO sets and LEGO games are you most interested in? From the programmable robots of LEGO Mindstorms to the intergalactic adventures of LEGO Star Wars , to the cute and playful LEGO Friends series, every LEGO set encourages interactive play. Kids can build fire stations and boat harbors with LEGO City , or a pirate ship with LEGO Pirates of the Caribbean. They can create the magical world of LEGO Harry Potter, and tap into martial arts action with LEGO Ninjago. These are just a few of the exciting LEGO sets and LEGO games you'll find here. There are LEGO toys for kids of all ages, including a full line of LEGO DUPLO and LEGO DUPLO Disney Princess toys for small children and toddlers. Parents love LEGO because it's educational and engaging. Kids love LEGO because it's just plain fun to play with.", "parent_text": "5 - 7 Years", "keyword_density": {"lego": "11.2"}, "department_id": 39}
