nd all of the Nintendo 3DS consoles, accessories, and games you're looking for at Walmart.com - and save.", "parent_text": "Nintendo DS & DSi", "keyword_density": {"nintendo 3ds games": "11.1", "3ds": "6.6", "games": "4.5", "nintendo 3ds": "12.3"}, "department_id": 39}
{"department_text": "Toys", "nr_products": 19, "level": -2, "url": "http://www.walmart.com/browse/toys/lego/4171_1105635/?_refineresult=true&facet=price%3A%24100+-+%24150%7C%7Cprice%3A%24150+-+%24200%7C%7Cprice%3A%24250+-+%24500&povid=cat1105635-env530384-moduleA062513-lLinkLHNShopbyPrice100_AboveDollars", "text": "$100 & Above", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "LEGO for Less", "parent_url": "http://www.walmart.com/cp/1105635", "keyword_count": {"lego": 25}, "description_wc": 225, "description_text": "LEGO sets and LEGO games. Get the LEGO sets and LEGO games kids adore at Walmart. There's no end to the things you can build with LEGO, but the most important thing you can build is a child's imagination. Ingenious LEGO toys and LEGO games are designed to entertain and educate children through active play, and with so many different LEGO sets to choose from at terrific prices from Walmart, the creativity and fun never end. Which LEGO sets and LEGO games are you most interested in? From the programmable robots of LEGO Mindstorms to the intergalactic adventures of LEGO Star Wars , to the cute and playful LEGO Friends series, every LEGO set encourages interactive play. Kids can build fire stations and boat harbors with LEGO City , or a pirate ship with LEGO Pirates of the Caribbean. They can create the magical world of LEGO Harry Potter, and tap into martial arts action with LEGO Ninjago. These are just a few of the exciting LEGO sets and LEGO games you'll find here. There are LEGO toys for kids of all ages, including a full line of LEGO DUPLO and LEGO DUPLO Disney Princess toys for small children and toddlers. Parents love LEGO because it's educational and engaging. Kids love LEGO because it's just plain fun to play with.", "parent_text": "LEGO", "keyword_density": {"lego": "11.2"}, "department_id": 39}
