{"department_text": "Toys", "nr_products": 13050, "level": -2, "url": "http://www.walmart.com/cp/Coming-Soon/642799", "text": "Preorders", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "Walmart has the books you want for less", "parent_url": "http://www.walmart.com/cp/1025359?povid=cat582053-env204709-moduleA092811-lLinkLHNFeaturedBrands2HarryPotter", "keyword_count": {"walmart": 1, "books": 13, "less": 2}, "description_wc": 220, "description_text": "Everyone loves discovering great books, and everyone loves saving money. Walmart.com makes it easy to do both, with a huge selection of popular books at unbeatable prices. No matter what books you're looking for, you can get them right here on our site for a lot less than you'd pay at another bookstore. In addition to the top New York Times bestsellers everyone's talking about, you'll find literature and fiction , fascinating biographies, mystery novels, sci-fi, romance novels, children's books , reference books, textbooks, and much, much more. You can also read helpful book reviews posted by readers just like you. Easily browse books by genre to choose from topics like history, romance, comedy, religion, politics, cooking, true crime and anything else you can imagine, all at great savings. We even offer a vast library of textbooks in virtually every subject, including prep materials for the SAT, GRE and GMAT tests\u2014probably for a whole lot less than the campus bookstore. Love audiobooks? We've got hundreds of audiobooks to enjoy, from new fiction bestsellers to classic literature and everything in between. Tons of excellent gift ideas, too, for both kids and adults. Plus, our affordable shipping options make it even easier to save on quality books for all the readers in your life.", "parent_text": "Harry Potter", "keyword_density": {"walmart": "0.5", "books": "6.0", "less": "0.9"}, "department_id": 39}
