art.com to save money and live better.", "parent_text": "5 - 7 Years", "keyword_density": {"walmart": "0.9", "toys": "5.6"}, "department_id": 39}
{"department_text": "Toys", "level": -1, "url": "http://www.walmart.com/cp/582053?povid=cat1077545-env387872-moduleA062911-lLinkLHNRelatedCategories1KidsBooks", "text": "Kids' Books", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "Children's Books", "parent_url": "http://www.walmart.com/cp/Shop-by-Age-Preschool-Toddler/1077545?povid=cat4171-env434412-moduleB081713-lLinkLHNShopByAgePreschool_Toddler", "keyword_count": {"children s books": 1, "books": 16, "children": 3}, "description_wc": 221, "description_text": "Encourage the love of reading and get the most popular books for children at Walmart.com. We'll help you fill your home library with imaginative books for kids at incredible prices. Shop our complete selection of children's books, which includes picture books, chapter books, educational books, coloring books, character books and leveled readers. If you're not sure what to buy, you can read up on our selection of helpful kids' book reviews, and get ideas from readers just like you. We carry best-selling books for children, tweens and teens, including the Harry Potter series , Dr. Seuss books, Disney books , Toy Story books , Nickelodeon books , and the ever-popular Twilight series. We offer kids' books to suit every youthful interest, such as crafts, hobbies and activities , humor , history , literature and fiction , short stories , movie tie-ins and sports and recreation . If you're shopping for boys and girls of all ages, Walmart makes it easy to browse by age, gender and customer rating. Whether you're shopping for a toddler, pre-teen or a teenager, you'll find great savings on kids' books at Walmart.com. Our affordable shipping options make it easy to save on quality kids' books for the young readers in your life. Save money. Live better.", "parent_text": "Preschool & Toddler", "keyword_density": {"children s books": "1.4", "books": "7.6", "children": "1.4"}, "department_id": 39}
