orders, laptops, TVs, iPods, MP3 players and other awesome stuff for entertainment, work and play.", "parent_text": "8 - 11 Years", "keyword_density": {"player": "8.0", "ipod": "6.1", "mp3": "6.5", "ipod and mp3 player": "3.0", "mp3 player": "11.4"}, "department_id": 39}
