{"department_text": "Toys", "level": -1, "url": "http://www.walmart.com/cp/96469?povid=cat1077724-env387952-moduleA070611-lLinkLHNRelatedCategories1iPods_MP3Players", "text": "iPods & MP3 Players", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "iPod and MP3 Player Selections", "parent_url": "http://www.walmart.com/cp/Shop-by-Age-12-Up/1077724?povid=cat4171-env434412-moduleB081713-lLinkLHNShopByAge_12_Up", "keyword_count": {"player": 21, "ipod": 16, "mp3 player": 15, "ipod and mp3 player": 2, "mp3": 17}, "description_wc": 265, "description_text": "iPod and MP3 Player choices. Shopping for a new MP3 player or iPod? Then look no further than our MP3 player and iPod selection, where you'll find iPods and MP3 players at terrific savings. Best of all, we keep our iPod and MP3 player prices low, so you can save money and live better. When you want a new MP3 player or iPod, Walmart is the place to shop. No matter what sort of iPod or MP3 player you want, you can find what you're looking for here. We carry iPods like the iPod Nano, iPod Shuffle and iPod Touch. Plus, we also have the latest Samsung MP3 player, Android player, Sony MP3 player and Ematic MP3 player models. And our MP4 player and MP3 video player selection is hard to beat, too. Look no further than Walmart for the best price on an iPod Touch, iPod Nano, iPod Shuffle, Samsung MP3 player, Android player, Sony MP3 player, MP4 player or MP3 video player. When you've picked out the MP3 player you want, don't miss our ginormous selection of other low-priced, top-quality electronics , including networking gear , TV and video equipment and everything else you can imagine in the way of electronics and computers. So get the iPods and MP3 players you want here, and save just as much on our huge selection of Electronics, including all the cool gadgets and essentials you really want and need. We have the latest iPads, cameras, camcorders, laptops, TVs, iPods, MP3 players and other awesome stuff for entertainment, work and play.", "parent_text": "12 & Up", "keyword_density": {"player": "8.0", "ipod": "6.1", "mp3": "6.5", "ipod and mp3 player": "3.0", "mp3 player": "11.4"}, "department_id": 39}
{"department_text": "Toys", "level": -1, "url": "http://www.walmart.com/cp/1102672?povid=cat1077724-env387952-moduleA062613-lLinkLHNComingSoonPlayStation4", "text": "PlayStation 4", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "Sony PlayStation 4 is\u2026", "parent_url": "http://www.walmart.com/cp/Shop-by-Age-12-Up/1077724?povid=cat4171-env434412-moduleB081713-lLinkLHNShopByAge_12_Up", "keyword_count": {"playstation": 12, "playstation 4": 8, "sony playstation": 4, "4": 13, "sony": 5, "sony playstation 4": 3}, "description_wc": 419, "description_text": "Infinite gaming, limitless worlds, imaginative stories, all just for you. The new Sony PlayStation 4 launches a new era in video gaming where gameplay is more intuitive and on-screen environments are endlessly expanding. Working with some of the most creative minds in the industry, PlayStation 4 delivers breathtaking and unique gaming experiences. Simple, elegant design, inside and out, means seamless, engaging and immersive gameplay into worlds never before imagined. Gaming wherever you are and on whatever device. Using cloud storage, video games for the new PlayStation 4, as well as games from older PlayStation consoles ,can be easily and quickly downloaded, and, using Sony's Remote Play, can be accessed across multiple devices including tablet PCs, smartphones and the Sony PlayStation Vita. Social sharing made easy. On the new PS4, social gaming is easy and encouraged as essential to gaming on the new PlayStation 4. The new DualShock 4 controller features a Share button that allows you quick and easy access to your online network friends on the social media sites you already use. Share gaming highlights, high scores, game-changing plays, or reach out to friends for a helping hand. Simply push the share button on the new DualShock 4 controller and you're instantly connected. Get gaming faster. Using the new Suspend Mode, the power button delivers instant-pause and instant-on so you can start gaming right where you left off with no delay. The new PlayStation 4 features 8GB memory, a local hard drive and x86 CPU, alongside a secondary custom chip. This custom chip lets you start playing games while downloading is still in process. No more waiting, way more playing. It's all about you. The DualShock 4 controller features a six-axis sensor, a top-side touchpad and a light bar that uses different colors to interact with the Eye, a 3D camera that adds another dimension to your gameplay by supporting the PlayStation Move motion controller. This newly developed PlayStation Camera for PlayStation 4 incorporates two high-sensitive cameras that have wide-angle lenses with 85-degree diagonal angle views that can recognize the depth of space precisely. The Sony PlayStation 4 makes the gamer the center of the game. Not just gaming, entertainment. Beyond gaming, PS4 continues in the footsteps of its predecessors with integrated apps that allow you to access the Internet, stream your favorite movies, videos and music including VUDU . Simple, immediate, social, integrated and personal. The new Sony PlayStation 4: Push the Boundaries of Play.", "parent_text": "12 & Up", "keyword_density": {"playstation": "2.9", "playstation 4": "3.8", "sony playstation": "1.9", "4": "3.1", "sony": "1.2", "sony playstation 4": "2.2"}, "department_id": 39}
