{"department_text": "Value of the Day", "level": 0, "url": "http://www.walmart.com/cp/1072864?povid=cat1058864-env172199-moduleLHN-lLink_Dept-HomeImprovement", "text": "Home Improvement", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Walmart.com has the tools to make home improvement easy.", "parent_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "keyword_count": {"walmartcom": 2, "make": 1, "tools": 6, "home improvement": 5}, "description_wc": 240, "description_text": "Tired of looking at peeling paint, scuffed old flooring or decor that just feels out of date? Then shop our Home Improvement department for all the tools , paint, hardware and supplies to fix it. Whether you need the tools for a complex electrical or plumbing job inside the walls, or just some paint for a touch-up in the den, you'll find home improvement tools and supplies for less at Walmart.com. If you're looking to liven up your outdoor spaces a bit, you can save big on gardening essentials ranging from planters to fertilizers to irrigation systems to lighting. Of course, you'll also find heavy-duty hardware and power tools such as lawnmowers, chainsaws, leaf blowers and more. For indoor home improvements, check out our beautiful flooring options, dependable plumbing fixtures, state-of-the-art lighting solutions and broad spectrum of paint and decor for every taste. Why pay more for an electrician or plumber when you can save on all the electrical and plumbing tools and supplies you need to do the job yourself? Nothing spruces up a home improvement job quite like a fresh coat of paint , so we've got hundreds of paint choices to suit every scheme and palette, not to mention all the tools you need to paint right the first time. When it comes to home improvement, no one makes it easier to save time and money than Walmart.com.", "parent_text": "Value of the Day", "keyword_density": {"walmartcom": "0.8", "make": "0.4", "tools": "2.5", "home improvement": "4.2"}, "department_id": 41}
{"department_text": "Value of the Day", "level": 0, "url": "http://www.walmart.com/cp/health/976760?povid=cat1058864-env172199-module021112-lLink1_Health", "text": "Health", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Save on Health Products at Walmart", "parent_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "keyword_count": {"walmart": 5, "health": 8, "products": 5, "save": 3, "health products": 2, "health products at walmart": 1}, "description_wc": 242, "description_text": "Save money and live better with health products from Walmart. We have smart buys to keep you going strong when it comes to vitamins . Our selection features products for bone and joint health, a healthy heart, and immunity, as well as herbals, minerals, multivitamins, single vitamins and supplements. Our great brands for a healthy lifestyle include Centrum, Equate, Nature Made, One a Day, Spring Valley and many more. You can amp up or slim down to get fit with top brands and big savings from our diet and nutrition selection. It features diet foods, weight loss supplements, energy nutrition, sports nutrition, and even scales. Shop for mobility aids, diabetic supplies, daily living aids and more home health care at Walmart.com. Here you'll find useful items that offer convenience and comfort for a variety of health conditions. Our medicine cabinet enables you to save money on the relief you need. Browse through products for pain relief, ear care, eye care, first aid and sexual wellness, in addition to analgesics, allergy medicines, cold remedies, and flu treatments. It's easy to shop by price range, customer rating, or best sellers to find just the right health products at Walmart.com. Many products qualify for Home Free shipping with your $45 order of eligible items or free Site to Store shipping for pickup at your closest Walmart store. So shop for all of your health needs at Walmart to save money and live better.", "parent_text": "Value of the Day", "keyword_density": {"walmart": "2.1", "products": "2.1", "health": "3.3", "save": "1.2", "health products": "1.7", "health products at walmart": "1.7"}, "department_id": 41}
