{"department_text": "Value of the Day", "level": 0, "url": "http://www.walmart.com/cp/103150?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Furniture", "text": "Furniture", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Furniture", "parent_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "keyword_count": {"furniture": 20}, "description_wc": 250, "description_text": "Furniture costs less at Walmart. Let us be your source for fashionable, functional and comfortable furniture at fantastic low prices. Whether you're shopping for new bedroom furniture or patio furniture, we offer furniture for every room in your home, not to mention outdoor furniture. What kind of furniture are you looking for? Discover all the furniture options you need, including beds, dining tables, office chairs, patio sets and entertainment centers from brands like Better Homes and Gardens, Canopy and Hometrends. It's all really easy to find, too, when you can shop furniture by categories, such as baby furniture, patio furniture , home office furniture , living room furniture and bedroom furniture. You can even browse furniture by price range or your favorite manufacturer, so finding exactly the furniture you want to complete your home furnishings is just a few clicks away. Maybe it's time for a complete furniture upgrade; time to refresh that worn-out dining table or replace that sagging sofa in the living room with something more comfortable and attractive. And what about that tired mattress you've been tossing and turning on for so many years? Wouldn't it be nice to finally get the good night's sleep you need? You'll find the furniture you've been dreaming about right here, from mattresses to dining tables and so much more. You'll save money on furniture at Walmart, so get all the furniture you want right here and start living better now.", "parent_text": "Value of the Day", "keyword_density": {"furniture": "8.1"}, "department_id": 41}
{"level": -1, "url": "http://www.walmart.com/giftregistry?povid=cat3891-env435871-moduleA101112-lLinkLHNLearnMore2WeddingRegistry", "text": "Wedding Registry", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "parent_url": "http://www.walmart.com/cp/Jewelry/3891?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Jewelry", "description_wc": 255, "description_text": "Whether you're having a baby, getting married, celebrating a special occasion or creating a wish list of Christmas presents, you can make it easy for your friends and family to choose the perfect gift. By setting up a wedding registry, baby registry or wish list at Walmart.com, you'll take all the guesswork out of buying wedding gifts, baby gifts, birthday gifts, graduation gifts or Christmas presents. It's super easy to set up your gift registry or wish list in just a few quick steps, and it's even easier for others to shop from it. Have a baby on the way? Then be sure to visit our baby registry page right away to start setting up your baby gift registry. That way you'll be sure to get just what you want and people will have plenty of time to shop. Getting married? Then you already have enough to think about. That's why we've made setting up your wedding gift registry simple. You'll have your wedding registry set up faster than you can say \"I do!\" Now, what if you're not getting married or having a baby, but you want to set up a wish list for a special occasion? Setting up a wish list registry lets your friends and loved ones know exactly what you'd love to receive as a graduation gift, birthday gift or Christmas gift. Best of all, your wish list is easy to create, easy to shop from and totally free from Walmart.com.", "parent_text": "Jewelry", "department_text": "Value of the Day", "department_id": 41}
