, earrings and much more. In addition, we have a great assortment of jewelry for kids and jewelry for men, including watches from Timex, Armitron, Casio and other top brands. No matter what type of jewelry you want, it's always time to save money on jewelry at Walmart.com.", "parent_text": "Jewelry", "keyword_density": {"jewelry": "7.2"}, "department_id": 41}
