{"department_text": "Value of the Day", "level": -1, "url": "http://wm7.walmart.com/about-choosing-engagement-rings-article/", "text": "Engagement Ring Buying Guide", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Engagement ring buying guide", "parent_url": "http://www.walmart.com/cp/Jewelry/3891?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Jewelry", "keyword_count": {"engagement ring buying guide": 1, "engagement": 2, "guide": 3, "ring": 9}, "description_wc": 408, "description_text": "You\u2019ve fallen in love and decided to make it official. Use our engagement ring buying guide to find the perfect ring for that perfect someone. First, have an idea of what you can spend and your target price range. Keep in mind that a debt-free future is more important than spending your life\u2019s savings. If you\u2019re picking out the ring alone and planning a surprise for her, it\u2019s imperative you know her ring size. If you are choosing the ring together, get her ring finger properly measured in-store. However if you\u2019re planning to surprise her, take notice of a ring she wears on her ring finger, take it from her jewelry box when she is sleeping, or when she's out, and get it measured at your local jeweler. Be sure to put it back as soon as possible so she\u2019s not suspicious! To find a ring that represents her personal style and taste, notice the types of accessories she wears every day. Does she prefer gold or silver, big and glitzy, or small and simple? Look at the items already in her jewelry box and what she likes to wear day-to-day. Also consider her lifestyle and regular activities. Knowing her personality and style will help guide you to find what\u2019s right. Engagement bands come in a variety of metals including yellow gold, rose gold, white gold, platinum or silver. Understanding the differences between metals will help you choose the best option for her. Finally it\u2019s time to choose the right diamond . Use the \u201cfour C\u2019s\u201d (cut, color, clarity and carat weight) to guide you in your choice. These four features will influence the cost and quality of the diamond. Work with the sales associate to find the right options for you. After deciding which size and color of diamond she would like, you\u2019ll want to choose the shape. Educate yourself on the various shapes available including princess, round, oval, pear, and heart. The setting is the way a diamond is placed on the band. You can create a variety of different settings and looks with one of the following settings: Give yourself some time to dive in and consider the vast variety of different settings, cuts and clarity of diamonds. Pay attention to what your partner likes and let your instincts lead you the rest of the way. Good luck \u2013 and congratulations!", "parent_text": "Jewelry", "keyword_density": {"engagement": "0.5", "ring": "2.2", "engagement ring buying guide": "1.0", "guide": "0.7"}, "department_id": 41}
{"department_text": "Toys", "nr_products": 401, "level": -1, "url": "http://www.walmart.com/browse/baby/activities-toys/5427_491351/?_refineresult=true&catNavId=491351&facet=customer_rating%3A4+-+5+Stars&ic=32_0&povid=cat1077544-env449020-moduleA020513-lLinkLHNSeeWhatsHot2TopRatedToys", "text": "Top-Rated Toys", "department_url": "http://www.walmart.com/cp/Toys/4171?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_Toys", "description_title": "Baby Activities and Toddler Activities", "parent_url": "http://www.walmart.com/cp/Shop-by-Age-Baby/1077544?povid=cat4171-env434412-moduleB081713-lLinkLHNShopByAgeBaby", "keyword_count": {"baby": 19, "activities": 13, "toddler": 11, "baby activities and toddler activities": 6}, "description_wc": 204, "description_text": "Baby activities and toddler activities. Get fun-filled baby activities and toddler activities your little one will love, for less. We carry a wide selection of baby activities and toddler activities at great savings. Browse our baby activity choices for low prices on everything from baby swings to toddler games to baby toys and more. For baby activities and toddler activities, Walmart is the place to shop. Discover baby activities and toddler activities like baby swings, baby rockers or cradle swings at great prices. We have a terrific baby toys and toddler toys selection, and our prices on baby swings are hard to beat. You'll also find great savings on baby activity toys and toddler activity toys by all your favorite baby brands like Fisher-Price, Bright Starts, Graco and others. Of course, baby activities and toddler activities are just part of what we offer at great prices. You can also shop for a full selection of baby swings and baby gyms and playmats , to name just a few of the toddler activity toys and baby activity toys we carry. Shop Walmart for big savings on activities and toys for babies and toddlers. See our whole selection of baby items for less!", "parent_text": "Baby", "keyword_density": {"baby": "9.4", "activities": "6.4", "toddler": "5.4", "baby activities and toddler activities": "14.8"}, "department_id": 39}
{"department_text": "Value of the Day", "level": -1, "url": "http://www.walmart.com/cp/5431?povid=cat976759-env440714-moduleA112012-lLinkLHNRelatedCategories5Pharmacy", "text": "Pharmacy", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Prescriptions and More at Walmart Pharmacies", "parent_url": "http://www.walmart.com/cp/grocery/976759?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Grocery", "keyword_count": {"walmart": 5, "walmart pharmacies": 1, "prescriptions": 1}, "description_wc": 112, "description_text": "Save time and money with savings programs and services at Walmart stores and Walmart.com. Walmart pharmacies accept major Rx insurance plans, such as Express Scripts, TRICARE and many others. It is easy to transfer your existing prescription by simply bringing your current Rx bottle or prescription from a plan, such as Express Scripts or TRICARE, to any Walmart pharmacy. While you are there, you can stock your medicine cabinet and find home medical equipment, too. You will also want to take advantage of $4 prescriptions, our online Wellness Shops and our online Specialty Pharmacy. So take care of all your pharmacy needs and more at Walmart to save money and live better.", "parent_text": "Grocery", "keyword_density": {"walmart": "4.5", "walmart pharmacies": "1.8", "prescriptions": "0.9"}, "department_id": 41}
{"department_text": "Value of the Day", "level": -1, "url": "http://www.walmart.com/cp/5440?povid=cat976759-env440714-moduleA112012-lLinkLHNRelatedCategories4Pets", "text": "Pets", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Spoil your pet for less at Walmart", "parent_url": "http://www.walmart.com/cp/grocery/976759?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Grocery", "keyword_count": {"pet": 13, "walmart": 2}, "description_wc": 292, "description_text": "Keep your pets happy and healthy with quality pet supplies from Walmart.com. We carry a huge selection of pet food and pet supplies, including dog food, cat food, fish food, bird seed, rabbit food and more. In addition to the pet food your pet needs for the best nutrition, you'll also find a full range of pet supplies like bird cages, hamster cages, fish tanks, dog houses, bunny cages and cat baskets. Basically, all the supplies you need for your pets are right here at your fingertips. In dog supplies , shop for dog food from makers you know and trust, like Purina, Puppy Chow, Pedigree, Iams, Milk Bone and others. For your kitty, we carry cat food from Friskies, Meow Mix, Purina and Fancy Feast, to name a few. Cat litter, too, of course. Bird seeds and bird feeders, as well as feeders for small animals like hamsters and rabbits, are just a sampling of the other pet supplies we carry at great prices. Oh, and don't let us forget an ocean's worth of fish food and fish supplies for goldfish, bettas and other freshwater and tropical fish species. To keep your pets from destroying your shoes or furniture, we also offer a huge selection of fun, safe dog toys, chew toys, cat scratchers and other cat supplies that'll keep them busy for hours on end. Even your pet goldfish will enjoy the cool aquarium decorations you can add to his fish tank or fish bowl. And to ward off common pet pests like fleas and ticks, be sure to pick up some of our effective flea and tick control products. Best of all, you'll save a bundle when you get your pet supplies at Walmart.com", "parent_text": "Grocery", "keyword_density": {"pet": "4.5", "walmart": "0.7"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 538, "level": -1, "url": "http://www.walmart.com/browse/jewelry/3891/?_refineresult=true&facet=special_offers%3ARollback&povid=cat3891-env435871-moduleA101112-lLinkLHNSpecialOffers5Rollback", "text": "Rollback", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Jewelry", "parent_url": "http://www.walmart.com/cp/Jewelry/3891?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Jewelry", "keyword_count": {"jewelry": 15}, "description_wc": 211, "description_text": "Jewelry. Whether your style is dressed-up or more casual, the right jewelry makes you look and feel special. Saving money on jewelry is easy at Walmart, thanks to our enormous collection of beautiful jewelry such as rings , watches, necklaces, bracelets, earrings and more. For jewelry of all kinds, it's hard to beat the selection and savings at Walmart. We've searched far and wide to bring you the best jewelry at truly gorgeous values, including diamond rings, gold necklaces, diamond earrings, a full selection of stylish watches, gold bracelets, pendants and even personalized jewelry . At these great prices, they make the perfect gifts for any occasion. And speaking of special occasions, our jewelry collection also includes wedding rings and engagement rings. Look no further than our Wedding and Engagement collection for perfect tokens of your love. Or, if you just want everyday jewelry that looks nice, we have that kind of jewelry, too, including gold jewelry, watches, necklaces, pendants, earrings and much more. In addition, we have a great assortment of jewelry for kids and jewelry for men, including watches from Timex, Armitron, Casio and other top brands. No matter what type of jewelry you want, it's always time to save money on jewelry at Walmart.com.", "parent_text": "Jewelry", "keyword_density": {"jewelry": "7.2"}, "department_id": 41}
{"department_text": "Value of the Day", "level": -1, "url": "http://brands.walmart.com/windows-buying-guide/?povid=cat4044-env193469-moduleA011813-lLinkLHNShoppingTools3WindowsBuyingGuide", "text": "Window Buying Guide", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Learn More:", "parent_url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Home", "keyword_count": {}, "description_wc": 245, "description_text": "Window treatments come in a variety of widths and lengths, but how do you know what\u2019s right for your windows? It all depends on the setting, where the window is positioned on the wall, and how you plan to use them. Prior to shopping, you\u2019ll need to take a few measurements. First, measure from the top of the curtain rod to where you\u2019d like your panels to fall. Consider these length options: Sill length Ideal for windows that get a workout, this length falls just to the windowsill. Below-sill length Perfect for bathrooms and kitchens, these fall several inches below the bottom of the windowsill. Also called apron-length. Floor length Ideal for making windows look longer and for pulling together a room, floor length panels should be less than an inch from the floor. Extra-long length For an elegant look that works well in formal settings, allow several inches of the panels to pool on the floor. Next, you\u2019ll want to measure the width of the window. Window treatments should be 1\u00bd to 3 times the width of the space you are covering. If your window measures 36 inches, you\u2019ll want window treatments to be between 54 inches and 108 inches in total width. Window panels come in all widths and sizes, so be sure to check packaging for the proper size. Note that the package will list the width of the panels first, then the height.", "parent_text": "Home", "keyword_density": {}, "department_id": 41}
{"department_text": "Value of the Day", "level": -1, "url": "http://www.walmart.com/cp/5427?povid=cat976759-env440714-moduleA112012-lLinkLHNRelatedCategories1Baby", "text": "Baby", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Baby Items and Baby Supplies", "parent_url": "http://www.walmart.com/cp/grocery/976759?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Grocery", "keyword_count": {"baby supplies": 7, "baby": 31, "baby items": 7, "baby items and baby": 2, "supplies": 9}, "description_wc": 265, "description_text": "Baby supplies and baby items. The baby supplies and baby items you need cost less at Walmart. We have a whole baby store full of baby supplies and baby items at great savings right here. For baby gear, baby supplies, baby gifts and other baby stuff, check out our full selection of baby items. Find all the important baby supplies you need right here, whether you're a mom yourself or shopping for a mother-to-be. From adorable baby clothing to strollers and toys for babies, everything is priced to save you money. Browse for soft, cuddly baby clothes in a wide range of cute designs for boys and girls. For the nursery, discover safe, sturdy cribs and baby bedding, plus fun and educational toys for babies at every stage of development. And family outings become easier and more fun when you have the right car seat and stroller. When it's diapers you need, you'll find unbeatable prices on all the most-trusted diaper brands, including Pampers and Huggies. It's all part of our huge baby store full of baby supplies, baby items and baby products. Plus, find baby formula, baby bottles and baby care supplies like lotions and soaps, all available at unbeatable prices with a click of your mouse. For baby supplies, baby items, baby gear, baby gifts and baby products like strollers , diapers and potty training supplies, cribs and baby car seats there's only one place to get everything you need for less. Walmart is the headquarters for baby items and baby gifts at big savings.", "parent_text": "Grocery", "keyword_density": {"baby supplies": "5.3", "baby": "11.7", "baby items": "5.3", "baby items and baby": "3.0", "supplies": "3.4"}, "department_id": 41}
