{"department_text": "Value of the Day", "level": -2, "url": "http://www.walmart.com/cp/Gift-Cards/96894", "text": "Gift Cards", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "A Walmart Gift Card is always the perfect gift, no matter what the occasion!", "parent_url": "http://www.walmart.com/cp/1102332?povid=cat3891-env435871-moduleA1020913-lLinkLHNSpecialOffers2FinancingOptions", "keyword_count": {"perfect": 2, "gift card": 9, "gift": 16, "walmart gift card is always the perfect": 1, "walmart": 7, "walmart gift card": 4}, "description_wc": 214, "description_text": "Whether you're shopping for a birthday present, graduation gift, wedding gift or Christmas present, a Walmart Gift Card is always the perfect choice. With a Walmart Gift Card, your lucky recipient can choose from virtually millions of gifts in categories like baby , jewelry or electronics . A Walmart Gift Card works just like cash, but it's easier to carry, more fun to receive and available in hundreds of fun gift card themes, from birthday to graduation to wedding to baby and more. Walmart Gift Cards are easy to order, too. Just pick your design, add your value and bam! You're done. See our collection of gift card designs for birthday, graduation, Christmas, wedding, baby and lots of other important gift-giving events. Each gift card can be preloaded with the amount you want to give, and redeemed at any Walmart store or here on Walmart.com. Let's say you've tried shopping from a baby registry, wedding registry or wish list, but can't find just the right gift. A gift card solves the problem, letting your recipient choose anything they want. So remember: Next time you need a perfect graduation gift, wedding gift, Christmas present or birthday present, look no further than a fun, convenient gift card from Walmart.", "parent_text": "Financing Options", "keyword_density": {"perfect": "0.9", "gift card": "8.5", "gift": "7.5", "walmart gift card is always the perfect": "3.3", "walmart": "3.3", "walmart gift card": "5.7"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 114, "level": -1, "url": "http://www.walmart.com/browse/jewelry/3891/?_refineresult=true&facet=special_offers%3AOnline+Only&povid=cat3891-env435871-moduleA011513-lLinkLHNSpecialOffers4OnlineOnly", "text": "Online Only", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Jewelry", "parent_url": "http://www.walmart.com/cp/Jewelry/3891?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Jewelry", "keyword_count": {"jewelry": 15}, "description_wc": 211, "description_text": "Jewelry. Whether your style is dressed-up or more casual, the right jewelry makes you look and feel special. Saving money on jewelry is easy at Walmart, thanks to our enormous collection of beautiful jewelry such as rings , watches, necklaces, bracelets, earrings and more. For jewelry of all kinds, it's hard to beat the selection and savings at Walmart. We've searched far and wide to bring you the best jewelry at truly gorgeous values, including diamond rings, gold necklaces, diamond earrings, a full selection of stylish watches, gold bracelets, pendants and even personalized jewelry . At these great prices, they make the perfect gifts for any occasion. And speaking of special occasions, our jewelry collection also includes wedding rings and engagement rings. Look no further than our Wedding and Engagement collection for perfect tokens of your love. Or, if you just want everyday jewelry that looks nice, we have that kind of jewelry, too, including gold jewelry, watches, necklaces, pendants, earrings and much more. In addition, we have a great assortment of jewelry for kids and jewelry for men, including watches from Timex, Armitron, Casio and other top brands. No matter what type of jewelry you want, it's always time to save money on jewelry at Walmart.com.", "parent_text": "Jewelry", "keyword_density": {"jewelry": "7.2"}, "department_id": 41}
{"department_text": "Value of the Day", "level": -1, "url": "http://wm3.walmart.com/floor-care-finder/?povid=cat4044-env193469-moduleA011813-lLinkLHNShoppingTools1FloorCareFinder", "text": "Floor Care Finder", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Floor Care Finder vacuum cleaner comparison.", "parent_url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Home", "keyword_count": {"floor care finder": 9, "floor care": 10, "floor": 11, "vacuum cleaner": 19, "vacuum cleaner comparison": 6, "vacuum": 26, "floor care finder vacuum cleaner comparison": 5}, "description_wc": 246, "description_text": "Floor Care Finder vacuum cleaner comparison. Use our Floor Care Finder vacuum cleaner comparison tool to help you compare vacuum cleaners and find the best vacuum cleaner for your needs. Floor Care Finder makes finding the best vacuum cleaner simple by comparing vacuum cleaners. It's a vacuum cleaner comparison tool that lets you input the features you want, compare vacuum cleaners, and then decide which is the best vacuum cleaner for your needs. To compare vacuum cleaners using Floor Care Finder, tell us whether you need a house vacuum, a car vacuum or a shop vacuum. Then indicate what kind of cleaning you want: quick pick-ups, deep cleaning, robotic vacuum, and so forth. Next, tell Floor Care Finder if there are pets or allergies in your family. Do you want to clean hard floors, carpeting, stairs, or car interiors? Floor Care Finder will then compare vacuum cleaners and recommend the best vacuum cleaner for you. Possible suggestions include upright vacuum cleaners, carpet shampooers, canister vacuums and steam mops. It's easy to compare vacuum cleaners and find the best vacuum cleaner with our Floor Care Finder vacuum cleaner comparison. In addition to our Floor Care Finder vacuum cleaner comparison, see our full range of vacuum cleaners and floor care , including wet & dry vacuums and vacuum bags and accessories . Our Floor Care Finder vacuum cleaner comparison tool is just one of the ways we help you save money so you can live better.", "parent_text": "Home", "keyword_density": {"floor care finder": "11.1", "floor care": "8.2", "floor": "4.5", "vacuum cleaner": "15.6", "vacuum cleaner comparison": "7.4", "vacuum": "10.7", "floor care finder vacuum cleaner comparison": "12.3"}, "department_id": 41}
