{"department_text": "Value of the Day", "level": -1, "url": "http://wm3.walmart.com/mattress-finder/?povid=cat4044-env193469-moduleA011813-lLinkLHNShoppingTools2MattressFinder", "text": "Mattress Finder", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Mattress Comparison", "parent_url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Home", "keyword_count": {"mattress comparison": 4, "mattress": 32}, "description_wc": 253, "description_text": "Mattress Comparison. Use the Walmart Mattress Finder to compare mattresses and help you in choosing a mattress that's just right for you. The Walmart Mattress Finder offers a full mattress comparison by comparing mattress features that you select. Then use the Mattress Finder to narrow down your search and find the right mattress. Choosing a mattress has never been easier! Using the Walmart Mattress Finder, start by selecting your mattress size. Choose your desired mattress size from a choice of Twin, Full, Queen or King mattresses. Next, the Mattress Finder will ask you to pick the mattress type you prefer; choose between Inner Spring, Memory Foam, Latex, Gel or Pillow Top mattress varieties. Once you've selected your mattress type, you'll be asked to indicate your desired mattress firmness from a range that includes Extra Plush, Plush, Firm, Extra Firm and Not Sure. Choose the mattress firmness that best fits your sleep habits. Now the Walmart Mattress Finder helps you find the right mattress by displaying mattress choices that match your desired mattress qualities. The mattress comparison feature makes choosing a mattress easy by letting you compare mattresses. After choosing the right mattress with the Walmart Mattress Finder, see our entire selection of mattresses and box springs , as well as bedroom furniture and bedding for every taste. Compare mattresses with the Walmart mattress comparison tool: It's just one of the ways we try to make life simpler and save you money so you can live better... and sleep better.", "parent_text": "Home", "keyword_density": {"mattress comparison": "3.2", "mattress": "12.7"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 60, "level": -1, "url": "http://www.walmart.com/browse/home/4044?catNavId=4044&ic=48_0&refineresult=true&povid=cat4044-env193469-moduleA051311-lLinkLHNRelatedCategories1AsSeenOnTV&facet=special_offers%3AAs+Seen+On+TV", "text": "As Seen On TV", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Home Furnishings.", "parent_url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Home", "keyword_count": {"home": 5}, "description_wc": 211, "description_text": "From the floor to the ceiling, from your rugs to your lighting, everything you need for your home is right here at Walmart.com. Whether you're in the market for all-new decor , looking to upgrade your home furniture, or just want a new mattress or refrigerator, you'll find it all right here for less. Browse our vast selection of top-brand appliances , including the latest refrigerator, dishwasher and microwave oven models at terrific prices. We make it easy to save on your next refrigerator, dishwasher or microwave from top appliances brands you know. And when it's time for a new mattress and bedding , look no further than our attractive mattress and bedding collections. Ready to refresh your decor? You'll discover a huge array of decor options, stylish rugs, great-looking lighting solutions and more. Plus comfortable and attractive home furniture to add new life to all your living spaces, whether inside or outdoors. And, of course, Walmart.com also features all the linens, rugs, bedding, towels and window coverings to complement your new home furniture. Shop Walmart.com for Every Day Low Prices on home furniture, decor, major appliances and accessories, such as bedding, flower pots, rugs and lamps. Save money and live better with Walmart..", "parent_text": "Home", "keyword_density": {"home": "2.4"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 82, "level": -1, "url": "http://www.walmart.com/browse/home/kids039;-amp;-teen-rooms/your-zone/4044_92352?_refineresult=true&ic=32_0&path=0%3A4044&povid=cat4044-env193469-moduleA060212-lLinkLHNFeaturedBrands3yourzone&facet=brand%3AYour+Zone", "text": "your zone", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Bedroom Furniture and Bedding for Kids and Teens", "parent_url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Home", "keyword_count": {"kids": 8, "bedding": 8, "bedroom furniture and bedding": 4, "bedroom furniture": 9, "teens": 1, "furniture": 10}, "description_wc": 264, "description_text": "Add new style and more comfort to any child's room with kids' bedroom furniture, teen bedroom furniture and bedding from Walmart.com. Our broad assortment features beds, bunkbeds and loft beds, mattresses , kids' bedding, teen bedding, bean bag chairs, futons and lounge seating, nightstands, vanities, desks, teen and kids' dressers, room decor, organizers, storage products, bathroom furnishings and even a special collection of toddler room furnishings. It's easy to shop for teen and kids' bedroom furniture and bedding at Walmart.com by type, brand, price range, customer rating or best sellers. Younger children will love furnishing their rooms with kids' bedding, rugs, curtains and other decor that features their favorite characters, such as Batman, Hello Kitty, Mickey Mouse, or Thomas and Friends, as well as popular Disney and Sesame Street characters. Teens who are into sports may want to decorate their rooms with furnishings that feature the logos of their favorite NFL, NBA or NCAA teams. In addition to kids' bedroom furniture and teen bedroom furniture, our comprehensive home department includes appliances, bath furnishings, bedding, decor, furniture, kitchen accessories, dining room accessories, lighting, luggage, mattresses, patio furnishings, garden gear, rugs, slipcovers, storage and organization products, and window coverings. Look for money-saving shipping offers throughout the home section of our Web site. Select kids' bedroom furniture, teen bedroom furniture and bedding are eligible for free store pickup at your nearby Walmart store when you use Site to Store online ordering. Shop for kids' bedroom furniture, teen bedroom furniture and bedding at Every Day Low Prices from Walmart to save money and live better.", "parent_text": "Home", "keyword_density": {"kids": "3.0", "bedding": "3.0", "bedroom furniture and bedding": "6.1", "bedroom furniture": "6.8", "teens": "0.4", "furniture": "3.8"}, "department_id": 41}
