ok no further than a fun, convenient gift card from Walmart.", "parent_text": "Baby", "keyword_density": {"perfect": "0.9", "gift card": "8.5", "gift": "7.5", "walmart gift card is always the perfect": "3.3", "walmart": "3.3", "walmart gift card": "5.7"}, "department_id": 41}
