{"department_text": "Value of the Day", "nr_products": 10, "level": -2, "url": "http://www.walmart.com/browse/apparel/pregnancy-pillows/5438_133284_486986/?_refineresult=true&povid=cat5427-env200832-moduleB020213-lLinkLHNForMom4PregnancyPillows", "text": "Pregnancy Pillows", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Pregnancy Pillows", "parent_url": "http://www.walmart.com/cp/5427?povid=cat976759-env440714-moduleA112012-lLinkLHNRelatedCategories1Baby", "keyword_count": {"pillows": 9, "pregnancy pillows": 5}, "description_wc": 197, "description_text": "You can shop for pregnancy pillows from Sealy, Boppy and Leachco at Every Day Low Prices from Walmart.com. Choose from cuddle pillows, sleep wedges, total body pillows, maternity pillows and nursing pillows. It's easy to browse for pregnancy pillows by color, brand, price range, customer ratings or best sellers. In addition to pregnancy pillows, we feature a complete collection of maternity clothes for moms to be that includes activewear, loungewear, dresses, skirts, intimates, nursing apparel, shirts, tees, shorts, capris and swimwear, as well as prenatal accessories, such as belly bands and maternity tights. Of course, you'll also want to take a look at our complete selection of baby clothing from Garanimals, Gerber, Child of Mine by Carter, Disney, Healthtex, Faded Glory, Hanes, Wrangler, George and more popular children's clothing brands. You can also find baby essentials, such as diaper bags, baby strollers, car seats and baby cribs at Walmart.com, too. Be sure to take advantage of free in-store pickup for most pregnancy pillows at your nearby Walmart store when you use Site to Store online ordering. Shop for pregnancy pillows, maternity clothing and baby gear at Walmart to save money and live better.", "parent_text": "Baby", "keyword_density": {"pillows": "4.6", "pregnancy pillows": "5.1"}, "department_id": 41}
