{"department_text": "Value of the Day", "nr_products": 7, "level": -2, "url": "http://www.walmart.com/browse/baby/jogging-strollers/5427_118134_1101424/?_refineresult=true&facet=special_offers%3ARollback&povid=cat5427-env432559-moduleA042513-lLinkLHNSpecialOffers4JoggersonRollback", "text": "Joggers on Rollback", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Jogging Strollers", "parent_url": "http://www.walmart.com/cp/5427?povid=cat976759-env440714-moduleA112012-lLinkLHNRelatedCategories1Baby", "keyword_count": {"jogging": 8, "jogging strollers": 4, "strollers": 10}, "description_wc": 252, "description_text": "Jogging strollers. Jogging strollers cost less at Walmart. For active parents, there's no greater piece of baby gear than a jogging stroller. Jog strollers let you get out and about with your children, so you can still get the exercise you want without needing to hire a babysitter. Most have heavy-duty suspension, fixable wheels for added stability and protective sun visors. No wonder jogger strollers are so popular! What type of jogging stroller do you have in mind? We have jog strollers from all your favorite brands, like Baby Trend, InStep, Jeep, Schwinn and others. We even have double jogging strollers for twice the fun and value, and our low prices on double jogger strollers are really hard to beat. Not really looking for a jogging stroller? Then come explore our full selection of other strollers , including double strollers , plus cloth diapers , crib mattresses , booster car seats and everything else you could ever need for your child. You'll also save on everyday essentials like diapers and diapering products , baby food, baby blankets and baby lotions. In fact, each and every product in our giant selection of baby items is priced low to help you save money. Start enjoying your new jogging stroller for less when you get it here at Walmart. We work hard to keep our prices down and on all the baby gear you need, including jogging strollers. It's part of our commitment to helping you and your family live better.", "parent_text": "Baby", "keyword_density": {"jogging": "3.2", "jogging strollers": "3.2", "strollers": "4.0"}, "department_id": 41}
