{"department_text": "Value of the Day", "nr_products": 21, "level": -3, "url": "http://www.walmart.com/browse/apparel/maternity/5438_133284?_refineresult=true&ic=16_0&path=0%3A5438&facet=save_big%3ABundle", "text": "Value Bundles", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Maternity Clothes", "parent_url": "http://www.walmart.com/cp/133284?povid=cat5427-env200832-moduleB020213-lLinkLHNForMom1MaternityClothes", "keyword_count": {"maternity clothes": 4, "maternity": 13}, "description_wc": 212, "description_text": "Find all the maternity clothes and accessories you want at Walmart. Our terrific selection of maternity clothing includes T-shirts, maternity jeans, pants, knit tops, shirts, coats, active wear, lounge wear, sleepwear, intimates and more. Plus, you can shop for pregnancy and prenatal accessories, including pregnancy pillows, nursing bras, belly bands and other maternity wear needs. At Walmart.com, you can browse for maternity dresses and skirts, maternity tops and maternity swimwear. Get wear-to-work looks at every day low prices, as well as around-the-house maternity clothes. We have just-in styles for moms-to-be from tops and bottoms to dresses, too. Be sure to take a look at our value bundles featuring two-packs, outfits, diaper bag sets, crib mattress/maternity pillow combinations, and nursing tank/nursing pillow combination. Naturally, maternity clothes aren't the only things you'll find here for moms and their babies. We also offer an unbelievable selection of other baby products , including double strollers , disposable diapers , baby blankets and infant car seats , all at super, money-saving prices. So when you're looking for maternity wear, be sure to see the maternity clothing selection we offer at Walmart, where all our maternity clothes are priced to save you money.", "parent_text": "Maternity Clothes", "keyword_density": {"maternity clothes": "3.8", "maternity": "6.2"}, "department_id": 41}
