{"department_text": "Value of the Day", "nr_products": 1561, "level": -3, "url": "http://www.walmart.com/browse/apparel/womens-shoes/5438_1045804_1045806_163925/?_refineresult=true", "text": "Women's Shoes", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Women\u2019s Shoes", "parent_url": "http://www.walmart.com/cp/133284?povid=cat5427-env200832-moduleB020213-lLinkLHNForMom1MaternityClothes", "keyword_count": {"women s shoes": 3, "shoes": 9, "women": 10}, "description_wc": 226, "description_text": "From women\u2019s boots and cowboy boots to women's sandals and slippers, the women's shoes and women\u2019s clothes you are looking for are available at Walmart. Walmart\u2019s extensive selection of shoes includes women\u2019s dress shoes, such as pumps, heels, flats and boots. Sneakers for walking and jogging, as well as toning sneakers, jazz shoes and shoes that complement women\u2019s sportswear , are also at Walmart. When the weather is rainy, Walmart offers a selection of print and graphic rain boots, as well as women\u2019s outerwear , such as rain coats and jackets. Whether the occasion calls for athletic sneakers or high heels, Walmart has got you covered. Walmart carries a large array of casual and professional shoes for your daily needs. We have shoes for inclement weather, as well, with women's rain boots and much more. You'll find Every Day Low Prices on women's shoes at Walmart.com, where you can filter your search by brand, color, price, consumer rating, shipping and special offers.\u00a0Be sure to look for money-saving shipping offers and free store pickup for\u00a0many products when you shop at Walmart.com. Whether you\u2019re looking for footwear to make a statement, match weekend attire or wear to work, Walmart's selection of women\u2019s shoes has what you need. Save money. Live better.", "parent_text": "Maternity Clothes", "keyword_density"