{"department_text": "Value of the Day", "nr_products": 6956, "level": -3, "url": "http://www.walmart.com/browse/apparel/accessories/5438_426265/?_refineresult=true", "text": "Hats & Accessories", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Clothing Accessories", "parent_url": "http://www.walmart.com/cp/133284?povid=cat5427-env200832-moduleB020213-lLinkLHNForMom1MaternityClothes", "keyword_count": {"clothing": 6, "accessories": 7, "clothing accessories": 5}, "description_wc": 207, "description_text": "From hats and gloves to belts and ties, the clothing accessories you're looking for are available for less at Walmart. Walmart has a wide range of apparel accessories for your entire family. With our selection, it's easy to liven up your wardrobe with colorful new scarves or keep the family prepared for weather conditions with sturdy new umbrellas . You'll find top brands and styles, including Faded Glory clothing, and other clothing accessories for all seasons. At Walmart, you'll find fun headwear for you and your kids. Our apparel accessories, including ties and wallets, are excellent gift items as well. Whether you need to protect yourself from the sun, or keep warm on a cool evening, you'll find a range of hats, gloves and other clothing accessories to suit your needs. At Walmart.com, it's easy to shop for clothing accessories. Filter your search results by department, size, brand, color, price, gender, customer rating, special offers and more. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. Find the clothing accessories you need for less at Walmart. With our Every Day Low Prices, you can save money and live better.", "parent_text": "Maternity Clothes", "keyword_density": {"clothing": "2.9", "accessories": "3.4", "clothing accessories": "4.9"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 371, "level": -3, "url": "http://www.walmart.com/browse/apparel/diaper-bags/5438_133284_164195/?_refineresult=true", "text": "Diaper Bags", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Diaper Bags", "parent_url": "http://www.walmart.com/cp/133284?povid=cat5427-env200832-moduleB020213-lLinkLHNForMom1MaternityClothes", "keyword_count": {"bags": 7, "diaper bags": 6, "diaper": 12}, "description_wc": 219, "description_text": "Shop at Walmart.com for more than 250 diaper bags to suit your needs at Every Day Low Prices. You can browse for diaper bags in a wide range of sizes and colors from Baby Boom, Disney, Fisher-Price, Gerber, GoGo Babyz, Graco, Pretty Baby and others. It's easy to browse for diaper bags at Walmart.com by brand, price range, customer rating or best sellers. If you're looking for a touch of fun, be sure to see the Sesame Street Elmo two-piece diaper bag, the Winnie the Pooh diaper and bottle bags, or the Mat-N-Bag diaper bag and baby mat combination in the shape of colorful bears. You'll also find diaper bags that are specifically designed for use with infant car seats and baby travel systems. Related diapering supplies that will be of interest to you include baby wipes, diapers and training pants, changing pads and covers, and diaper pails and accessories. In addition to money-saving shipping offers on select items, you'll find that some diaper bags are available for free store pickup at your nearby Walmart store when you use Site to Store online ordering. Make life easier for you and your baby with diaper bags and other baby gear at Every Day Low Prices from Walmart. Save money. Live better.", "parent_text": "Maternity Clothes", "keyword_density": {"bags": "3.2", "diaper bags": "5.5", "diaper": "5.5"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 17715, "level": -3, "url": "http://www.walmart.com/browse/apparel/bags/5438_1045799/?_refineresult=true&povid=cat133201-env203929-moduleA111012-lLinkLHNShoesAccessories_BagsLuggage", "text": "Bags & Luggage", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Bags", "parent_url": "http://www.walmart.com/cp/133284?povid=cat5427-env200832-moduleB020213-lLinkLHNForMom1MaternityClothes", "keyword_count": {"bags": 19}, "description_wc": 274, "description_text": "From adult bags to kids' bags, a selection of the different styles, shapes and sizes of bags you're looking for are available at Walmart. Whether you're checking out the latest carry-ons and travel bags or browsing laptop bags for your mobile office, our extensive selection of handbags, backpacks, messenger bags and wallets has got you covered. We offer an impressive variety of sports bags for specialty equipment such as golf caddies, crossbow cases and ski and boot bags. Our kids' bags feature many popular brands and characters like Angry Birds, Disney, Hello Kitty and Nickelodeon. Add your name or photo to create your own unique bag with our selection of personalized bags. Check out our large array of handbags in popular styles, from clutches to totes and shoulder bags to satchels. We offer many handbag brands such as Bisadora, Earth Axxessories, Jessica Simpson, Sydney Love and Tokyobay. Our styles of backpacks include school backpacks, laptop backpacks and hydration backpacks from Eastsport, Everest, NFL and Wildkin. We also offer a wide selection of trusted brands in luggage such as American Tourister, Netpack, Protege and Traveler's Choice. Many types of luggage and travel bags are available including garment bags, duffel bags and rolling luggage sets. Shopping for bags at Walmart.com is simple when you filter search results by category, brand, color, sports league, character, price and customer rating. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. From backpacks and kids' bags to handbags and luggage, you'll find what you're looking for at Walmart. Save money. Live better.", "parent_text": "Maternity Clothes", "keyword_density": {"bags": "6.9"}, "department_id": 41}
