{"department_text": "Value of the Day", "nr_products": 126, "level": -2, "url": "http://www.walmart.com/browse/baby/baby-gear/5427_86323/?_refineresult=true&facet=special_offers%3ANew&povid=cat5427-env432559-moduleA042513-lLinkLHNWhatsNew2NewBabyGear", "text": "New Baby Gear", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Baby Gear", "parent_url": "http://www.walmart.com/cp/5427?povid=cat976759-env440714-moduleA112012-lLinkLHNRelatedCategories1Baby", "keyword_count": {"baby": 21, "baby gear": 12, "gear": 13}, "description_wc": 254, "description_text": "Baby gear. For baby gear like strollers, car seats and high chairs, you'll want to check out the baby gear selection at Walmart.com. We offer unbelievably low prices on all the baby gear a new parent needs, including a full fleet of baby strollers, baby seats for cars, high chairs, baby carriers by brands you know and trust, and portable playards. For baby gear, it's really hard to beat the selection and prices at Walmart. Whether you're a new parent, a mom- or dad-to-be, or simply shopping for friends or family members with babies, Walmart.com is the easiest way to find the baby gear you need for less. In addition to must-have baby gear like cribs, strollers and high chairs, you can get fun-to-have baby gear like baby swings, mobiles, rockers and everything else a new parent (and baby) could ever wish for. We have all the best baby gear brands, too, including Fisher-Price, Evenflo, Britax, Graco and many others. In addition to terrific baby gear, we carry a broad assortment of baby bedding , baby toys and activities, diapering and potty gear , baby safety essentials and more, all at low Walmart prices you'll love. It's all part of our commitment to keeping prices low so you can save money and live better. So when you need baby gear, you know you're in the right place. See our entire collection of baby gear baby essentials , all at lovable Walmart prices.", "parent_text": "Baby", "keyword_density": {"baby": "8.4", "baby gear": "9.6", "gear": "5.2"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 45, "level": -2, "url": "http://www.walmart.com/browse/baby/nursery-furniture/fisher-price/5427_414099/YnJhbmQ6RmlzaGVyLVByaWNl?_refineresult=true&povid=cat5427-env432559-moduleA042513-lLinkLHNWhatsNew1FisherPrice", "text": "Fisher-Price Nursery Furniture", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Baby Furniture", "parent_url": "http://www.walmart.com/cp/5427?povid=cat976759-env440714-moduleA112012-lLinkLHNRelatedCategories1Baby", "keyword_count": {"baby": 22, "baby furniture": 10, "furniture": 12}, "description_wc": 226, "description_text": "Baby furniture. Baby furniture and nursery furniture like cribs and changing tables cost less at Walmart.com. New parents, parents-to-be, or anyone who has babies in their lives will love our little prices on the baby furniture they need for a baby nursery or baby bedroom. With so many baby furniture colors and themes to choose from, it's easy to find the perfect baby furniture for your baby's nursery. In addition to handsomely designed cribs and well-made baby furniture, we also carry a full selection of baby beds, nursery furniture, changing tables and much more for the perfect nursery. And if you've ever shopped for new baby furniture like a crib, changing table, baby bed or nursery set, you know it's nice to find them at a great price. That's why we do all we can to save you money on baby furniture. Of course, baby furniture isn't all we carry. To go with your new crib or baby bed, you're going to need baby bedding, crib sheets, crib bedding, baby pillows and baby blankets to match. Thankfully, we offer a broad assortment of baby bedding , learning toys and activities, strollers, diapering and potty gear and baby safety essentials . See our complete selection of baby furniture and baby stuff , all at lovable Walmart prices.", "parent_text": "Baby", "keyword_density": {"baby": "9.9", "baby furniture": "9.0", "furniture": "5.4"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 81, "level": -3, "url": "http://www.walmart.com/browse/apparel/maternity/5438_133284/?_refineresult=true&facet=special_offers%3ARollback", "text": "Rollbacks", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Maternity Clothes", "parent_url": "http://www.walmart.com/cp/133284?povid=cat5427-env200832-moduleB020213-lLinkLHNForMom1MaternityClothes", "keyword_count": {"maternity clothes": 4, "maternity": 13}, "description_wc": 212, "description_text": "Find all the maternity clothes and accessories you want at Walmart. Our terrific selection of maternity clothing includes T-shirts, maternity jeans, pants, knit tops, shirts, coats, active wear, lounge wear, sleepwear, intimates and more. Plus, you can shop for pregnancy and prenatal accessories, including pregnancy pillows, nursing bras, belly bands and other maternity wear needs. At Walmart.com, you can browse for maternity dresses and skirts, maternity tops and maternity swimwear. Get wear-to-work looks at every day low prices, as well as around-the-house maternity clothes. We have just-in styles for moms-to-be from tops and bottoms to dresses, too. Be sure to take a look at our value bundles featuring two-packs, outfits, diaper bag sets, crib mattress/maternity pillow combinations, and nursing tank/nursing pillow combination. Naturally, maternity clothes aren't the only things you'll find here for moms and their babies. We also offer an unbelievable selection of other baby products , including double strollers , disposable diapers , baby blankets and infant car seats , all at super, money-saving prices. So when you're looking for maternity wear, be sure to see the maternity clothing selection we offer at Walmart, where all our maternity clothes are priced to save you money.", "parent_text": "Maternity Clothes", "keyword_density": {"maternity clothes": "3.8", "maternity": "6.2"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 38890, "level": -1, "url": "http://www.walmart.com/browse/sports-outdoors/for-the-home-fan-shop/4125_1063984_1063994/?_refineresult=true&povid=cat4044-env434223-moduleA072013-lLinkLHNFeaturedShops3HomeSportsFanShop", "text": "Home Sports Fan Shop", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "For the Home Fan Shop", "parent_url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Home", "keyword_count": {"shop": 5, "fan shop": 4, "home fan shop": 2, "fan": 8, "home": 4}, "description_wc": 257, "description_text": "Show your team spirit with affordable sports fan collectibles, such as sports watches, sports jerseys, sports furniture, sports dining accessories and more at the sports fan shop at Walmart.com. Whether you're heading out to root for your alma mater or planning the ultimate tailgating party, our For the Home Fan Shop has something for you. Display your team pride with our selection of team apparel, or accent your home decor with sports furniture, sports storage , sports bath products or sports bedding , like a Dallas Cowboys comforter set. You can root for your favorite team while you cook with a sports fan apron and matching oven mitt, or pack your meal in a St. Louis Cardinals lunchbox. Kids can get in on the action, too, with our selection of sport fan wall art and team mascot pillows or the Walmart NFL Stationary Supplies Bundle with team-themed school supplies. You can even decorate a bathroom with an NCAA or NFL team shower curtain. Walmart.com makes it easy to score your favorite sports fan gear and home accessories online. Browse by team, price point and league, including MLB, NBA, NCAA, NFL, NHL, NASCAR, Soccer or the Olympics. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. If you have a favorite sport or team, Walmart's For the Home Fan Shop has the accessories to make you cheer. With the Walmart sports fan shop, you can save money and live better \u2014 a winning combination.", "parent_text": "Home", "keyword_density": {"shop": "2.0", "fan shop": "3.1", "home fan shop": "2.4", "fan": "3.1", "home": "1.6"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 543, "level": -1, "url": "http://www.walmart.com/browse/home/furniture/4044_103150/?_refineresult=true&facet=special_offers%3ARollback&povid=cat4044-env193469-moduleA081313-lLinkLHNSaveBigNow2RollbackFurniture", "text": "Hundreds of Furniture items on Rollback", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Furniture", "parent_url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Home", "keyword_count": {"furniture": 20}, "description_wc": 250, "description_text": "Furniture costs less at Walmart. Let us be your source for fashionable, functional and comfortable furniture at fantastic low prices. Whether you're shopping for new bedroom furniture or patio furniture, we offer furniture for every room in your home, not to mention outdoor furniture. What kind of furniture are you looking for? Discover all the furniture options you need, including beds, dining tables, office chairs, patio sets and entertainment centers from brands like Better Homes and Gardens, Canopy and Hometrends. It's all really easy to find, too, when you can shop furniture by categories, such as baby furniture, patio furniture , home office furniture , living room furniture and bedroom furniture. You can even browse furniture by price range or your favorite manufacturer, so finding exactly the furniture you want to complete your home furnishings is just a few clicks away. Maybe it's time for a complete furniture upgrade; time to refresh that worn-out dining table or replace that sagging sofa in the living room with something more comfortable and attractive. And what about that tired mattress you've been tossing and turning on for so many years? Wouldn't it be nice to finally get the good night's sleep you need? You'll find the furniture you've been dreaming about right here, from mattresses to dining tables and so much more. You'll save money on furniture at Walmart, so get all the furniture you want right here and start living better now.", "parent_text": "Home", "keyword_density": {"furniture": "8.1"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 102, "level": -1, "url": "http://www.walmart.com/browse/home/kids-bedding/4044_539103_133142/?_refineresult=true&facet=special_offers%3ARollback&povid=cat4044-env193469-moduleA032213-lLinkLHNSaveBigNow1KidsBeddingonRollback", "text": "Kids' Bedding on Rollback", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Kids' Bedding and Bedding for Teens", "parent_url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Home", "keyword_count": {"kids": 11, "kids bedding and bedding for teens": 2, "bedding": 21, "kids bedding": 7, "teens": 6, "bedding for teens": 4}, "description_wc": 223, "description_text": "Kids' bedding and bedding for teens. Find kids' bedding and bedding for teens at terrific low prices. It's hard to beat our selection of bedding for kids and bedding for teens, and the savings you'll get by shopping here are pretty hard to beat, too. For teen bedding and kids' bedding, Walmart is the smart place to shop. What sort of kids' bedding and teens' bedding are you looking for? Whether you want a bed-in-a-bag for teens, bedding for boys or a comforter for girls, you'll find it here for less. You'll also find lots of kids' bedding themed with their favorite characters ranging from Spongebob to Spider-Man. And our kids' character bedding, just like all the other kids' bedding and teen bedding at Walmart, is priced to save you money so you and your family can live better. Great prices on dedding for kids and bedding for teens aren't the only comfy savings you'll find. We also feature savings on baby bedding and baby furniture like cribs, plus other day-to-day needs like baby wipes and useful \"hardware\" like Baby Trend Strollers . See our bedding selection to find fun, attractive bedding for the whole family, too. Kids' bedding, bedding for teenagers and kids' comforter sets all cost less at Walmart.", "parent_text": "Home", "keyword_density": {"kids": "5.0", "kids bedding and bedding for teens": "5.4", "bedding": "9.5", "kids bedding": "6.3", "teens": "2.7", "bedding for teens": "5.4"}, "department_id": 41}
