{"department_text": "Value of the Day", "nr_products": 222, "level": -1, "url": "http://www.walmart.com/browse/grocery/snacks,-cookies-chips/976759_976787/?_refineresult=true&facet=specialty_diets%3AOrganic&ic=32_0&povid=cat976759-env440714-moduleA062913-lLinkLHNOrganicGrocery6Snacks", "text": "Snacks", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Snacks", "parent_url": "http://www.walmart.com/cp/grocery/976759?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Grocery", "keyword_count": {"snacks": 11}, "description_wc": 233, "description_text": "Snacks. Enjoy tasty savings on the snacks your family craves most. When it comes to the cookies you love to dunk, the chips you love to crunch and the snack foods you love to munch, this is the place to get them for less. At school, after school, at work and on the go, nothing brightens faces quite like their favorite snacks. And nobody helps you save on snacks quite like Walmart. What sorts of snacks do you want? We have the cookies you love, like Oreos, Chips Ahoy, Nutter Butter and Fig Newtons. Want chips? How about Lay's potato chips, Pringles, Frito-Lay corn chips, barbecue-flavored chips and more? And then, in the way of snacks, choose from Chex Mix, crackers, Corn Nuts, peanuts, granola bars, chocolate candy and others. Best of all, our low prices are as irresistible as the snacks, cookies and chips you can't wait to eat. While you're stocking up on all the most delicious snacks for school, work and weekend fun, don't miss out on our full selections of your favorite crackers , chips and snack bars . And, if you happen to be shopping for snacks to give your kids in school, you'll also be interested in super savings on all their school supplies . Snacks cost less here at Walmart. Why not save on the snacks your family loves?", "parent_text": "Grocery", "keyword_density": {"snacks": "4.8"}, "department_id": 41}
