{"department_text": "Value of the Day", "nr_products": 3752, "level": -1, "url": "http://www.walmart.com/browse/home/4044?catNavId=4044&ic=48_0&povid=cat4044-env193469-moduleA051311-lLinkLHNSpecialOffers2Rollback&facet=special_offers%3ARollback", "text": "Rollback", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Home Furnishings.", "parent_url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Home", "keyword_count": {"home": 5}, "description_wc": 211, "description_text": "From the floor to the ceiling, from your rugs to your lighting, everything you need for your home is right here at Walmart.com. Whether you're in the market for all-new decor , looking to upgrade your home furniture, or just want a new mattress or refrigerator, you'll find it all right here for less. Browse our vast selection of top-brand appliances , including the latest refrigerator, dishwasher and microwave oven models at terrific prices. We make it easy to save on your next refrigerator, dishwasher or microwave from top appliances brands you know. And when it's time for a new mattress and bedding , look no further than our attractive mattress and bedding collections. Ready to refresh your decor? You'll discover a huge array of decor options, stylish rugs, great-looking lighting solutions and more. Plus comfortable and attractive home furniture to add new life to all your living spaces, whether inside or outdoors. And, of course, Walmart.com also features all the linens, rugs, bedding, towels and window coverings to complement your new home furniture. Shop Walmart.com for Every Day Low Prices on home furniture, decor, major appliances and accessories, such as bedding, flower pots, rugs and lamps. Save money and live better with Walmart..", "parent_text": "Home", "keyword_density": {"home": "2.4"}, "department_id": 41}
