l find other rings of all kinds , plus earrings, necklaces, pendants, personalized jewelry , watches and so much more. And it's all here waiting for you at Every Day Low Prices you'll love. For engagement rings and wedding bands, including diamond engagement rings, platinum wedding rings and bridal sets, Walmart is the place to shop and save.", "parent_text": "Jewelry", "keyword_density": {"engagement rings and wedding rings": "7.3", "engagement": "4.7", "rings": "7.3", "engagement rings and wedding": "7.3", "wedding rings": "5.8", "wedding": "5.1", "engagement rings": "6.6"}, "department_id": 41}
