{"department_text": "Value of the Day", "level": -1, "url": "http://www.walmart.com/cp/3896?povid=cat3891-env435871-moduleA010413-lLinkLHNSpecialOffers7ShopallRings", "text": "Shop More Rings", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Rings", "parent_url": "http://www.walmart.com/cp/Jewelry/3891?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Jewelry", "keyword_count": {"rings": 26}, "description_wc": 261, "description_text": "Rings. From engagement rings to wedding rings to cocktail rings, you'll find plenty to love and plenty to choose from in our massive selection of gorgeous rings. If there's one thing we know how to do here at Walmart, it's saving you money on the rings that will come to mean the most to you. That's because we work hard to keep our prices low on rings of all kinds, including diamond rings, silver rings, cubic zirconia rings, platinum rings and gold rings. Our selection of rings is comprehensive, which means you'll find just about any kind of ring you're looking for. Want a beautiful engagement ring or a wedding band? How about a promise ring, class ring or anniversary ring or rings for any other occasion? They're all right here, and they're all priced to save you money. When it comes to rings of all kinds, it's hard to beat the selection and savings you get at Walmart. Rings aren't the only jewelry we carry here, of course. In addition to our selection of wedding bands and engagement rings , diamond rings, cubic zirconia rings and other rings of all shapes and sizes, we also offer earrings, necklaces, personalized jewelry , pendants, watches and so much more special jewelry to choose from, all at Every Day Low Prices you'll really love. For wedding bands, engagement rings, class rings, promise rings, gold rings, diamond rings and any other kind of ring, Walmart is the place to shop and save big.", "parent_text": "Jewelry", "keyword_density": {"rings": "10.0"}, "department_id": 41}
{"level": -2, "url": "http://www.walmart.com/giftregistry?povid=cat540912-env452532-moduleA101112-lLinkLHNLearnMore2WeddingRegistry", "text": "Wedding Registry", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "parent_url": "http://www.walmart.com/cp/540912?povid=cat3891-env435871-moduleA010413-lLinkLHNShopWedding_Engagement6ShopallWedding_Engagement", "description_wc": 255, "description_text": "Whether you're having a baby, getting married, celebrating a special occasion or creating a wish list of Christmas presents, you can make it easy for your friends and family to choose the perfect gift. By setting up a wedding registry, baby registry or wish list at Walmart.com, you'll take all the guesswork out of buying wedding gifts, baby gifts, birthday gifts, graduation gifts or Christmas presents. It's super easy to set up your gift registry or wish list in just a few quick steps, and it's even easier for others to shop from it. Have a baby on the way? Then be sure to visit our baby registry page right away to start setting up your baby gift registry. That way you'll be sure to get just what you want and people will have plenty of time to shop. Getting married? Then you already have enough to think about. That's why we've made setting up your wedding gift registry simple. You'll have your wedding registry set up faster than you can say \"I do!\" Now, what if you're not getting married or having a baby, but you want to set up a wish list for a special occasion? Setting up a wish list registry lets your friends and loved ones know exactly what you'd love to receive as a graduation gift, birthday gift or Christmas gift. Best of all, your wish list is easy to create, easy to shop from and totally free from Walmart.com.", "parent_text": "Shop More Wedding & Engagement", "department_text": "Value of the Day", "department_id": 41}
