{"department_text": "Value of the Day", "level": -2, "url": "http://www.walmart.com/cp/engagement-rings-wedding-bands/540912?povid=cat3896-env457095-moduleA100213-lLinkLHNShopbyCategory8Wedding_Engagement", "text": "Engagement Rings & Wedding Bands", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Engagement Rings and Wedding Rings", "parent_url": "http://www.walmart.com/cp/3896?povid=cat3891-env435871-moduleA010413-lLinkLHNSpecialOffers7ShopallRings", "keyword_count": {"engagement rings and wedding rings": 4, "engagement": 13, "rings": 20, "engagement rings and wedding": 5, "wedding rings": 8, "wedding": 14, "engagement rings": 9}, "description_wc": 276, "description_text": "Engagement rings and wedding rings. Whether you're ready to pop the big question or ready to stroll down the aisle, our selection of engagement rings and wedding rings is exactly where you want to be shopping right now. From diamond engagement rings to white gold wedding rings to gold engagment bands to platinum wedding bands, you'll find the perfect engagement ring or wedding ring here for less. We know how important it is to find just the right engagement ring or wedding ring for that special moment in your life, so we keep our prices low on all our bridal sets, engagement rings and wedding rings. Choosing the right engagement ring, bridal set or wedding ring can be challenging, so we make it easy with lots of beautiful choices at great prices. Choose from diamond engagement rings, gold wedding bands, platinum engagement bands, diamond wedding rings and many more bridal set options. They're all right here, and they're all priced to help save you more money. When it comes to engagement rings, wedding rings and bridal sets, it's really hard to beat the selection and savings at Walmart. Bridal sets aren't the only rings we offer, of course. In addition to our selection of engagement rings and wedding rings, you'll find other rings of all kinds , plus earrings, necklaces, pendants, personalized jewelry , watches and so much more. And it's all here waiting for you at Every Day Low Prices you'll love. For engagement rings and wedding bands, including diamond engagement rings, platinum wedding rings and bridal sets, Walmart is the place to shop and save.", "parent_text": "Shop More Rings", "keyword_density": {"engagement rings and wedding rings": "7.3", "engagement": "4.7", "rings": "7.3", "engagement rings and wedding": "7.3", "wedding rings": "5.8", "wedding": "5.1", "engagement rings": "6.6"}, "department_id": 41}
