{"department_text": "Value of the Day", "nr_products": 1825, "level": -1, "url": "http://www.walmart.com/browse/jewelry/3891/?_refineresult=true&facet=special_offers%3ANew&povid=cat3891-env435871-moduleA051013-lLinkLHNFeaturedShops4NewArrivals", "text": "New Arrivals", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Jewelry", "parent_url": "http://www.walmart.com/cp/Jewelry/3891?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Jewelry", "keyword_count": {"jewelry": 15}, "description_wc": 211, "description_text": "Jewelry. Whether your style is dressed-up or more casual, the right jewelry makes you look and feel special. Saving money on jewelry is easy at Walmart, thanks to our enormous collection of beautiful jewelry such as rings , watches, necklaces, bracelets, earrings and more. For jewelry of all kinds, it's hard to beat the selection and savings at Walmart. We've searched far and wide to bring you the best jewelry at truly gorgeous values, including diamond rings, gold necklaces, diamond earrings, a full selection of stylish watches, gold bracelets, pendants and even personalized jewelry . At these great prices, they make the perfect gifts for any occasion. And speaking of special occasions, our jewelry collection also includes wedding rings and engagement rings. Look no further than our Wedding and Engagement collection for perfect tokens of your love. Or, if you just want everyday jewelry that looks nice, we have that kind of jewelry, too, including gold jewelry, watches, necklaces, pendants, earrings and much more. In addition, we have a great assortment of jewelry for kids and jewelry for men, including watches from Timex, Armitron, Casio and other top brands. No matter what type of jewelry you want, it's always time to save money on jewelry at Walmart.com.", "parent_text": "Jewelry", "keyword_density": {"jewelry": "7.2"}, "department_id": 41}
