{"department_text": "Value of the Day", "level": 0, "url": "http://www.walmart.com/cp/Baby/5427?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Baby", "text": "Baby", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Baby Items and Baby Supplies", "parent_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "keyword_count": {"baby supplies": 7, "baby": 31, "baby items": 7, "baby items and baby": 2, "supplies": 9}, "description_wc": 265, "description_text": "Baby supplies and baby items. The baby supplies and baby items you need cost less at Walmart. We have a whole baby store full of baby supplies and baby items at great savings right here. For baby gear, baby supplies, baby gifts and other baby stuff, check out our full selection of baby items. Find all the important baby supplies you need right here, whether you're a mom yourself or shopping for a mother-to-be. From adorable baby clothing to strollers and toys for babies, everything is priced to save you money. Browse for soft, cuddly baby clothes in a wide range of cute designs for boys and girls. For the nursery, discover safe, sturdy cribs and baby bedding, plus fun and educational toys for babies at every stage of development. And family outings become easier and more fun when you have the right car seat and stroller. When it's diapers you need, you'll find unbeatable prices on all the most-trusted diaper brands, including Pampers and Huggies. It's all part of our huge baby store full of baby supplies, baby items and baby products. Plus, find baby formula, baby bottles and baby care supplies like lotions and soaps, all available at unbeatable prices with a click of your mouse. For baby supplies, baby items, baby gear, baby gifts and baby products like strollers , diapers and potty training supplies, cribs and baby car seats there's only one place to get everything you need for less. Walmart is the headquarters for baby items and baby gifts at big savings.", "parent_text": "Value of the Day", "keyword_density": {"baby supplies": "5.3", "baby": "11.7", "baby items": "5.3", "baby items and baby": "3.0", "supplies": "3.4"}, "department_id": 41}
{"department_text": "Value of the Day", "level": 0, "url": "http://www.walmart.com/cp/91083?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Auto_Tires", "text": "Auto & Tires", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Save on auto tires, oil and more for your vehicle at Walmart", "parent_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "keyword_count": {"oil": 4, "auto": 3, "tires": 4, "walmart": 6, "vehicle": 2, "save": 4}, "description_wc": 211, "description_text": "From Goodyear and Pirelli to Michelin and Bridgestone, it's easy to find the right tires for your car at Walmart.com. Simply browse by vehicle or tire size. Then place your order and select your Walmart Auto Care Center location for pick-up and installation at Every Day Low Prices. Find the Walmart Auto Care Center location nearest you . While you're there, why not save time and money by getting a complete lube and oil change as well? In addition to changing your oil, our Walmart Auto Care Center technicians will top off your car's brake fluid, transmission fluid, power steering fluid and more. We offer Every Day Low Prices on oil and car care products . And when you buy a new car battery from us, we'll install it and charge it for you at no extra cost. Walmart.com is the place to save on tires from Goodyear, Pirelli, Michelin, Bridgestone and other top brands, as well as tools and equipment to keep your ride running its best. You can find tires, motor oil and more vehicle needs right here at Walmart.com. Our Every Day Low Prices will save you money now, while the improved performance from better tires will save you money down the road.", "parent_text": "Value of the Day", "keyword_density": {"oil": "1.9", "auto": "1.4", "tires": "1.9", "walmart": "2.9", "vehicle": "1.0", "save": "1.9"}, "department_id": 41}
