{"department_text": "Video Games", "level": 0, "url": "http://www.walmart.com/cp/1089665?povid=cat2636-env428896-moduleA071013-lLinkLHNRelatedCategories2Kids_Family", "text": "Kids & Family", "department_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "description_title": "Save on Kids and Family Games at Walmart", "parent_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "keyword_count": {"kids": 4, "family": 6, "games at walmart": 2, "walmart": 7, "games": 14, "save": 1, "kids and family games": 1}, "description_wc": 329, "description_text": "Get ready for fun with kids' video games and family video games from Walmart. We've got all the games you want to play on Nintendo 3DS, DS, DSi and Nintendo Wii , as well as games for PlayStation 2, PlayStation 3 , PS Vita and PSP, along with Xbox 360 and PC games. Of course, you'll find all of these video game consoles at Walmart, too. You might want to start your browsing in our Top 50 Games to find the most popular video game entertainment at Every Day Low Prices. Choose from titles such as Mario & Luigi: Bowser's Inside Story, Zumba Fitness 2 and Wipeout. Then keep up with all the latest video game action in our New Releases section. Or be among the first to play an upcoming game when you use our Preorders section. Our Family Game Night section features favorites, such as Hasbro Family Game Night, Toy Story Mania, and Mario Party 9. When you're feeling energetic, try one of our Dance Games like Dance Central, Abba You Can Dance or the Black-Eyed Peas Experience. Take advantage of cutting-edge game technology with Kinect, PlayStation Move and Wii U games. Our selection includes top game titles, such as Just Dance and Michael Jackson: The Experience. And don't forget Skylanders Spyros Adventure featured games and figures, including the limited-edition Red-Armored Drill Sergeant, a Walmart exclusive. It's easy to shop by game console brand, price range, ESRB rating, customer rating, or best sellers to decide on just the right kids' video games and family video games at Walmart.com. Be sure to visit our Walmart Game Center to play free game demos or view game trailers and screenshots. Many kids and family games qualify for free Site to Store shipping, too, so you can pick them up at your closest Walmart store. Shop for kids' video games and family video games at Walmart to save money and live better.", "parent_text": "Video Games", "keyword_density": {"kids": "1.2", "family": "1.8", "games at walmart": "1.8", "walmart": "2.1", "games": "4.3", "save": "0.3", "kids and family games": "1.2"}, "department_id": 42}
