{"department_text": "Value of the Day", "nr_products": 1394, "level": -1, "url": "http://www.walmart.com/browse/apparel/5438?_refineresult=true&ic=48_0&path=0%3A5438&povid=cat5438-env200998-moduleA040512-lLinkLHNSpecialOffers1Clearance&facet=special_offers%3AClearance", "text": "Clearance", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Clothing and apparel costs less at Walmart.", "parent_url": "http://www.walmart.com/cp/Apparel/5438?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Apparel", "keyword_count": {"apparel": 4, "walmart": 2, "clothing": 1}, "description_wc": 226, "description_text": "From women's fashions to men's wear to great-looking kid's clothes, you'll find unbeatable prices on apparel for the whole family at Walmart.com. Whether you're looking for delicate women's intimates or tough, hardworking Wranglers jeans for men, there's no better place to save on the clothes to fit your lifestyle. Check out our giant selection of comfortable everyday favorites like Hanes t-shirts and jeans such as Signature by Levi Strauss & Co. There's plenty for kids to love, too, including the most popular girls' fashions and clothes for boys , plus all their favorite characters on licensed apparel from Disney, Hello Kitty and Nickelodeon. In men's clothing , we've got you covered head-to-toe. Choose from professional styles or rugged work clothes like Dickies or Wrangler. No matter what you do for a living, we'll help you save more of your hard-earned money. On weekends, unwind in casual styles and active wear that's comfortable and looks great. Got a special occasion coming up? How about a new dress, with new shoes and a handbag to match? Shop for fabulous dresses from our complete range of women's apparel , which also includes intimates and maternity wear . Shop Walmart for clothes and apparel today, because saving money never goes out of style.", "parent_text": "Apparel", "keyword_density": {"apparel": "1.8", "walmart": "0.9", "clothing": "0.5"}, "department_id": 41}
