{"department_text": "Video Games", "level": -1, "url": "http://www.walmart.com/cp/96469?povid=cat1078524-env377582-moduleA062911-lLinkLHNRelatedCategories2iPods_mp3Players", "text": "iPods & MP3 Players", "department_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "description_title": "iPod and MP3 Player Selections", "parent_url": "http://www.walmart.com/cp/1078524?povid=cat2636-env428896-moduleA071013-lLinkLHNRelatedCategories3Tablets", "keyword_count": {"player": 21, "ipod": 16, "mp3 player": 15, "ipod and mp3 player": 2, "mp3": 17}, "description_wc": 265, "description_text": "iPod and MP3 Player choices. Shopping for a new MP3 player or iPod? Then look no further than our MP3 player and iPod selection, where you'll find iPods and MP3 players at terrific savings. Best of all, we keep our iPod and MP3 player prices low, so you can save money and live better. When you want a new MP3 player or iPod, Walmart is the place to shop. No matter what sort of iPod or MP3 player you want, you can find what you're looking for here. We carry iPods like the iPod Nano, iPod Shuffle and iPod Touch. Plus, we also have the latest Samsung MP3 player, Android player, Sony MP3 player and Ematic MP3 player models. And our MP4 player and MP3 video player selection is hard to beat, too. Look no further than Walmart for the best price on an iPod Touch, iPod Nano, iPod Shuffle, Samsung MP3 player, Android player, Sony MP3 player, MP4 player or MP3 video player. When you've picked out the MP3 player you want, don't miss our ginormous selection of other low-priced, top-quality electronics , including networking gear , TV and video equipment and everything else you can imagine in the way of electronics and computers. So get the iPods and MP3 players you want here, and save just as much on our huge selection of Electronics, including all the cool gadgets and essentials you really want and need. We have the latest iPads, cameras, camcorders, laptops, TVs, iPods, MP3 players and other awesome stuff for entertainment, work and play.", "parent_text": "Tablets", "keyword_density": {"player": "8.0", "ipod": "6.1", "mp3": "6.5", "ipod and mp3 player": "3.0", "mp3 player": "11.4"}, "department_id": 42}
