{"level": -1, "url": "http://www.walmart.com/ip/PayPal-Here-Credit-Card-Reader-for-Mobile-Credit-Card-Processing/21842852?povid=cat1078524-env377582-moduleA111712-lLinkLHNWhatsNewPayPalHereCreditCardReader", "text": "Pay Pal Here Credit Card Reader", "department_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "parent_url": "http://www.walmart.com/cp/1078524?povid=cat2636-env428896-moduleA071013-lLinkLHNRelatedCategories3Tablets", "description_wc": 241, "description_text": "Processing time for an item is the time from when you submit your order to when the item leaves the warehouse. You can usually find an item's processing time when you click \"See estimated arrival date\" on the item page. Shipping time is from when the item leaves the warehouse to when it arrives at your door. See shipping time below. The arrival date-range of each item is determined by adding the minimum of the processing time to the minimum of the shipping time and the maximum of the processing time to the maximum of the shipping time. For instance, if you bought a music CD that took 1 to 2 business days to process before shipping and you had it sent by Standard shipping (3 to 5 business days), the CD would arrive in 4 to 9 business days. You will usually see the estimated arrival date-range when you click \"See estimated arrival date\" on the item page. You will see the actual arrival date-range during checkout. Standard Shipping times apply to items being sent to the 48 contiguous states. For Standard Shipping to Alaska, Hawaii or Puerto Rico, add 2-4 days. Shipments to APO / FPO addresses should arrive in 3-6 weeks. Please note: Delivery of oversize items is limited to street addresses in the 48 contiguous states. You will see the estimated arrival date during checkout after you choose a shipping address.", "parent_text": "Tablets", "department_text": "Video Games", "department_id": 42}
