{"department_text": "Value of the Day", "level": -1, "url": "http://www.walmart.com/cp/3906?povid=cat5438-env200998-moduleA071713-lLinkLHNAccessories4Watches", "text": "Watches", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Watches", "parent_url": "http://www.walmart.com/cp/Apparel/5438?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Apparel", "keyword_count": {"watches": 20}, "description_wc": 234, "description_text": "Watches. Time for a new watch? Browse our selection of watches to find the perfect new watch for less. We have so many great watches to choose from, you're sure to get just the watch you want at great savings. When you want the best selection of wristwatches at terrific low prices, Walmart is the smart place to shop. Watches cost less at Walmart. What kind of wristwatch are you looking for? Whether you want men's watches, watches for women, sport watches, luxury watches or any other kind of wristwatches, chances are you'll find what you want here. Our watch collection includes watches for men, watches for women, sport watches, dress watches and all sorts of other timepieces. Whether you're shopping for a casual timepiece for everyday wear or a watch that exudes elegance, we've got everything covered. We feature the top brands you know and love, too, including Timex watches, Armitron watches and Casio watches. Mens and ladies' watches aren't the only timepieces we carry, of course. We also offer a full line of watches for kids . Plus, check out our selection of other jewelry like rings , Wedding and Engagement bands , earrings, pendants, necklaces and more, all waiting for you at our Every Day Low Prices. Save big on a new watch at Walmart, where all our watches are priced to save you money.", "parent_text": "Apparel", "keyword_density": {"watches": "8.7"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 6956, "level": -1, "url": "http://www.walmart.com/browse/apparel/accessories/5438_426265?ic=48_0&catNavId=+426265&path=0%3A5438&povid=cat5438-env200998-moduleA040512-lLinkLHNShoesAccessories3HatsAccessories", "text": "Hats & Accessories", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Clothing Accessories", "parent_url": "http://www.walmart.com/cp/Apparel/5438?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Apparel", "keyword_count": {"clothing": 6, "accessories": 7, "clothing accessories": 5}, "description_wc": 207, "description_text": "From hats and gloves to belts and ties, the clothing accessories you're looking for are available for less at Walmart. Walmart has a wide range of apparel accessories for your entire family. With our selection, it's easy to liven up your wardrobe with colorful new scarves or keep the family prepared for weather conditions with sturdy new umbrellas . You'll find top brands and styles, including Faded Glory clothing, and other clothing accessories for all seasons. At Walmart, you'll find fun headwear for you and your kids. Our apparel accessories, including ties and wallets, are excellent gift items as well. Whether you need to protect yourself from the sun, or keep warm on a cool evening, you'll find a range of hats, gloves and other clothing accessories to suit your needs. At Walmart.com, it's easy to shop for clothing accessories. Filter your search results by department, size, brand, color, price, gender, customer rating, special offers and more. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. Find the clothing accessories you need for less at Walmart. With our Every Day Low Prices, you can save money and live better.", "parent_text": "Apparel", "keyword_density": {"clothing": "2.9", "accessories": "3.4", "clothing accessories": "4.9"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 17715, "level": -1, "url": "http://www.walmart.com/browse/apparel/bags/5438_1045799/?_refineresult=true&povid=cat5438-env200998-moduleA040512-lLinkLHNShoesAccessories2BagsLuggage", "text": "Bags & Luggage", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Bags", "parent_url": "http://www.walmart.com/cp/Apparel/5438?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Apparel", "keyword_count": {"bags": 19}, "description_wc": 274, "description_text": "From adult bags to kids' bags, a selection of the different styles, shapes and sizes of bags you're looking for are available at Walmart. Whether you're checking out the latest carry-ons and travel bags or browsing laptop bags for your mobile office, our extensive selection of handbags, backpacks, messenger bags and wallets has got you covered. We offer an impressive variety of sports bags for specialty equipment such as golf caddies, crossbow cases and ski and boot bags. Our kids' bags feature many popular brands and characters like Angry Birds, Disney, Hello Kitty and Nickelodeon. Add your name or photo to create your own unique bag with our selection of personalized bags. Check out our large array of handbags in popular styles, from clutches to totes and shoulder bags to satchels. We offer many handbag brands such as Bisadora, Earth Axxessories, Jessica Simpson, Sydney Love and Tokyobay. Our styles of backpacks include school backpacks, laptop backpacks and hydration backpacks from Eastsport, Everest, NFL and Wildkin. We also offer a wide selection of trusted brands in luggage such as American Tourister, Netpack, Protege and Traveler's Choice. Many types of luggage and travel bags are available including garment bags, duffel bags and rolling luggage sets. Shopping for bags at Walmart.com is simple when you filter search results by category, brand, color, sports league, character, price and customer rating. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. From backpacks and kids' bags to handbags and luggage, you'll find what you're looking for at Walmart. Save money. Live better.", "parent_text": "Apparel", "keyword_density": {"bags": "6.9"}, "department_id": 41}
