, surge protectors, AC adapters and laptop cases. Many tablet computers qualify for free in-store pickup at your nearby Walmart store when you use Site to Store online ordering. Shop for tablet computers and more electronics at Walmart to save money and live better.", "parent_text": "Tablets", "keyword_density": {"tablet computers": "4.2", "computers": "2.9", "tablet": "4.2"}, "department_id": 42}
