t_text": "Auto & Tires", "department_text": "Value of the Day", "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 1154, "level": -1, "url": "http://www.walmart.com/browse/apparel/mens-shoes/5438_1045804_1045807_426207/?_refineresult=true&povid=cat5438-env200998-moduleA071713-lLinkLHNMensShoes", "text": "Mens' Shoes", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Men's Shoes", "parent_url": "http://www.walmart.com/cp/Apparel/5438?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Apparel", "keyword_count": {"men s shoes": 5, "men": 9, "shoes": 8}, "description_wc": 190, "description_text": "At Walmart, you can find a variety of men\u2019s shoes for less. Come shop at Walmart and choose from our variety of men's rain boots , men's slippers and men's sandals to find the men's shoes that are right for you. Be sure to browse our selection of other shoes and men\u2019s safety shoes to find more footwear that may be right for you and your family. At Walmart, we carry men's shoes from a number of top brands, such as Comfy Feet, Dr. Scholl's, MUK LUKS and more. Shopping for men's shoes is easy at\u00a0Walmart.com. You can search for the shoes you want by category, shoe size, style, brand, color, price, rating, top sellers, top rated, keyword and more. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. When you're looking for quality men's shoes for less, you can find what you need at Walmart. With our wide selection, we're here to help meet your needs so you can save money and live better.", "parent_text": "Apparel", "keyword_density": {"men s shoes": "7.9", "men": "4.8", "shoes": "4.2"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 551, "level": -1, "url": "http://www.walmart.com/browse/apparel/5438?_refineresult=true&ic=16_0&path=0%3A5438&povid=cat5438-env200998-moduleA040512-lLinkLHNSpecialOffers5ValueBundles&facet=save_big%3ABundle", "text": "Value Bundles", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Clothing and apparel costs less at Walmart.", "parent_url": "http://www.walmart.com/cp/Apparel/5438?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Apparel", "keyword_count": {"apparel": 4, "walmart": 2, "clothing": 1}, "description_wc": 226, "description_text": "From women's fashions to men's wear to great-looking kid's clothes, you'll find unbeatable prices on apparel for the whole family at Walmart.com. Whether you're looking for delicate women's intimates or tough, hardworking Wranglers jeans for men, there's no better place to save on the clothes to fit your lifestyle. Check out our giant selection of comfortable everyday favorites like Hanes t-shirts and jeans such as Signature by Levi Strauss & Co. There's plenty for kids to love, too, including the most popular girls' fashions and clothes for boys , plus all their favorite characters on licensed apparel from Disney, Hello Kitty and Nickelodeon. In men's clothing , we've got you covered head-to-toe. Choose from professional styles or rugged work clothes like Dickies or Wrangler. No matter what you do for a living, we'll help you save more of your hard-earned money. On weekends, unwind in casual styles and active wear that's comfortable and looks great. Got a special occasion coming up? How about a new dress, with new shoes and a handbag to match? Shop for fabulous dresses from our complete range of women's apparel , which also includes intimates and maternity wear . Shop Walmart for clothes and apparel today, because saving money never goes out of style.", "parent_text"