{"department_text": "Value of the Day", "level": -2, "url": "http://www.walmart.com/cp/976787?povid=cat1086304-env455419-moduleA111412-lLinkLHNRelatedCategories2Snacks", "text": "Snacks", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Snacks", "parent_url": "http://www.walmart.com/cp/1086304?povid=cat5438-env200998-moduleA040512-lLinkLHNFeaturedShops5TheUniformShop", "keyword_count": {"snacks": 11}, "description_wc": 233, "description_text": "Snacks. Enjoy tasty savings on the snacks your family craves most. When it comes to the cookies you love to dunk, the chips you love to crunch and the snack foods you love to munch, this is the place to get them for less. At school, after school, at work and on the go, nothing brightens faces quite like their favorite snacks. And nobody helps you save on snacks quite like Walmart. What sorts of snacks do you want? We have the cookies you love, like Oreos, Chips Ahoy, Nutter Butter and Fig Newtons. Want chips? How about Lay's potato chips, Pringles, Frito-Lay corn chips, barbecue-flavored chips and more? And then, in the way of snacks, choose from Chex Mix, crackers, Corn Nuts, peanuts, granola bars, chocolate candy and others. Best of all, our low prices are as irresistible as the snacks, cookies and chips you can't wait to eat. While you're stocking up on all the most delicious snacks for school, work and weekend fun, don't miss out on our full selections of your favorite crackers , chips and snack bars . And, if you happen to be shopping for snacks to give your kids in school, you'll also be interested in super savings on all their school supplies . Snacks cost less here at Walmart. Why not save on the snacks your family loves?", "parent_text": "School Uniform Shop", "keyword_density": {"snacks": "4.8"}, "department_id": 41}
{"department_text": "Value of the Day", "level": -2, "url": "http://www.walmart.com/cp/1086045?povid=cat1086304-env455419-moduleA111412-lLinkLHNRelatedCategories1SchoolSupplies", "text": "School Supplies", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "School Supplies", "parent_url": "http://www.walmart.com/cp/1086304?povid=cat5438-env200998-moduleA040512-lLinkLHNFeaturedShops5TheUniformShop", "keyword_count": {"supplies": 9, "school": 13, "school supplies": 5}, "description_wc": 241, "description_text": "From a wide selection of kid's back-to-school supplies and school calculators to teaching and classroom supplies , the school supplies you are looking for are available at Walmart. Choose from a variety of school binders, writing supplies, arts and craft supplies, construction paper, school notebooks , lined paper or backpacks at Walmart. You'll find a wide selection of items for back-to-school organization . Our extensive array of school supplies and products includes binders, textbooks, pre-school supplies and learning tools and activities. Whether you're shopping for Crayola markers, Bic Wite-Out, Paper Mate pencils, Elmer's School Glue, Pacon sketch pads, RoseArt alphabet stampers, an Advantus globe or X-ACTO sharpeners, Walmart has you covered. You'll find what you want, including Swingline staplers, Scotch transparent tape, a Texas Instruments scientific calculator or mathematics and biology school textbooks . Walmart also stocks a variety of dictionaries and thesauruses, various study aids and index cards for your convenience. Look for Every Day Low Prices on school-supply value bundles and sort school supplies online by brand, price, customer preference or special offers, such as rollbacks and clearance. Be sure to look for Walmart's money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. From classroom supplies and multi-purpose paper to school uniforms and Box Top specials, Walmart's selection can meet your needs. Save money. Live better.", "parent_text": "School Uniform Shop", "keyword_density": {"supplies": "3.8", "school": "5.5", "school supplies": "4.2"}, "department_id": 41}
