ve money. Live better.", "parent_text": "The Fitting Room", "keyword_density": {"women s shoes": "4.0", "shoes": "4.0", "women": "4.5"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 10, "level": -2, "url": "http://www.walmart.com/browse/apparel/school-uniforms/5438_607360/?_refineresult=true&facet=special_offers%3AClearance&povid=cat1086304-env455419-moduleA111412-lLinkLHNSpecialOffers1Clearance", "text": "Clearance", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "School Uniforms", "parent_url": "http://www.walmart.com/cp/1086304?povid=cat5438-env200998-moduleA040512-lLinkLHNFeaturedShops5TheUniformShop", "keyword_count": {"school uniforms": 5, "school": 12}, "description_wc": 174, "description_text": "Whether you're shopping for boys' clothing or girls' clothing , our school uniforms offer a large range of colors and styles. You'll find school shirts, school pants, school shorts, full school uniforms and more. Get new school skirts and school jackets for your kids, at our Every Day Low Prices. At Walmart, you'll find the school uniforms and apparel supplies your kids need with styles they can appreciate. Whether your child is starting at a new school and needs a full, new set of clothes or just a few add-on pieces, Walmart's school uniform department has you covered. It's easy to shop for school uniforms at Walmart.com. You can search for the clothes you want by color, brand, size, category and more. Browse a list of best sellers and featured items. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. For a large selection of school uniforms for less, check out Walmart. Save money. Live better.", "parent_text": "School Uniform Shop", "keyword_density": {"school uniforms": "5.8", "school": "6.9"}, "department_id": 41}
