{"department_text": "Value of the Day", "level": -2, "url": "http://www.walmart.com/cp/133201?povid=cat1086304-env455419-moduleA111412-lLinkLHNShopApparel4Juniors", "text": "Juniors", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Clothes for Juniors", "parent_url": "http://www.walmart.com/cp/1086304?povid=cat5438-env200998-moduleA040512-lLinkLHNFeaturedShops5TheUniformShop", "keyword_count": {"clothes for juniors": 5, "juniors": 19, "clothes": 9}, "description_wc": 174, "description_text": "Clothes for juniors. Get clothes for juniors at Walmart for less. We have a wide selection of clothes for juniors and juniors apparel. Our juniors clothing selection includes all the clothes for teens and clothes for juniors that are popular today, at terrific low prices. For juniors clothing and juniors apparel, shop Walmart and save. From jeans and skirts to the latest looks from top brands, you'll find all the juniors clothing and juniors apparel you need at Walmart.com. Let's face it, stylish clothes for teens at great prices are hard to find. Whether you're feeling dressy, trendy, punky or boho, we've got your juniors clothes covered. Our terrific selection of juniors apparel includes juniors pants, juniors tops, juniors swim suits, juniors dresses and more. You can browse through clothes to match your particular style at Every Day Low Prices. Shop for juniors apparel and clothes for juniors by category or by brands. Plus, see the latest style trends, including juniors clothing by No Boundaries, Op, Hard Candy and L.E.I.", "parent_text": "School Uniform Shop", "keyword_density": {"clothes for juniors": "8.6", "juniors": "10.9", "clothes": "5.2"}, "department_id": 41}
{"department_text": "Value of the Day", "level": -3, "url": "http://www.walmart.com/cp/1093705?povid=cat1086045-env449867-moduleA112912-lLinkLHNRelatedCategories2BackToCollege", "text": "Back to College", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "College Living Starts at Walmart", "parent_url": "http://www.walmart.com/cp/1086045?povid=cat1086304-env455419-moduleA111412-lLinkLHNRelatedCategories1SchoolSupplies", "keyword_count": {"college living": 5, "living": 8, "college": 13, "walmart": 8, "college living starts at walmart": 1}, "description_wc": 266, "description_text": "Got everything to go back to college? Walmart has all of the necessities and extras to improve college life in your dorm or off campus. For everything from studying to socializing, you'll find smart savings for college living at Walmart. Our handy College Checklist makes sure you remember what you'll need to relax, study, organize, sleep, eat, and shower. Get your studying done, entertain yourself and stay connected with laptops, iPads, iPods, digital cameras, cell phones and more college electronics from Walmart. Personalize your room with college bedding , rugs, lights and more college living decor . Keep your clothes, books, and other gear organized in boxes, bins, baskets, drawers, carts and more college living storage solutions from Walmart. Outfit your living space with college appliances , such as microwaves, mini fridges, coffee makers and irons. If you're living off campus, take a look at affordable desks, chairs, bookcases and college furniture for your living room, bedroom and kitchen. College living definitely is easier when you can shop for must-have essentials at can't miss prices from Walmart.com. Browse by brand, best sellers, price range or customer ratings to find just the right item. You can save even more with our student-friendly Rollbacks, Special Buys and Value Bundles, too. College students can take advantage of free Site to Store shipping on hundreds of thousands of items on Walmart.com. You simply make your purchase in advance online and have it shipped to any Walmart store near your campus for easy pickup. College living starts at Walmart to save money and live better.", "parent_text": "School Supplies", "keyword_density": {"college living": "3.8", "living": "3.0", "walmart": "3.0", "college": "4.9", "college living starts at walmart": "1.9"}, "department_id": 41}
