{"department_text": "Value of the Day", "level": -3, "url": "http://www.walmart.com/cp/414099?povid=cat584291-env434137-moduleA021513-lLinkLHNShoes_More6NurseryFurniture", "text": "Nursery Furniture", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Baby Furniture", "parent_url": "http://www.walmart.com/cp/584291?povid=cat1086304-env455419-moduleA111412-lLinkLHNShopApparel1Baby_Toddler", "keyword_count": {"baby": 22, "baby furniture": 10, "furniture": 12}, "description_wc": 226, "description_text": "Baby furniture. Baby furniture and nursery furniture like cribs and changing tables cost less at Walmart.com. New parents, parents-to-be, or anyone who has babies in their lives will love our little prices on the baby furniture they need for a baby nursery or baby bedroom. With so many baby furniture colors and themes to choose from, it's easy to find the perfect baby furniture for your baby's nursery. In addition to handsomely designed cribs and well-made baby furniture, we also carry a full selection of baby beds, nursery furniture, changing tables and much more for the perfect nursery. And if you've ever shopped for new baby furniture like a crib, changing table, baby bed or nursery set, you know it's nice to find them at a great price. That's why we do all we can to save you money on baby furniture. Of course, baby furniture isn't all we carry. To go with your new crib or baby bed, you're going to need baby bedding, crib sheets, crib bedding, baby pillows and baby blankets to match. Thankfully, we offer a broad assortment of baby bedding , learning toys and activities, strollers, diapering and potty gear and baby safety essentials . See our complete selection of baby furniture and baby stuff , all at lovable Walmart prices.", "parent_text": "Baby & Toddler", "keyword_density": {"baby": "9.9", "baby furniture": "9.0", "furniture": "5.4"}, "department_id": 41}
{"department_text": "Value of the Day", "level": -3, "url": "http://www.walmart.com/cp/486190?povid=cat584291-env434137-moduleA021513-lLinkLHNShoes_More4Diapering", "text": "Diapering", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Diapers and Potty Training Supplies", "parent_url": "http://www.walmart.com/cp/584291?povid=cat1086304-env455419-moduleA111412-lLinkLHNShopApparel1Baby_Toddler", "keyword_count": {"training": 8, "potty training": 7, "potty training supplies": 4, "diapers": 6, "potty": 8, "diapers and potty training supplies": 2}, "description_wc": 200, "description_text": "Now diapering and potty training can be easier and more affordable than ever when you shop from our full range of diapers, baby wipes, baby potties and potty training supplies. Stock up and save on diapers and everything else you need for diapering or potty training your newborn, infant, baby or toddler. Our selection of diapering products and potty training supplies includes brands, such as Huggies, Pampers, G Diapers, Seventh Generation, Playtex Baby, and more popular names. Not only can you stock up and save on diapers and training pants, but you'll find terrific values on more diapering and potty training products, such as baby wipes, diaper changing pads and covers, and diaper pails and accessories. Of course, you'll also find fun and friendly potties designed to entertain and encourage your toddler as he or she learns how to use the potty. With Every Day Low Prices on diapers and potty training supplies and more, you'll be able to stock up on everything you need as your child grows from newborn to infant to baby to toddler. Keeping up with your baby is more affordable with diapers and potty training supplies from Walmart. Save money. Live better.", "parent_text": "Baby & Toddler", "keyword_density": {"training": "4.0", "potty training": "7.0", "potty training supplies":