{"department_text": "Value of the Day", "level": -3, "url": "http://www.walmart.com/cp/86323?povid=cat584291-env434137-moduleA021513-lLinkLHNShoes_More5Gear", "text": "Gear", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Baby Gear", "parent_url": "http://www.walmart.com/cp/584291?povid=cat1086304-env455419-moduleA111412-lLinkLHNShopApparel1Baby_Toddler", "keyword_count": {"baby": 21, "baby gear": 12, "gear": 13}, "description_wc": 254, "description_text": "Baby gear. For baby gear like strollers, car seats and high chairs, you'll want to check out the baby gear selection at Walmart.com. We offer unbelievably low prices on all the baby gear a new parent needs, including a full fleet of baby strollers, baby seats for cars, high chairs, baby carriers by brands you know and trust, and portable playards. For baby gear, it's really hard to beat the selection and prices at Walmart. Whether you're a new parent, a mom- or dad-to-be, or simply shopping for friends or family members with babies, Walmart.com is the easiest way to find the baby gear you need for less. In addition to must-have baby gear like cribs, strollers and high chairs, you can get fun-to-have baby gear like baby swings, mobiles, rockers and everything else a new parent (and baby) could ever wish for. We have all the best baby gear brands, too, including Fisher-Price, Evenflo, Britax, Graco and many others. In addition to terrific baby gear, we carry a broad assortment of baby bedding , baby toys and activities, diapering and potty gear , baby safety essentials and more, all at low Walmart prices you'll love. It's all part of our commitment to keeping prices low so you can save money and live better. So when you need baby gear, you know you're in the right place. See our entire collection of baby gear baby essentials , all at lovable Walmart prices.", "parent_text": "Baby & Toddler", "keyword_density": {"baby": "8.4", "baby gear": "9.6", "gear": "5.2"}, "department_id": 41}
