{"department_text": "Value of the Day", "nr_products": 199, "level": -3, "url": "http://www.walmart.com/browse/apparel/bibs-and-burp-cloths/5438_584291_584311/?_refineresult=true&povid=cat584291-env434137-moduleA021513-lLinkLHNShoes_More2Bibs_Burpcloths", "text": "Bibs & Burp Cloths", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Baby Bibs and Burp Cloths", "parent_url": "http://www.walmart.com/cp/584291?povid=cat1086304-env455419-moduleA111412-lLinkLHNShopApparel1Baby_Toddler", "keyword_count": {"baby bibs and burp cloths": 3, "cloths": 10, "baby bibs": 9, "burp": 10, "burp cloths": 9, "baby": 13, "bibs": 10}, "description_wc": 238, "description_text": "Baby bibs and burp cloths. Discover great prices on baby bibs and burp cloths at Walmart. Keep feeding time nice and tidy with baby bibs, burp cloths, toddler bibs and more, all at Every Day Low Prices. You'll appreciate how much easier it is to clean up after meal time when you use a baby bib or burp cloth, and you'll love how much you save by shopping at Walmart. ,p> It's hard to beat our selection of burp cloths and baby bibs at some of the lowest prices anywhere. We have burp cloths and baby bibs in lots of colors and styles to keep mealtime fun, and clean. See our baby bibs in super-absorbent cloths or protective plastics, and check out our super-absorbent burp cloths for easy feeding on the go. When you're looking for baby bibs and burp cloths, it's Walmart is the place to shop. We carry more than just burp cloths and baby bibs, of course. For babies and toddlers, we also carry a wide range of other essential items like diapers, bath toys, formulas and plush animals. Check out our giant assortment of parenting and baby gear , maternity styles ,learning toys and games, nursery furniture , strollers and baby safety products. When it comes to burp cloths and baby bibs, you'll always get the best selection and value in the Baby department at Walmart.", "parent_text": "Baby & Toddler", "keyword_density": {"baby bibs and burp cloths": "6.4", "cloths": "4.2", "baby bibs": "7.6", "burp": "4.2", "burp cloths": "7.6", "baby": "5.5", "bibs": "4.2"}, "department_id": 41}
