{"department_text": "Value of the Day", "nr_products": 1561, "level": -3, "url": "http://www.walmart.com/browse/apparel/womens-shoes/5438_1045804_1045806_163925/?_refineresult=true&povid=cat133162-env200971-moduleA110712-lLinkLHNShoes_Accessories4WomensShoes", "text": "Women's Shoes", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Women\u2019s Shoes", "parent_url": "http://www.walmart.com/cp/133162?povid=cat1086581-env99999-moduleA041313-lLinkLHNShopMoreApparelWomens", "keyword_count": {"women s shoes": 3, "shoes": 9, "women": 10}, "description_wc": 226, "description_text": "From women\u2019s boots and cowboy boots to women's sandals and slippers, the women's shoes and women\u2019s clothes you are looking for are available at Walmart. Walmart\u2019s extensive selection of shoes includes women\u2019s dress shoes, such as pumps, heels, flats and boots. Sneakers for walking and jogging, as well as toning sneakers, jazz shoes and shoes that complement women\u2019s sportswear , are also at Walmart. When the weather is rainy, Walmart offers a selection of print and graphic rain boots, as well as women\u2019s outerwear , such as rain coats and jackets. Whether the occasion calls for athletic sneakers or high heels, Walmart has got you covered. Walmart carries a large array of casual and professional shoes for your daily needs. We have shoes for inclement weather, as well, with women's rain boots and much more. You'll find Every Day Low Prices on women's shoes at Walmart.com, where you can filter your search by brand, color, price, consumer rating, shipping and special offers.\u00a0Be sure to look for money-saving shipping offers and free store pickup for\u00a0many products when you shop at Walmart.com. Whether you\u2019re looking for footwear to make a statement, match weekend attire or wear to work, Walmart's selection of women\u2019s shoes has what you need. Save money. Live better.", "parent_text": "Women's", "keyword_density": {"women s shoes": "4.0", "shoes": "4.0", "women": "4.5"}, "department_id": 41}
{"department_text": "Value of the Day", "level": -3, "url": "http://www.walmart.com/cp/133284?povid=cat133162-env200971-moduleA052312-lLinkLHNSpecialtySizes1Maternity", "text": "Maternity", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Maternity Clothes", "parent_url": "http://www.walmart.com/cp/133162?povid=cat1086581-env99999-moduleA041313-lLinkLHNShopMoreApparelWomens", "keyword_count": {"maternity clothes": 4, "maternity": 13}, "description_wc": 212, "description_text": "Find all the maternity clothes and accessories you want at Walmart. Our terrific selection of maternity clothing includes T-shirts, maternity jeans, pants, knit tops, shirts, coats, active wear, lounge wear, sleepwear, intimates and more. Plus, you can shop for pregnancy and prenatal accessories, including pregnancy pillows, nursing bras, belly bands and other maternity wear needs. At Walmart.com, you can browse for maternity dresses and skirts, maternity tops and maternity swimwear. Get wear-to-work looks at every day low prices, as well as around-the-house maternity clothes. We have just-in styles for moms-to-be from tops and bottoms to dresses, too. Be sure to take a look at our value bundles featuring two-packs, outfits, diaper bag sets, crib mattress/maternity pillow combinations, and nursing tank/nursing pillow combination. Naturally, maternity clothes aren't the only things you'll find here for moms and their babies. We also offer an unbelievable selection of other baby products , including double strollers , disposable diapers , baby blankets and infant car seats , all at super, money-saving prices. So when you're looking for maternity wear, be sure to see the maternity clothing selection we offer at Walmart, where all our maternity clothes are priced to save you money.", "parent_text": "Women's", "keyword_density": {"maternity clothes": "3.8", "maternity": "6.2"}, "department