color, sports league, character, price and customer rating. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. From backpacks and kids' bags to handbags and luggage, you'll find what you're looking for at Walmart. Save money. Live better.", "parent_text": "Women's", "keyword_density": {"bags": "6.9"}, "department_id": 41}
