{"department_text": "Value of the Day", "nr_products": 467, "level": -3, "url": "http://www.walmart.com/browse/office/school-supplies/3944_546952_1086045/?_refineresult=true&_refineresult=true+&facet=free_pickup_options%3AAvailable+Today&povid=cat1086045-env449867-moduleA082813-lLinkLHNSpecialOffersPickUpInStoresToday", "text": "Pick up in Stores Today", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "School Supplies", "parent_url": "http://www.walmart.com/cp/1086045?povid=cat1086304-env455419-moduleA111412-lLinkLHNRelatedCategories1SchoolSupplies", "keyword_count": {"supplies": 9, "school": 13, "school supplies": 5}, "description_wc": 241, "description_text": "From a wide selection of kid's back-to-school supplies and school calculators to teaching and classroom supplies , the school supplies you are looking for are available at Walmart. Choose from a variety of school binders, writing supplies, arts and craft supplies, construction paper, school notebooks , lined paper or backpacks at Walmart. You'll find a wide selection of items for back-to-school organization . Our extensive array of school supplies and products includes binders, textbooks, pre-school supplies and learning tools and activities. Whether you're shopping for Crayola markers, Bic Wite-Out, Paper Mate pencils, Elmer's School Glue, Pacon sketch pads, RoseArt alphabet stampers, an Advantus globe or X-ACTO sharpeners, Walmart has you covered. You'll find what you want, including Swingline staplers, Scotch transparent tape, a Texas Instruments scientific calculator or mathematics and biology school textbooks . Walmart also stocks a variety of dictionaries and thesauruses, various study aids and index cards for your convenience. Look for Every Day Low Prices on school-supply value bundles and sort school supplies online by brand, price, customer preference or special offers, such as rollbacks an