{"department_text": "Value of the Day", "nr_products": 4187, "level": -1, "url": "http://www.walmart.com/cp/582507", "text": "Reference", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Reference Books", "parent_url": "http://www.walmart.com/cp/Books/3920?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Books", "keyword_count": {"books": 10, "reference": 6, "reference books": 4}, "description_wc": 255, "description_text": "Stay in the know while saving on a wide variety of reference books and reference guides at Walmart. Whether you need encyclopedias for the big report, how-to handbooks or quotation books to spice up your writing, Walmart has a wide selection at our Every Day Low Prices. At Walmart, you'll save big on reference books large and small. If you're looking for just the right word or map location, choose from hundreds of dictionaries , atlases and almanacs , including classic texts like The Merriam-Webster Dictionary and The World Almanac. You'll also find dictionaries in languages like Chinese, French, Italian, Spanish, German, and Portuguese to assist you with your next test or conversation practice. For new knowledge on a variety of subjects, turn the page to handbooks and manual books including How to Survive the End of the World, The Guinness Book of World Records and Ripley's Believe It or Not! Map books and encyclopedias from trusted names like Oxford University and Rand McNally expand your horizons, while quotation books offer words of wit and wisdom from famous people in politics, literature and popular culture. It's always easy to shop for reference books at Walmart.com by brand, price range, customer rating or best sellers. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. With a broad selection of reference books and reference guides at your fingertips, Walmart makes it easy to save money and live better.", "parent_text": "Books", "keyword_density": {"books": "4.0", "reference books": "3.2", "reference": "2.4"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 3523, "level": -1, "url": "http://www.walmart.com/browse/books/3920?_refineresult=true&ic=48_0&path=0%3A3920&povid=cat3920-env204029-moduleA092911-lLinkLHNShopWhatsNew1NewReleases&facet=new_releases%3ASee+All", "text": "New Releases", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Walmart has the books you want for less", "parent_url": "http://www.walmart.com/cp/Books/3920?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Books", "keyword_count": {"walmart": 1, "books": 13, "less": 2}, "description_wc": 220, "description_text": "Everyone loves discovering great books, and everyone loves saving money. Walmart.com makes it easy to do both, with a huge selection of popular books at unbeatable prices. No matter what books you're looking for, you can get them right here on our site for a lot less than you'd pay at another bookstore. In addition to the top New York Times bestsellers everyone's talking about, you'll find literature and fiction , fascinating biographies, mystery novels, sci-fi, romance novels, children's books , reference books, textbooks, and much, much more. You can also read helpful book reviews posted by readers just like you. Easily browse books by genre to choose from topics like history, romance, comedy, religion, politics, cooking, true crime and anything else you can imagine, all at great savings. We even offer a vast library of textbooks in virtually every subject, including prep materials for the SAT, GRE and GMAT tests\u2014probably for a whole lot less than the campus bookstore. Love audiobooks? We've got hundreds of audiobooks to enjoy, from new fiction bestsellers to classic literature and everything in between. Tons of excellent gift ideas, too, for both kids and adults. Plus, our affordable shipping options make it even easier to save on quality books for all the readers in your life.", "parent_text": "Books", "keyword_density": {"walmart": "0.5", "books": "6.0", "less": "0.9"}, "department_id": 41}
