{"department_text": "Value of the Day", "nr_products": 228, "level": -1, "url": "http://www.walmart.com/browse/electronics/3944/?_refineresult=true&facet=special_offers%3AClearance&ic=48_0&povid=cat3944-env435594-moduleA112012-lLinkLHNSpecialOffers8Clearance", "text": "Clearance", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Save on cutting-edge electronics. We offer electronics products for less.", "parent_url": "http://www.walmart.com/cp/Electronics/3944?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Electronics", "keyword_count": {"cutting edge": 1, "electronics": 7, "electronics products": 1, "products": 5, "less": 2}, "description_wc": 216, "description_text": "When it comes to saving money on electronics, there's no better place to shop for your electronic products than Walmart.com. Looking for a specific electronics item, like a laptop with a camera? We've got it here for less. Tired of running around town to the local TV sales, searching for the best deal? No worries. We have all the best brands and models here at everyday low prices you'll love. Plus much, much more. Check out our enormous selection of high-quality, cutting-edge electronic products such as our top-brand laptops . Want a new Samsung laptop ? Look no further. Perhaps you're looking for something even bigger, like a brilliant new Samsung TV . We've got that, too. For less. We believe the wonders of modern electronics should be accessible to everyone, so we keep our prices down. We think everyone deserves to enjoy the latest electronic products. That's why you won't find any overpriced electronic products here, unlike some other high-end electronics stores we could mention. Instead, we work hard to provide the best prices anywhere on all the electronics that are making the headlines and earning spots on people's wishlists. Shop our Electronics department for unbeatable savings on the electronics products you want most.", "parent_text": "Electronics", "keyword_density": {"less": "0.9", "electronics": "3.3", "electronics products": "0.9", "products": "2.3", "cutting edge": "0.9"}, "department_id": 41}
