ot sponsor, recommend or endorse any third party, product, service or information provided on this site.", "parent_text": "Automotive & Tires Services", "department_text": "Value of the Day", "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 159, "level": -2, "url": "http://www.walmart.com/browse/electronics/auto-electronics/garmin/3944_3947/YnJhbmQ6R2FybWlu?_refineresult=true&povid=cat3947-env458358-moduleA031313-lLinkLHNFeaturedBrands3Garmin", "text": "Garmin", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Car Audio and Car Electronics", "parent_url": "http://www.walmart.com/cp/3947?povid=cat91083-env507934-moduleA050813-lLinkLHNRelatedCategories1AutoElectronics", "keyword_count": {"car": 16, "electronics": 4, "car electronics": 2, "car audio": 3}, "description_wc": 270, "description_text": "From a wide selection of in-dash CD players and car stereos to radar detectors and satellite radios, the car audio and electronics you're looking for are available at Walmart. Choose from a variety of car DVD players , amplifiers, car GPS units, CB radios, power inverters and car speakers at Walmart. You'll also find the items you need for car audio maintenance and care. Our extensive array of car accessories includes subwoofers, car MP3 and sound systems. You can also save a bundle on auto accessories \u2014 take your choice of car mats, visor organizers, trailer hitches, license plate frames and much more. Whether you're shopping for a Magellan Roadmate GPS, Tom Tom START vehicle GPS, a Boss receiver with flip-out screen or a Cobra radar detector, Walmart has you covered. We also offer a variety of other car electronics including a Kenwood receiver with speaker bundle, a Sumas media receiver with Bluetooth or a Philips dual-screen portable DVD player with game controllers and gaming disc. Walmart also stocks a variety car power inverters, car amplifiers and amplifier installation kits for your convenience. Search for auto accessories and car electronics at Walmart.com by brand, price, category, customer rating or special offers, such as rollbacks and clearance. Take advantage of our electronics trade-in program, where you can receive an eGift Card to spend at Walmart.com. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. You can find the car audio equipment and accessories to match your needs at Walmart. Save money. Live better.", "parent_text": "Auto Electronics", "keyword_density": {"car": "5.9", "electronics": "1.5", "car electronics": "1.5", "car audio": "2.2"}, "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 6, "level": -2, "url": "http://www.walmart.com/browse/tv-video/tvs/white/3944_1060825_447913?_refineresult=true&ic=32_0&path=0%3A3944&povid=cat1079744-env448906-moduleA051012-lLinkLHN2ShopColorByCategoryTVs&facet=color%3AOrange%7C%7Ccolor%3ABlue%7C%7Ccolor%3ABrown%7C%7Ccolor%3APink%7C%7Ccolor%3AGrey%7C%7Ccolor%3ARed%7C%7Ccolor%3AWhite", "text": "TVs", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "TV Stands", "parent_url": "http://www.walmart.com/cp/1079744?povid=cat3944-env435594-moduleA112012-lLinkLHNRelatedCategories1ColorElectronics", "keyword_count": {"tv": 19, "tv stands": 16}, "description_wc": 263, "description_text": "From corner TV stands and large plasma TV stands for a family room to traditional wood TV stands for a bedroom, the TV stands you are looking for are all at Walmart. You can choose from some of the most familiar names in home furnishings and home decor when you browse through our selection of TV stands. From Bush and Mainstays to Sauder and South Shore, the top home furniture brands are available for less at Walmart. You can select from contemporary and flat-panel TV stands and classic TV stands that can work with any decor. You'll find mounted TV stands and swivel TV stands to suit your unique space needs, as well as oak TV stands that offer a more traditional look. Choose from an array of sizes, including 55\" TV stands and 60\" TV stands for large TVs. No matter their size, many TV stands include convenient storage space for your DVDs or other items. Walmart.com makes it easy to shop for TV stands. You can search by the size of the screen, the materials you prefer and the brand. Choose from LCD TV stands based on customer ratings and color, or sort through the selection of plasma TV stands by special offers. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. Whether you want a black TV stand or a flat-screen TV stand, you'll find an array of options at Walmart. With Every Day Low Prices, Walmart helps you save money and live better.", "parent_text": "Color Electronics Shop", "keyword_density": {"tv": "7.2", "tv stands": "12.2"}, "department_id": 41}
