{"department_text": "Value of the Day", "nr_products": 4517, "level": -2, "url": "http://www.walmart.com/browse/electronics/computers/white/3944_3951?catNavId=1079744&ic=48_0&povid=cat1079744-env448906-moduleA041712-lLinkLHN3ShopColorByCategoryComputers&facet=color%3AOrange%7C%7Ccolor%3ABlue%7C%7Ccolor%3ABrown%7C%7Ccolor%3APink%7C%7Ccolor%3AGrey%7C%7Ccolor%3ARed%7C%7Ccolor%3ASilver%7C%7Ccolor%3AGreen%7C%7Ccolor%3APurple%7C%7Ccolor%3AWhite", "text": "Computers", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Save on Computers at Walmart", "parent_url": "http://www.walmart.com/cp/1079744?povid=cat3944-env435594-moduleA112012-lLinkLHNRelatedCategories1ColorElectronics", "keyword_count": {"save": 3, "computers": 2, "walmart": 7}, "description_wc": 257, "description_text": "Upgrade to a new laptop , netbook , tablet PC , Ultrabook or desktop computer and save at Walmart. You can browse for laptops, Ultrabooks, netbooks, tablet PCs, iPads and desktops by computer brand, such as Acer, Apple, ASUS, Dell, HP, Sony, Samsung, Toshiba and more. You also can shop for your next computer by price range, customer ratings, processor brand, system RAM, hard drive size, color or special offers. After you choose a computer, you can enhance it with printers, scanners, hard drives, routers, networking gear, keyboards, mice, protective cases and software from Walmart.com. Be sure to take a look at our selection of new Ultrabooks, inspired by Intel. These ultra-sleek laptops are less than an inch thick and feature high-performance Core i3 or i5 processors. They are all designed to be ultra-responsive to wake up in a flash and offer the advantage of long battery life, too. You can choose from Ultrabooks by Acer, HP, Samsung and Toshiba at Walmart.com. And stay tuned for the new Windows 8 operating system coming this fall. Save even more at Walmart.com on laptop and desktop value bundles that feature computers bundled with your choice of printers, routers carrying cases or other accessories. You'll find additional savings on refurbished laptops and desktops, as well. At Walmart.com, you can take advantage of free Site to Store shipping on most computers. And some models are also available for same-day pickup in Walmart stores. So get your new computer from Walmart to save money and live better.", "parent_text": "Color Electronics Shop", "keyword_density": {"save": "1.2", "walmart": "2.8", "computers": "0.8"}, "department_id": 41}
