{"department_text": "Value of the Day", "level": -2, "url": "http://www.walmart.com/cp/Oil-Fluids-Lubricants/1104294?povid=cat1087266-env515638-moduleA051713-lLinkLHNRelatedCategories5OilFluids_Lubricants", "text": "Oil, Fluids & Lubricants", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Motor Oil and Lube Change", "parent_url": "http://www.walmart.com/cp/1087266?povid=cat91083-env507934-moduleA080913-lLinkLHNInStoreServices1AutomotiveTiresServices", "keyword_count": {"oil": 19, "motor oil": 10, "lube": 5, "motor oil and lube change": 1, "lube change": 2, "change": 7}, "description_wc": 237, "description_text": "Motor oil and lube change. Time for a motor oil change? We can help. Just want a great price on motor oil and an oil filter so you can do your own oil change? We can help with that, too. Walmart offers oil change and lube change service at our in-store Car Care Centers, or you can save on the motor oil and automotive supplies you need right here at Walmart.com. Whether you need synthetic motor oil or standard motor oil, you'll find what you're looking for at a terrific low price. We have all the top motor oil brands, like Pennzoil and Valvoline, in a full range of oil weights and sizes to suit your needs. Plus, you can get everything else for your car here, like spark plugs, air filters, oil filters, transmission fluid and more. Motor oil and auto lube aren't the only automotive items we offer with great prices, of course. In addition to automotive lube and motor oil, you'll save on all your car's fluids and lubricants , spark plugs , oil filters, air filters and other automotive supplies. So come see us at our oil change service or pick up motor oil here to do the job yourself. Either way, your car will love you for it, and so will your budget. Oil change service, auto lube and automotive supplies cost less here at Walmart.", "parent_text": "Automotive & Tires Services", "keyword_density": {"oil": "8.1", "motor oil": "8.5", "lube": "2.1", "motor oil and lube change": "2.1", "lube change": "1.7", "change": "3.0"}, "department_id": 41}
{"level": -1, "url": "http://wireless.walmart.com/template/simpleautocontent.aspx?pageid=12468", "text": "Bonus $40 eGift Card with select Samsung Galaxy Smartphones", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "parent_url": "http://www.walmart.com/cp/Electronics/3944?povid=cat1058864-env172199-moduleLHN-lLink_Dept-Electronics", "description_wc": 148, "description_text": "*eGift Card offer valid for new lines of service or qualified upgrades with a 2-yr service agreement and data plan purchased on wireless.walmart.com between 12:01 AM EST 09/08/2013 and 11:59 PM PST 10/5/2013, while supplies last. Eligible devices include the Samsung Galaxy S III, Samsung Galaxy S 4, Samsung Galaxy S 4 Active and Samsung Galaxy Note 2. Excludes business and government accounts. To be eligible, each line of service must be active and in good standing as of 11/05/2013. eGift Card(s) will be processed and emailed to the qualified subscriber by 11/12/2013. Limit of four eGift Cards per order. eGift Cards are valid for future use only and not valid on current purchase. Subject to credit approval and may require a deposit. Activation Fee and Early Termination Fees apply. No redemption form or rebatesubmission required.", "parent_text": "Electronics", "department_text": "Value of the Day", "department_id": 41}
{"department_text": "Value of the Day", "nr_products": 6797, "level": -2, "url": "http://www.walmart.com/browse/automotive/tools-amp;-equipment/91083_1045959_1074767?catNavId=91083&ic=48_0&refineresult=true&povid=cat1087266-env515638-moduleA051713-lLinkLHNRelatedCategories7Tool_Equipment", "text": "Tools & Equipment", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Automotive Tools and Automotive Equipment", "parent_url": "http://www.walmart.com/cp/1087266?povid=cat91083-env507934-moduleA080913-lLinkLHNInStoreServices1AutomotiveTiresServices", "keyword_count": {"automotive tools and automotive equipment": 4, "tools": 6, "automotive": 9}, "description_wc": 229, "description_text": "When you're looking for automotive tools and automotive equipment to go with your vehicle, Walmart has you covered with a huge selection of items from today\u2019s top brands. For a selection of automotive tools and automotive equipment ranging from auto batteries and auto lifts and more, come to Walmart. Pick up one of our automotive diagnostic tools or battery maintainers today to help keep your car running smooth and safe. Be sure to browse our other auto and tires products to find more items that may be right for you. Whether you're looking for Schumacher battery chargers or Stanley jump starters, we've got the tools to help you get the job done right. At Walmart, you can shop our selection of auto jacks, auto paints, auto ramps and more, all at Every Day Low Prices. We also carry a large array of auto batteries and auto lighting products to help maintain your vehicle. It's easy to shop for automotive tools and automotive equipment at Walmart.com. You can search for the products you want by type, price, customer rating, brand, and more. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. With our wide selection of automotive\u00a0tools and automotive equipment, we're here to help meet your needs. Save money. Live better.", "parent_text": "Automotive & Tires Services", "keyword_density": {"automotive tools and automotive equipment": "8.7", "tools": "2.6", "automotive": "3.9"}, "department_id": 41}
