{"department_text": "Value of the Day", "nr_products": 125, "level": -3, "url": "http://www.walmart.com/browse/replacement-parts/auto-batteries/91083_1045959_1074765_1072085?povid=cat1104292-env514412-moduleA042613-lLinkLHN_Categories1_AutoBatteries", "text": "Auto Batteries", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Auto Batteries", "parent_url": "http://www.walmart.com/cp/Auto-Batteries/1104292?povid=cat1087266-env515638-moduleA051713-lLinkLHNRelatedCategories1AutoBatteries", "keyword_count": {"auto": 13, "batteries": 6, "auto batteries": 3}, "description_wc": 240, "description_text": "When it's time for a new car battery or truck battery, you can get the right battery for your vehicle at an Every Day Low Price from Walmart. You can find popular EverStart, EverStart Maxx and Champion Pro automotive batteries at Walmart stores. These dependable auto batteries are backed by substantial replacement warranties for your peace of mind. You can use our automotive battery finder to identify the right automotive battery for your vehicle. If you're not sure that you need a new battery, Walmart Auto Centers offer free battery testing along with free recycling of any lead-acid battery. And when you buy a new car battery or truck battery from us, Walmart Auto Care Centers will install it and charge it for you at no extra cost. In addition to car batteries and truck batteries at Walmart stores, you can shop for vehicle tires , tire accessories, vehicle fluids and lubricants, plus car care and maintenance products right here at Walmart.com. Of course, you'll also find auto electronics, exterior accessories for your vehicle, interior accessories, auto care and cleaning products plus automotive tools and equipment at Walmart.While auto batteries need to be purchased at a Walmart store, many other automotive products qualify for free in-store pickup at your nearby Walmart store when you use Site to Store online ordering. Shop for auto batteries and automotive products at Walmart to save money and live better.", "parent_text": "Auto Batteries", "keyword_density": {"auto": "5.4", "batteries": "2.5", "auto batteries": "2.5"}, "department_id": 41}
