{"department_text": "Value of the Day", "level": -3, "url": "http://www.walmart.com/cp/1104294?povid=cat1104292-env514412-moduleA042613-lLinkLHN_Related6_OilFluidsLubricants", "text": "Oil, Fluids & Lubricants", "department_url": "http://www.walmart.com/cp/Value-of-the-Day/1058864?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_ValueoftheDay", "description_title": "Motor Oil and Lube Change", "parent_url": "http://www.walmart.com/cp/Auto-Batteries/1104292?povid=cat1087266-env515638-moduleA051713-lLinkLHNRelatedCategories1AutoBatteries", "keyword_count": {"oil": 19, "motor oil": 10, "lube": 5, "motor oil and lube change": 1, "lube change": 2, "change": 7}, "description_wc": 237, "description_text": "Motor oil and lube change. Time for a motor oil change? We can help. Just want a great price on motor oil and an oil filter so you can do your own oil change? We can help with that, too. Walmart offers oil change and lube change service at our in-store Car Care Centers, or you can save on the motor oil and automotive supplies you need right here at Walmart.com. Whether you need synthetic motor oil or standard motor oil, you'll find what you're looking for at a terrific low price. We have all the top motor oil brands, like Pennzoil and Valvoline, in a full range of oil weights and sizes to suit your needs. Plus, you can get everything else for your car here, like spark plugs, air filters, oil filters, transmission fluid and more. Motor oil and auto lube aren't the only automotive items we offer with great prices, of course. In addition to automotive lube and motor oil, you'll save on all your car's fluids and lubricants , spark plugs , oil filters, air filters and other automotive supplies. So come see us at our oil change service or pick up motor oil here to do the job yourself. Either way, your car will love you for it, and so will your budget. Oil change service, auto lube and automotive supplies cost less here at Walmart.", "parent_text": "Auto Batteries", "keyword_density": {"oil": "8.1", "motor oil": "8.5", "lube": "2.1", "motor oil and lube change": "2.1", "lube change": "1.7", "change": "3.0"}, "department_id": 41}
