{"department_text": "Video Games", "level": 0, "url": "http://www.walmart.com/cp/1077504?povid=cat2636-env428896-moduleA071013-lLinkLHNTopVideoGames2PCGaming", "text": "PC Gaming", "department_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "description_title": "PC Gaming", "parent_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "keyword_count": {"pc": 11, "gaming": 5, "pc gaming": 3}, "description_wc": 198, "description_text": "With best-selling selections in PC gaming, you'll be immersed in a world of adventure and action-packed fun with the PC games available at Walmart. Choose from popular PC games, including the hottest new releases. You will also enjoy games from our featured genres, including PC adventure games and more. From social games and PC strategy games to PC racing games and PC shooting games , the PC games you are looking for can be found at Walmart. We also carry a large assortment of PC gaming accessories . We offer gaming mice and gaming keyboards from brands like Kensington and Steel Series, as well as an array of controllers from brands like Saitek. At Walmart.com, it's a breeze to shop for PC gaming products by genre, console, motion controller, game collections, bundles, ESRB rating, brand, price, customer rating, special offers, coming soon and new releases. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. When you're looking for PC games and accessories, you can find what you need and more at Every Day Low Prices from Walmart. Save money. Live better.", "parent_text": "Video Games", "keyword_density": {"pc": "5.6", "pc gaming": "3.1", "gaming": "2.6"}, "department_id": 42}
{"department_text": "Video Games", "level": 0, "url": "http://www.walmart.com/cp/1102672?povid=cat2636-env428896-moduleA030213-lLinkLHNConsoles2PlayStation4", "text": "PlayStation 4", "department_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "description_title": "Sony PlayStation 4 is\u2026", "parent_url": "http://www.walmart.com/cp/Video-Games/2636?povid=cat121828-env999999-moduleA072012-lLinkGNAV5_VideoGames", "keyword_count": {"playstation": 12, "playstation 4": 8, "sony playstation": 4, "4": 13, "sony": 5, "sony playstation 4": 3}, "description_wc": 419, "description_text": "Infinite gaming, limitless worlds, imaginative stories, all just for you. The new Sony PlayStation 4 launches a new era in video gaming where gameplay is more intuitive and on-screen environments are endlessly expanding. Working with some of the most creative minds in the industry, PlayStation 4 delivers breathtaking and unique gaming experiences. Simple, elegant design, inside and out, means seamless, engaging and immersive gameplay into worlds never before imagined. Gaming wherever you are and on whatever device. Using cloud storage, video games for the new PlayStation 4, as well as games from older PlayStation consoles ,can be easily and quickly downloaded, and, using Sony's Remote Play, can be accessed across multiple devices including tablet PCs, smartphones and the Sony PlayStation Vita. Social sharing made easy. On the new PS4, social gaming is easy and encouraged as essential to gaming on the new PlayStation 4. The new DualShock 4 controller features a Share button that allows you quick and easy access to your online network friends on the social media sites you already use. Share gaming highlights, high scores, game-changing plays, or reach out to friends for a helping hand. Simply push the share button on the new DualShock 4 controller and you're instantly connected. Get gaming faster. Using the new Suspend Mode, the power button delivers instant-pause and instant-on so you can start gaming right where you left off with no delay. The new PlayStation 4 features 8GB memory, a local hard drive and x86 CPU, alongside a secondary custom chip. This custom chip lets you start playing games while downloading is still in process. No more waiting, way more playing. It's all about you. The DualShock 4 controller features a six-axis sensor, a top-side touchpad and a light bar that uses different colors to interact with the Eye, a 3D camera that adds another dimension to your gameplay by supporting the PlayStation Move motion controller. This newly developed PlayStation Camera for PlayStation 4 incorporates two high-sensitive cameras that have wide-angle lenses with 85-degree diagonal angle views that can recognize the depth of space precisely. The Sony PlayStation 4 makes the gamer the center of the game. Not just gaming, entertainment. Beyond gaming, PS4 continues in the footsteps of its predecessors with integrated apps that allow you to access the Internet, stream your favorite movies, videos and music including VUDU . Simple, immediate, social, integrated and personal. The new Sony PlayStation 4: Push the Boundaries of Play.", "parent_text": "Video Games", "keyword_density": {"playstation": "2.9", "playstation 4": "3.8", "sony playstation": "1.9", "4": "3.1", "sony": "1.2", "sony playstation 4": "2.2"}, "department_id": 42}
