{"department_text": "Health", "level": 1, "url": "http://www.walmart.com/cp/976760?povid=cat121828-env999999-moduleA072012-lLinkGNAV3_Health", "text": "Health", "department_url": "http://www.walmart.com/cp/976760?povid=cat121828-env999999-moduleA072012-lLinkGNAV3_Health", "description_title": "Save on Health Products at Walmart", "keyword_count": {"walmart": 5, "health": 8, "products": 5, "save": 3, "health products": 2, "health products at walmart": 1}, "description_wc": 242, "description_text": "Save money and live better with health products from Walmart. We have smart buys to keep you going strong when it comes to vitamins . Our selection features products for bone and joint health, a healthy heart, and immunity, as well as herbals, minerals, multivitamins, single vitamins and supplements. Our great brands for a healthy lifestyle include Centrum, Equate, Nature Made, One a Day, Spring Valley and many more. You can amp up or slim down to get fit with top brands and big savings from our diet and nutrition selection. It features diet foods, weight loss supplements, energy nutrition, sports nutrition, and even scales. Shop for mobility aids, diabetic supplies, daily living aids and more home health care at Walmart.com. Here you'll find useful items that offer convenience and comfort for a variety of health conditions. Our medicine cabinet enables you to save money on the relief you need. Browse through products for pain relief, ear care, eye care, first aid and sexual wellness, in addition to analgesics, allergy medicines, cold remedies, and flu treatments. It's easy to shop by price range, customer rating, or best sellers to find just the right health products at Walmart.com. Many products qualify for Home Free shipping with your $45 order of eligible items or free Site to Store shipping for pickup at your closest Walmart store. So shop for all of your health needs at Walmart to save money and live better.", "keyword_density": {"walmart": "2.1", "products": "2.1", "health": "3.3", "save": "1.2", "health products": "1.7", "health products at walmart": "1.7"}, "department_id": 23}
{"department_text": "Furniture", "level": 1, "url": "http://www.walmart.com/cp/Furniture/103150?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_Furniture", "text": "Furniture", "department_url": "http://www.walmart.com/cp/Furniture/103150?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_Furniture", "description_title": "Furniture", "keyword_count": {"furniture": 20}, "description_wc": 250, "description_text": "Furniture costs less at Walmart. Let us be your source for fashionable, functional and comfortable furniture at fantastic low prices. Whether you're shopping for new bedroom furniture or patio furniture, we offer furniture for every room in your home, not to mention outdoor furniture. What kind of furniture are you looking for? Discover all the furniture options you need, including beds, dining tables, office chairs, patio sets and entertainment centers from brands like Better Homes and Gardens, Canopy and Hometrends. It's all really easy to find, too, when you can shop furniture by categories, such as baby furniture, patio furniture , home office furniture , living room furniture and bedroom furniture. You can even browse furniture by price range or your favorite manufacturer, so finding exactly the furniture you want to complete your home furnishings is just a few clicks away. Maybe it's time for a complete furniture upgrade; time to refresh that worn-out dining table or replace that sagging sofa in the living room with something more comfortable and attractive. And what about that tired mattress you've been tossing and turning on for so many years? Wouldn't it be nice to finally get the good night's sleep you need? You'll find the furniture you've been dreaming about right here, from mattresses to dining tables and so much more. You'll save money on furniture at Walmart, so get all the furniture you want right here and start living better now.", "keyword_density": {"furniture": "8.1"}, "department_id": 19}
{"department_text": "Gift & Registry", "level": 1, "url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "text": "Gift & Registry", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "For gifts, gift cards or a gift registry, Walmart.com is your #1 gifting resource.", "keyword_count": {"gift cards": 1, "gift": 20, "gifting": 1, "gifts": 7, "walmartcom": 3, "registry": 3, "gift registry": 1}, "description_wc": 201, "description_text": "Whether you're shopping for a birthday present, graduation gift, wedding gift or Christmas present, you'll find perfect gifts and gift cards for every occasion at Walmart.com. For wedding presents and baby gifts, search our Wedding Registry or Baby Registry to locate your happy couple or glowing new parents, or create a new gift registry of your own. You can also create a Wish List of presents you'd love to receive for any gifting occasion. For other gift ideas, search our Gift Shop for tons of suggestions at unbeatable prices, including personalized gifts that say you really care. And of course, a Walmart Gift Card is always a perfect choice. With a Walmart Gift Card, your lucky recipient can choose from virtually millions of gifts in categories like baby , jewelry or electronics . See our collection of gift card designs for birthday gifts, graduation presents, Christmas presents, wedding gifts, baby gifts and lots of other important gift-giving events. Each gift card can be preloaded with the amount you want to give, and redeemed at any Walmart store or here on Walmart.com. No matter what the occasion, Walmart.com is the perfect place to save on the perfect gift.", "keyword_density": {"gift cards": "1.0", "gift": "10.1", "gifting": "0.5", "gifts": "3.5", "walmartcom": "1.5", "registry": "1.5", "gift registry": "1.0"}, "department_id": 20}
{"department_text": "Home Improvement", "level": 1, "url": "http://www.walmart.com/cp/Home-Improvement/1072864?povid=cat121828-env999999-moduleA072012-lLinkGNAV3_HomeImprovement_HomeImprovement", "text": "Home Improvement", "department_url": "http://www.walmart.com/cp/Home-Improvement/1072864?povid=cat121828-env999999-moduleA072012-lLinkGNAV3_HomeImprovement_HomeImprovement", "description_title": "Walmart.com has the tools to make home improvement easy.", "keyword_count": {"walmartcom": 2, "make": 1, "tools": 6, "home improvement": 5}, "description_wc": 240, "description_text": "Tired of looking at peeling paint, scuffed old flooring or decor that just feels out of date? Then shop our Home Improvement department for all the tools , paint, hardware and supplies to fix it. Whether you need the tools for a complex electrical or plumbing job inside the walls, or just some paint for a touch-up in the den, you'll find home improvement tools and supplies for less at Walmart.com. If you're looking to liven up your outdoor spaces a bit, you can save big on gardening essentials ranging from planters to fertilizers to irrigation systems to lighting. Of course, you'll also find heavy-duty hardware and power tools such as lawnmowers, chainsaws, leaf blowers and more. For indoor home improvements, check out our beautiful flooring options, dependable plumbing fixtures, state-of-the-art lighting solutions and broad spectrum of paint and decor for every taste. Why pay more for an electrician or plumber when you can save on all the electrical and plumbing tools and supplies you need to do the job yourself? Nothing spruces up a home improvement job quite like a fresh coat of paint , so we've got hundreds of paint choices to suit every scheme and palette, not to mention all the tools you need to paint right the first time. When it comes to home improvement, no one makes it easier to save time and money than Walmart.com.", "keyword_density": {"walmartcom": "0.8", "make": "0.4", "tools": "2.5", "home improvement": "4.2"}, "department_id": 25}
{"department_text": "Halloween", "nr_products": 104, "level": 0, "url": "http://www.walmart.com/browse/party-occasions/halloween-party-supplies/2637_615760_1073684_1044002/?_refineresult=true&catNavId=615760&povid=cat615760-env999999-moduleA090713-lLinkLHNHalloweenDecor_Supplies_HalloweenPartySupplies", "text": "Halloween Party Supplies", "department_url": "http://www.walmart.com/cp/615760?povid=cat121828-env999999-moduleA82713-lLinkGNAV1_Campaign_Halloween", "description_title": "Halloween party supplies.", "parent_url": "http://www.walmart.com/cp/615760?povid=cat121828-env999999-moduleA82713-lLinkGNAV1_Campaign_Halloween", "keyword_count": {"supplies": 10, "halloween party supplies": 9, "halloween": 22, "halloween party": 14}, "description_wc": 210, "description_text": "Halloween party supplies. Get Halloween party supplies for less at Walmart. We have the best Halloween party supplies at terrific prices that'll make you want to celebrate. For a complete selection of Halloween party supplies including Halloween party games, look no further than Walmart. Need Halloween party supplies and Halloween party games for the ghouls and goblins in your neighborhood this year? Then be certain to stock up on Halloween party supplies like Halloween paper plates, Halloween cups, Halloween games, pumpkin decor and anything else you might need for a fiendishly fun time. Halloween party supplies cost less at Walmart, so check out our collection of Halloween party decorations, Halloween party games and Halloween party decor, all at terrific low prices. We've collected all your Halloween party supplies right here in one easy online shopping destination. Of course, Halloween party supplies aren't all you'll find for Halloween at Walmart. Search our entire selection of Halloween decorations to create just the right fun and spooky mood at your next Halloween bash. When it comes to costumes, our impressive wardrobe of adult Halloween costumes runs the gamut from sweet to silly to scary. See our complete selection of Halloween supplies at great prices designed to save you money.", "parent_text": "Halloween", "keyword_density": {"supplies": "4.8", "halloween party supplies": "12.9", "halloween": "10.5", "halloween party": "13.3"}, "department_id": 1}
{"department_text": "Books", "level": 1, "url": "http://www.walmart.com/cp/Books/3920?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_Books", "text": "Books", "department_url": "http://www.walmart.com/cp/Books/3920?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_Books", "description_title": "Walmart has the books you want for less", "keyword_count": {"walmart": 1, "books": 13, "less": 2}, "description_wc": 220, "description_text": "Everyone loves discovering great books, and everyone loves saving money. Walmart.com makes it easy to do both, with a huge selection of popular books at unbeatable prices. No matter what books you're looking for, you can get them right here on our site for a lot less than you'd pay at another bookstore. In addition to the top New York Times bestsellers everyone's talking about, you'll find literature and fiction , fascinating biographies, mystery novels, sci-fi, romance novels, children's books , reference books, textbooks, and much, much more. You can also read helpful book reviews posted by readers just like you. Easily browse books by genre to choose from topics like history, romance, comedy, religion, politics, cooking, true crime and anything else you can imagine, all at great savings. We even offer a vast library of textbooks in virtually every subject, including prep materials for the SAT, GRE and GMAT tests\u2014probably for a whole lot less than the campus bookstore. Love audiobooks? We've got hundreds of audiobooks to enjoy, from new fiction bestsellers to classic literature and everything in between. Tons of excellent gift ideas, too, for both kids and adults. Plus, our affordable shipping options make it even easier to save on quality books for all the readers in your life.", "keyword_density": {"walmart": "0.5", "books": "6.0", "less": "0.9"}, "department_id": 15}
