{"department_text": "Auto & Tires", "level": 1, "url": "http://www.walmart.com/cp/Auto-Tires/91083?povid=cat121828-env999999-moduleA072012-lLinkGNAV1_AutoTires_AutoTires", "text": "Auto & Tires", "department_url": "http://www.walmart.com/cp/Auto-Tires/91083?povid=cat121828-env999999-moduleA072012-lLinkGNAV1_AutoTires_AutoTires", "description_title": "Save on auto tires, oil and more for your vehicle at Walmart", "keyword_count": {"oil": 4, "auto": 3, "tires": 4, "walmart": 6, "vehicle": 2, "save": 4}, "description_wc": 211, "description_text": "From Goodyear and Pirelli to Michelin and Bridgestone, it's easy to find the right tires for your car at Walmart.com. Simply browse by vehicle or tire size. Then place your order and select your Walmart Auto Care Center location for pick-up and installation at Every Day Low Prices. Find the Walmart Auto Care Center location nearest you . While you're there, why not save time and money by getting a complete lube and oil change as well? In addition to changing your oil, our Walmart Auto Care Center technicians will top off your car's brake fluid, transmission fluid, power steering fluid and more. We offer Every Day Low Prices on oil and car care products . And when you buy a new car battery from us, we'll install it and charge it for you at no extra cost. Walmart.com is the place to save on tires from Goodyear, Pirelli, Michelin, Bridgestone and other top brands, as well as tools and equipment to keep your ride running its best. You can find tires, motor oil and more vehicle needs right here at Walmart.com. Our Every Day Low Prices will save you money now, while the improved performance from better tires will save you money down the road.", "keyword_density": {"oil": "1.9", "auto": "1.4", "tires": "1.9", "walmart": "2.9", "vehicle": "1.0", "save": "1.9"}, "department_id": 12}
