{"department_text": "Baby", "level": 1, "url": "http://www.walmart.com/cp/Baby/5427?povid=cat121828-env999999-moduleA072012-lLinkGNAV1_Baby_Baby", "text": "Baby", "department_url": "http://www.walmart.com/cp/Baby/5427?povid=cat121828-env999999-moduleA072012-lLinkGNAV1_Baby_Baby", "description_title": "Baby Items and Baby Supplies", "keyword_count": {"baby supplies": 7, "baby": 31, "baby items": 7, "baby items and baby": 2, "supplies": 9}, "description_wc": 265, "description_text": "Baby supplies and baby items. The baby supplies and baby items you need cost less at Walmart. We have a whole baby store full of baby supplies and baby items at great savings right here. For baby gear, baby supplies, baby gifts and other baby stuff, check out our full selection of baby items. Find all the important baby supplies you need right here, whether you're a mom yourself or shopping for a mother-to-be. From adorable baby clothing to strollers and toys for babies, everything is priced to save you money. Browse for soft, cuddly baby clothes in a wide range of cute designs for boys and girls. For the nursery, discover safe, sturdy cribs and baby bedding, plus fun and educational toys for babies at every stage of development. And family outings become easier and more fun when you have the right car seat and stroller. When it's diapers you need, you'll find unbeatable prices on all the most-trusted diaper brands, including Pampers and Huggies. It's all part of our huge baby store full of baby supplies, baby items and baby products. Plus, find baby formula, baby bottles and baby care supplies like lotions and soaps, all available at unbeatable prices with a click of your mouse. For baby supplies, baby items, baby gear, baby gifts and baby products like strollers , diapers and potty training supplies, cribs and baby car seats there's only one place to get everything you need for less. Walmart is the headquarters for baby items and baby gifts at big savings.", "keyword_density": {"baby supplies": "5.3", "baby": "11.7", "baby items": "5.3", "baby items and baby": "3.0", "supplies": "3.4"}, "department_id": 13}
{"department_text": "Home", "level": 1, "url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat121828-env999999-moduleA072012-lLinkGNAV3_Home", "text": "Home", "department_url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat121828-env999999-moduleA072012-lLinkGNAV3_Home", "description_title": "Home Furnishings.", "keyword_count": {"home": 5}, "description_wc": 211, "description_text": "From the floor to the ceiling, from your rugs to your lighting, everything you need for your home is right here at Walmart.com. Whether you're in the market for all-new decor , looking to upgrade your home furniture, or just want a new mattress or refrigerator, you'll find it all right here for less. Browse our vast selection of top-brand appliances , including the latest refrigerator, dishwasher and microwave oven models at terrific prices. We make it easy to save on your next refrigerator, dishwasher or microwave from top appliances brands you know. And when it's time for a new mattress and bedding , look no further than our attractive mattress and bedding collections. Ready to refresh your decor? You'll discover a huge array of decor options, stylish rugs, great-looking lighting solutions and more. Plus comfortable and attractive home furniture to add new life to all your living spaces, whether inside or outdoors. And, of course, Walmart.com also features all the linens, rugs, bedding, towels and window coverings to complement your new home furniture. Shop Walmart.com for Every Day Low Prices on home furniture, decor, major appliances and accessories, such as bedding, flower pots, rugs and lamps. Save money and live better with Walmart..", "keyword_density": {"home": "2.4"}, "department_id": 24}
