{"department_text": "Gift & Registry", "level": 0, "url": "http://www.walmart.com/cp/112776?povid=cat1094765-env462536-module080912-lLinkLHNSpecialtyShops3WeddingShop", "text": "Wedding Shop", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "Wedding Products Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "keyword_count": {"walmart": 2, "wedding products": 1, "wedding": 5}, "description_wc": 109, "description_text": "Create an elegant and modern wedding without breaking the bank at Walmart.com. Whether you're deciding on save-the-date cards and invitations or shopping for an engagement ring and wedding band, and organizing a gift registry, we've got it covered. You'll find all the wedding products you're looking for, such as ring sets in gold, silver and platinum; wedding favors; and photo albums. Celebrate this joyous day with personalized gifts, including engraved wine boxes, split key chains, vows heart canvas and more. You can shop by category, by price point, and more at everyday low prices. So discover your wedding needs at Walmart.com \u2014 and save.", "parent_text": "Gift & Registry", "keyword_density": {"walmart": "1.8", "wedding products": "1.8", "wedding": "4.6"}, "department_id": 20}
