{"department_text": "Gift & Registry", "level": 0, "url": "http://www.walmart.com/cp/133224?povid=cat1095924-env456563-moduleA111012-lLinkLHNGiftIdeas2PersonalizedGifts", "text": "Personalized Gifts", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "Personalized Gifts", "parent_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "keyword_count": {"gifts": 11, "personalized gifts": 10}, "description_wc": 230, "description_text": "Everyone is sure to appreciate something special from the selection of personalized gifts at Walmart. And you'll appreciate the extensive selection of items that feature free personalization. Shop for gifts by occasion that include wonderful personalized gifts for weddings, housewarming celebrations, baby showers, anniversaries, religious events, Valentine's Day and Christmas. You can choose personalized gifts for her such as jewelry, apparel and accessories, bedding and bath, decor, kitchen and dining. Browse personalized gifts for him from our selection of jewelry, apparel and accessories, kitchen and dining, decor or even doormats. You can shop for personalized gifts for babies and kids that are arranged in categories for girls, boys, babies, and teens, as well as a category of toys and games. Our personalized gifts for grandparents include picture frames, apparel and accessories, decor, bedding and bath, and kitchen and dining. It's also easy to shop for personalized gifts at Walmart.com by color, price range, customer rating or best sellers. In addition to our Every Day Low Prices, you can take advantage of Home Free shipping to your door on many personalized gifts with a minimum $45 order of eligible Home Free items. Some personalized gifts are available for free store pickup, too, at your nearby Walmart store when you use Site to Store online ordering. So shop for personalized gifts at Walmart.com to save money and live better.", "parent_text": "Gift & Registry", "keyword_density": {"gifts": "4.8", "personalized gifts": "8.7"}, "department_id": 20}
{"level": 0, "url": "http://www.walmart.com/wishlist", "text": "Wish List", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "parent_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_wc": 253, "description_text": "Have a birthday, graduation or big holiday like Christmas coming up? Then make it easy for people to choose just the right gift by setting up a free Wish List at Walmart.com. Setting up your Wish List is easy, and shopping from it is even easier. You can add gifts to your wish list from anywhere on the site, including new appliances or furniture . You can even wish for a sleek laptop, iPad or computer . Or, if you're just in the mood from something fun, go for one of our many games or activities. Have fun with it! Browse the site and when you see something you'd like as a gift, just add it to your wish list. Tell your friends and family about our wish list registry at Christmas, too, then have fun comparing the Christmas gifts on each other's wish list. Plus, having a wish list for everyone makes shopping for Christmas gifts easier and more fun than ever. If you're setting up a birthday wish list, you'll also find lots of other helpful information here, such as articles on how to plan the perfect party and more. Whether you're picking out birthday presents, graduation gifts or Christmas presents, setting up a wish list is the easiest way to make sure people know what to get you. And when it's time, you can set up your baby registry or wedding registry here as well. Check out all our great gift registry options.", "parent_text": "Gift & Registry", "department_text": "Gift & Registry", "department_id": 20}
{"level": 1, "url": "http://www.walmart.com/cp/Character-Corner/1098784?povid=cat121828-env999999-moduleA112212-lLinkGNAV1_Campaign_CharacterCorner", "text": "Character Corner", "department_url": "http://www.walmart.com/cp/Character-Corner/1098784?povid=cat121828-env999999-moduleA112212-lLinkGNAV1_Campaign_CharacterCorner", "description_wc": 0, "department_text": "Character Corner", "department_id": 8}
{"level": 0, "url": "http://www.walmart.com/weddingregistry", "text": "Wedding", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "parent_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_wc": 239, "description_text": "Wedding bells are in the air. While you scramble to get everything ready for your big day, your friends and family are scrambling to find you the perfect wedding gift. Make it easy for them by setting up your wedding registry right here. It's super easy to set up your wedding registry, and it's even easier for others to shop from it. You can add wedding gifts from anywhere on the site, including new appliances , domestic items like towels and bedding and much more. To capture the big day, honeymoon and years of bliss that follow, check out our selection of cameras and camcorders . And since it can't be fun and games all the time, consider adding a few useful home improvement items to your wedding registry, too. Of course, you'll find plenty of other helpful resources to help you with your wedding planning, like tips on setting your wedding budget, choosing wedding invitations and even choosing the right engagement rings and wedding rings. There's lots to do, so cross an item off your list by setting up your wedding gift registry today. For ideas on building the perfect wedding registry, see our collection of top wedding gifts. And when the time comes, don't forget you can also build your baby registry here, as well as a wish list for Christmas or any occasion. Check out all our gift registry options.", "parent_text": "Gift & Registry", "department_text": "Gift & Registry", "department_id": 20}
{"level": 0, "url": "http://www.walmart.com/babyregistry", "text": "Baby", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "parent_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_wc": 224, "description_text": "People love getting gifts for babies but they aren't always sure what you need. Help them choose just the right baby gift by setting up a free Walmart baby registry. It's super easy to set up your baby registry in just a few quick steps, and it's even easier for others to shop from it. You can add gifts to your baby registry from anywhere on the site, including our vast selection of essential baby gear and must-haves such as car seats for babies . As you search the site for the baby gifts you want, we bet you'll find lots of other new gifts for baby that you never even considered. Besides setting up your baby gift registry in just minutes, you'll find lots of other helpful information and articles about everything from what to expect when you're pregnant to planning the perfect baby shower. You'll also find a list of our most popular items to include on your baby registry. No one offers more baby gifts than Walmart.com, so it's the perfect place to set up your baby gift registry. In fact, we can help you set up a gift registry for all sorts of occasions, including your wedding registry or a wish list for Christmas presents, graduation gifts, birthday presents and more.", "parent_text": "Gift & Registry", "department_text": "Gift & Registry", "department_id": 20}
{"level": 1, "url": "http://pin.walmart.com/sparkstudio-mancave/?povid=cat121828-env999999-moduleA102412-lLinkGNAV1_Campaign_ManCave", "text": "Man Cave", "department_url": "http://pin.walmart.com/sparkstudio-mancave/?povid=cat121828-env999999-moduleA102412-lLinkGNAV1_Campaign_ManCave", "description_wc": 254, "description_text": "Save on everything you need to create your own Man Cave with Man Cave specials from Walmart. Every man needs a place that's all his own, a place to unleash his inner he-man and do man stuff like watch sports and play games with his buddies. Some people call it a game room. Others call it a workout room. For others, it's a work shop. At Walmart, we simply call it a Man Cave. Create your very own Man Cave at home with man-sized savings on our full selection of Man Cave essentials. Whether you're looking to set up a Gamer's Man Cave, Sports Fan's Man Cave , an Automotive Buff's Man Cave , a Rock-n-Roll Man Cave or a Man Cave just for movie buffs , you'll find everything you need to build the perfect Man Cave sanctuary. Discover stuff like home gym equipment, tools and workbench supplies, sports memorabilia, video game consoles and more, at big, manly savings. And of course, what Man Cave would be complete without a solid audio system and big-screen TV? Those are just a few of the Man Cave necessities you'll find here. When it comes right down to it, few things are more manly than saving money on the stuff you love most. So go ahead. Set up your Man Cave and have fun doing it. You'll feel good knowing you got all the stuff you need at great prices from Walmart.", "department_text": "Man Cave", "department_id": 7}
{"department_text": "Gift & Registry", "level": 0, "url": "http://www.walmart.com/cp/Gift-Cards/96894?povid=cat1094765-env462536-module110112-lLinkLHN4GiftCardsShopAll", "text": "Shop all", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "A Walmart Gift Card is always the perfect gift, no matter what the occasion!", "parent_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "keyword_count": {"perfect": 2, "gift card": 9, "gift": 16, "walmart gift card is always the perfect": 1, "walmart": 7, "walmart gift card": 4}, "description_wc": 214, "description_text": "Whether you're shopping for a birthday present, graduation gift, wedding gift or Christmas present, a Walmart Gift Card is always the perfect choice. With a Walmart Gift Card, your lucky recipient can choose from virtually millions of gifts in categories like baby , jewelry or electronics . A Walmart Gift Card works just like cash, but it's easier to carry, more fun to receive and available in hundreds of fun gift card themes, from birthday to graduation to wedding to baby and more. Walmart Gift Cards are easy to order, too. Just pick your design, add your value and bam! You're done. See our collection of gift card designs for birthday, graduation, Christmas, wedding, baby and lots of other important gift-giving events. Each gift card can be preloaded with the amount you want to give, and redeemed at any Walmart store or here on Walmart.com. Let's say you've tried shopping from a baby registry, wedding registry or wish list, but can't find just the right gift. A gift card solves the problem, letting your recipient choose anything they want. So remember: Next time you need a perfect graduation gift, wedding gift, Christmas present or birthday present, look no further than a fun, convenient gift card from Walmart.", "parent_text": "Gift & Registry", "keyword_density": {"perfect": "0.9", "gift card": "8.5", "gift": "7.5", "walmart gift card is always the perfect": "3.3", "walmart": "3.3", "walmart gift card": "5.7"}, "department_id": 20}
