{"department_text": "Back to School", "level": 1, "url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "text": "Back to School", "department_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "description_title": "Back to School", "keyword_count": {"school": 18, "back": 10, "back to school": 5}, "description_wc": 320, "description_text": "Back to school. It's time to send them back to school and get more school for your money with uniforms, kids' backpacks, supplies, electronics, gift cards and Lunchbox Solutions from your back-to-school experts at Walmart. For challenge-free clothes shopping, take a look at our back-to-school survival guide to shopping with kids. It can help you save money on back-to-school clothes and avoid squabbles, too. If your children need school uniforms , you can dress them for success with the right uniforms for toddlers, boys, girls, juniors and young men. You'll also want to browse other schoolwear essentials that make the grade, such as backpacks and shoes. Find calculators, writing supplies, binders, notebooks, and more school supplies at Walmart for every student. You can shop our top school supplies for grades K-3, grades 4-5, grades 6-8, high school and even for teachers. Be sure to use our school supply lists to make shopping faster and more thorough. Of course, you'll want to get packin' with kids' backpacks, character backpacks and more backpacks for students of all ages. And you can stretch your dollar even further with school supplies bundles at Walmart. Electronics can be an important part of studying, as well as relaxing. Browse for awesome tablets, calculators , laptop PCs, netbooks, desktop computers, printers, and computer accessories to help students get work done and stay connected. TVs, DVD players, iPods and MP3 players can help make free time more entertaining, too. Gift cards are popular with all students, and our Lunchbox Solutions provide something to look forward to at school every day. You'll also want to take advantage of Home Free shipping on school uniforms and school supplies with your order of $45 or more of Home Free items from Walmart.com. So get them ready for school at Walmart to get more school for your money.", "keyword_density": {"school": "5.7", "back": "3.1", "back to school": "4.7"}, "department_id": 4}
