{"nr_products": 95, "level": 0, "url": "http://www.walmart.com/browse/gifts-registry/specialty-gift-cards/1094765_96894_972339/?_refineresult=true&povid=cat1094765-env462536-moduleA110112-lLinkLHN2GiftCardsSpecialty", "text": "Gift Cards - Specialty", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_wc": 0, "parent_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "parent_text": "Gift & Registry", "department_text": "Gift & Registry", "department_id": 20}
{"department_text": "College Living", "level": 1, "url": "http://www.walmart.com/cp/College-Living/1093705?povid=cat121828-env999999-moduleA051813-lLinkGNAV1_Campaign_CollegeLiving", "text": "College Living", "department_url": "http://www.walmart.com/cp/College-Living/1093705?povid=cat121828-env999999-moduleA051813-lLinkGNAV1_Campaign_CollegeLiving", "description_title": "College Living Starts at Walmart", "keyword_count": {"college living": 5, "living": 8, "college": 13, "walmart": 8, "college living starts at walmart": 1}, "description_wc": 266, "description_text": "Got everything to go back to college? Walmart has all of the necessities and extras to improve college life in your dorm or off campus. For everything from studying to socializing, you'll find smart savings for college living at Walmart. Our handy College Checklist makes sure you remember what you'll need to relax, study, organize, sleep, eat, and shower. Get your studying done, entertain yourself and stay connected with laptops, iPads, iPods, digital cameras, cell phones and more college electronics from Walmart. Personalize your room with college bedding , rugs, lights and more college living decor . Keep your clothes, books, and other gear organized in boxes, bins, baskets, drawers, carts and more college living storage solutions from Walmart. Outfit your living space with college appliances , such as microwaves, mini fridges, coffee makers and irons. If you're living off campus, take a look at affordable desks, chairs, bookcases and college furniture for your living room, bedroom and kitchen. College living definitely is easier when you can shop for must-have essentials at can't miss prices from Walmart.com. Browse by brand, best sellers, price range or customer ratings to find just the right item. You can save even more with our student-friendly Rollbacks, Special Buys and Value Bundles, too. College students can take advantage of free Site to Store shipping on hundreds of thousands of items on Walmart.com. You simply make your purchase in advance online and have it shipped to any Walmart store near your campus for easy pickup. College living starts at Walmart to save money and live better.", "keyword_density": {"college living": "3.8", "living": "3.0", "walmart": "3.0", "college": "4.9", "college living starts at walmart": "1.9"}, "department_id": 3}
{"level": 1, "url": "http://www.walmart.com/cp/1094926?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_EmpoweringWomenTogether", "text": "Empowering Women Together", "department_url": "http://www.walmart.com/cp/1094926?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_EmpoweringWomenTogether", "description_wc": 68, "description_text": "The turmoil of the 1990s left Rwanda with far too many widows, single mothers, and orphaned girls. Sisters Joy Ndunguste and Janet Nkubana helped these women put aside ethnic differences by reviving traditional weaving techniques that offer economic empowerment through fair trade. Read more Full Circle Exchange and Fidenza Disengno have teamed up to give hand-crafted jewelry from Peru a place in the U.S. market. Read more", "department_text": "Empowering Women Together", "department_id": 6}
{"department_text": "Gift & Registry", "level": -1, "url": "http://www.walmart.com/cp/Gift-Cards/96894?povid=catWRegistry-env7235449147-moduleA070412-lLinkLHNPlanningaParty5GiftCards", "text": "Gift Cards", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "A Walmart Gift Card is always the perfect gift, no matter what the occasion!", "parent_url": "http://www.walmart.com/wishlist", "keyword_count": {"perfect": 2, "gift card": 9, "gift": 16, "walmart gift card is always the perfect": 1, "walmart": 7, "walmart gift card": 4}, "description_wc": 214, "description_text": "Whether you're shopping for a birthday present, graduation gift, wedding gift or Christmas present, a Walmart Gift Card is always the perfect choice. With a Walmart Gift Card, your lucky recipient can choose from virtually millions of gifts in categories like baby , jewelry or electronics . A Walmart Gift Card works just like cash, but it's easier to carry, more fun to receive and available in hundreds of fun gift card themes, from birthday to graduation to wedding to baby and more. Walmart Gift Cards are easy to order, too. Just pick your design, add your value and bam! You're done. See our collection of gift card designs for birthday, graduation, Christmas, wedding, baby and lots of other important gift-giving events. Each gift card can be preloaded with the amount you want to give, and redeemed at any Walmart store or here on Walmart.com. Let's say you've tried shopping from a baby registry, wedding registry or wish list, but can't find just the right gift. A gift card solves the problem, letting your recipient choose anything they want. So remember: Next time you need a perfect graduation gift, wedding gift, Christmas present or birthday present, look no further than a fun, convenient gift card from Walmart.", "parent_text": "Wish List", "keyword_density": {"perfect": "0.9", "gift card": "8.5", "gift": "7.5", "walmart gift card is always the perfect": "3.3", "walmart": "3.3", "walmart gift card": "5.7"}, "department_id": 20}
