{"level": 0, "url": "http://www.walmart.com/cp/1102793?povid=cat1094926-env999999-moduleA030713-lLinkLHNLearnmoreAbouttheprogram", "text": "About the Program", "department_url": "http://www.walmart.com/cp/1094926?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_EmpoweringWomenTogether", "parent_url": "http://www.walmart.com/cp/1094926?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_EmpoweringWomenTogether", "description_wc": 145, "description_text": "Women in the world's economically-challenged nations \u2212 and even here in our own backyard \u2212 dream of a better life. Yet for most, entrepreneurial success is an exception, not because they lack the ability or drive, but because so often they lack the opportunity. At Walmart, we're working to change that. As part of our commitment to empower women worldwide, we've launched Empowering Women Together , a Store For Good, and a dedicated space on Walmart.com that connects products from women-owned businesses around the world with U.S. consumers. Our hope is to provide these hard-working women with opportunities to improve their own lives, while creating new jobs and enhancing the lives of their families and their communities. Each supplier in the Empowering Women Together program is a woman-owned business or an aggregator with the mission of supporting women-owned businesses.", "parent_text": "Empowering Women Together", "department_text": "Empowering Women Together", "department_id": 6}
