{"department_text": "College Living", "nr_products": 347, "level": 0, "url": "http://www.walmart.com/browse/Bikes-Riding-Toys/Adult-Bikes/_/N-981l?browsein=true&_refineresult=true&_refineresult=true&ic=48_0&path=0%3A4171&ref=+430329&catNavId=1093706&povid=cat1093705-env999999-moduleA072013-lLinkLHNRelatedCategories2Bikes", "text": "Bikes", "department_url": "http://www.walmart.com/cp/College-Living/1093705?povid=cat121828-env999999-moduleA051813-lLinkGNAV1_Campaign_CollegeLiving", "description_title": "Adult Bikes", "parent_url": "http://www.walmart.com/cp/College-Living/1093705?povid=cat121828-env999999-moduleA051813-lLinkGNAV1_Campaign_CollegeLiving", "keyword_count": {"bikes": 11, "adult": 18, "adult bikes": 2}, "description_wc": 275, "description_text": "Adult bikes. Get a new adult bike for less at Walmart. We have a terrific selection of large bikes for adults at little baby prices you're sure to love. Come discover just the right adult bicycle to suit your particular riding style and the terrain around your home. When you're ready to save on a new adult bike, it's pretty difficult to beat the collection of large bikes for adults you'll discover right here at Walmart. Do you have a certain sort of adult bicycle in mind? We have road bikes for adults, mountain bikes for adults, cruisers for adults, hybrids for adults and a whole fleet of other great adult bike varieties. Best of all, we price all of our adult bicycles with big grown-up savings in mind, so you'll be able to save more and ride even better, knowing you got a great value on your adult bike from Walmart. In addition to a wide array of large bicycles for adults, we have plenty of other adult bikes to choose from. Don't miss our complete assortments of hybrid bikes , comfort bikes , mountain bikes and tandem bikes to name just a few of the well-priced bike categories you'll find. And be sure to check out our biking apparel selection to help you look and feel truly unstoppable when you're out there pedaling. For a new adult bicycle and everything you need to go with it, Walmart is the smart place to shop. Saving money on large bikes for adults at Walmart is as easy as... well, as easy as riding a bike.", "parent_text": "College Living", "keyword_density": {"bikes": "4.0", "adult": "6.6", "adult bikes": "1.5"}, "department_id": 3}
