{"department_text": "Game Time", "level": -1, "url": "http://www.walmart.com/cp/Coffee-Tea/1086446?povid=cat90546-env198637-moduleA061212-lLinkLHNFeaturedShops1Coffe_TeaStore", "text": "Coffee & Tea Store", "department_url": "http://www.walmart.com/cp/1091906?povid=cat121828-env999999-moduleA072012-lLinkGNAV1_Campaign_GameTime", "description_title": "Coffee and Tea", "parent_url": "http://www.walmart.com/cp/90546?povid=cat1091906-env999999-module032313-lLink_LHN_KitchenAppliances", "keyword_count": {"tea": 18, "coffee": 17, "coffee and tea": 6}, "description_wc": 217, "description_text": "Coffee and tea. Wake up to delicious coffee or tea for less. Walmart has the coffee and tea you want to start your day off right, at invigoratingly low prices. We price our coffee and tea selection to help save you money, and you'll save even more by brewing your coffee and tea at home each morning instead of visiting your local coffee or tea house. What kind of coffee do you want? Whether you prefer ground coffee, whole coffee beans, instant coffee or espresso, you'll find it here for less. Same is true for tea. We offer tea bags, herbal teas and iced tea mixes at a fraction of the cost you'll encounter at popular teahouses. So stock up now and save every single day. All you need to do to find real savings is check out our selection of tea and coffee products, including ground coffee , K-Cup coffee pods, instant coffee mixes, tea bags and iced tea mixes . And of course, you'll also find eye-opening savings on the necessary coffee, tea and espresso makers . Discover it all right here and save now. Coffee and tea bags of all kinds cost less at Walmart. Start saving today with our Every Day Low Prices on coffee and tea.", "parent_text": "Kitchen Appliances", "keyword_density": {"tea": "8.4", "coffee": "7.9", "coffee and tea": "8.4"}, "department_id": 2}
{"department_text": "Game Time", "nr_products": 142, "level": -1, "url": "http://www.walmart.com/browse/appliances/small-kitchen-appliances/4044_90548_90546/?tab_value=all&facet=special_offers%3aNew&ss=false&ic=32_0&povid=cat90546-env474753-moduleA030713-lLinkLHNSpecialOffers2NewArrivals", "text": "New Arrivals", "department_url": "http://www.walmart.com/cp/1091906?povid=cat121828-env999999-moduleA072012-lLinkGNAV1_Campaign_GameTime", "description_title": "Small Kitchen Appliances", "parent_url": "http://www.walmart.com/cp/90546?povid=cat1091906-env999999-module032313-lLink_LHN_KitchenAppliances", "keyword_count": {"kitchen": 4, "small kitchen appliances": 2}, "description_wc": 251, "description_text": "From a wide selection of stylish coffee makers and blenders to food processors and rotisseries, the small kitchen appliances you're looking for are available at Walmart. Choose from a variety of microwaves, slow cookers , juicers and toasters to match your kitchen decor at Walmart. You can also save a bundle on mixers , and take your choice of microwave ovens, popcorn and waffle makers, chocolate fountains and much more. If you're shopping for a selection of Hamilton Beach toaster ovens , Keurig Coffee makers, Ninja blenders and Panasonic and RCA microwaves , Walmart has you covered. You'll find what you are looking for, including a Crock Pot Triple Dipper, Oster mini choppers, a Universal Housewares commercial size food grinder/chopper and a wide selection of George Foreman grills. Walmart also stocks a variety of can openers, deep fryers and frozen yogurt and ice cream makers. Search for Every Day Low Prices on As Seen On TV products and slow cookers by color/finish, brand, price, customer rating or special offers, such as rollbacks and clearance. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. Whether you're putting the finishing touches on your new kitchen or just trying to free up counter space, our selection of small kitchen appliances has got it covered. You'll find everything you need including rice cookers, bread makers, snow cone kits and more at Walmart. Save money. Live better.", "parent_text": "Kitchen Appliances", "keyword_density": {"small kitchen appliances": "2.4", "kitchen": "1.6"}, "department_id": 2}
