{"department_text": "Game Time", "level": -1, "url": "http://www.walmart.com/cp/1095238?povid=cat133277-env441249-moduleA112712-lLinkLHNSpecialOffers1GoPro", "text": "GoPro Value Bundles", "department_url": "http://www.walmart.com/cp/1091906?povid=cat121828-env999999-moduleA072012-lLinkGNAV1_Campaign_GameTime", "description_title": "GoPro Hero Cameras", "parent_url": "http://www.walmart.com/cp/133277?povid=cat1091906-env999999-module032313-lLink_LHN_CamerasCamcorders", "keyword_count": {"gopro": 29, "gopro hero": 11, "hero": 13, "cameras": 6, "gopro hero cameras": 2}, "description_wc": 250, "description_text": "GoPro Hero cameras. Get your GoPro Hero camera here at Walmart for less. If you love outdoor sports and enjoy photography, the GoPro Hero camera is the perfect action-packed marriage of the two. Take your GoPro Hero camera with you skiing, mountain biking, kayaking or snorkeling. The GoPro Hero camera is built to withstand any punishment you can dish out. And now at Walmart, GoPro Hero cameras are priced more affordably than ever. What kind of GoPro camera should you get? All GoPro cameras, whether you get the GoPro Hero or the GoPro HD Hero 2 or GoPro HD Hero 3, are designed for intense outdoor and sports photography. To customize your GoPro Hero camera for a particular sport, use the available GoPro mounts and GoPro accessories. We have GoPro accessories and GoPro mounts for virtually any sport. Get a GoPro handlebar mount, GoPro helmet mount for biking, GoPro chest harness (called the GoPro Chesty), GoPro seatpost mount, GoPro helmet mount for skiing, GoPro battery packs, GoPro housing cases and just about anything else you could need. All for less! GoPro cameras like the GoPro Hero camera are just a taste of what we carry in the way of HD camcorders, though. We have a full line of camcorders and cameras, but if you want an affordable, rugged and easy-to-use sports camera you take virtually anywhere, then GoPro cameras like the GoPro hero series is for you. Save on a new GoPro hero camera at Walmart.", "parent_text": "Cameras & Camcorders", "keyword_density": {"gopro": "11.6", "gopro hero": "8.8", "hero": "5.2", "cameras": "2.4", "gopro hero cameras": "2.4"}, "department_id": 2}
