{"department_text": "Back to School", "level": 0, "url": "http://www.walmart.com/cp/96894?povid=cat1071204-env999999-moduleA072413-lLinkLHNRelatedCategories_GiftCards", "text": "Gift Cards", "department_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "description_title": "A Walmart Gift Card is always the perfect gift, no matter what the occasion!", "parent_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "keyword_count": {"perfect": 2, "gift card": 9, "gift": 16, "walmart gift card is always the perfect": 1, "walmart": 7, "walmart gift card": 4}, "description_wc": 214, "description_text": "Whether you're shopping for a birthday present, graduation gift, wedding gift or Christmas present, a Walmart Gift Card is always the perfect choice. With a Walmart Gift Card, your lucky recipient can choose from virtually millions of gifts in categories like baby , jewelry or electronics . A Walmart Gift Card works just like cash, but it's easier to carry, more fun to receive and available in hundreds of fun gift card themes, from birthday to graduation to wedding to baby and more. Walmart Gift Cards are easy to order, too. Just pick your design, add your value and bam! You're done. See our collection of gift card designs for birthday, graduation, Christmas, wedding, baby and lots of other important gift-giving events. Each gift card can be preloaded with the amount you want to give, and redeemed at any Walmart store or here on Walmart.com. Let's say you've tried shopping from a baby registry, wedding registry or wish list, but can't find just the right gift. A gift card solves the problem, letting your recipient choose anything they want. So remember: Next time you need a perfect graduation gift, wedding gift, Christmas present or birthday present, look no further than a fun, convenient gift card from Walmart.", "parent_text": "Back to School", "keyword_density": {"perfect": "0.9", "gift card": "8.5", "gift": "7.5", "walmart gift card is always the perfect": "3.3", "walmart": "3.3", "walmart gift card": "5.7"}, "department_id": 4}
