{"department_text": "Back to School", "level": -1, "url": "http://www.walmart.com/cp/1064347?povid=cat92352-env198632-moduleA110511-lLinkFeaturedBrand5NFL", "text": "NFL", "department_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "description_title": "NFL Fan Shop Saves You Money at Walmart", "parent_url": "http://www.walmart.com/cp/92352?povid=cat1071204-env999999-module060413-LHNRelatedCategories_Kids_TeenRooms", "keyword_count": {"nfl": 9, "fan": 5, "nfl fan shop": 4, "walmart": 2}, "description_wc": 221, "description_text": "Show your team spirit with stylish and fun apparel, jewelry, and accessories from the NFL Fan Shop at Walmart.com. It doesn't matter if your NFL football team is the worst in the league or the Super Bowl champs. No one will ever doubt your passion for your team when you have the NFL gear to prove it. Whether you're headed out to root for your home team or just sitting on your lucky couch watching the big game, our NFL Fan Shop has got it all covered. The Super Bowl may feature the spectacle of the two best teams in the NFL colliding along with the pageantry of the event itself, but it would be nothing without you, the devoted fan. You'll find everything you need from every team in the NFL, including Jerseys , T-Shirts , Hoodies and Sweatshirts , Bedding , Outdoor Decor , Sports Accessories , and so much more. You can get a variety of items emblazoned with your favorite NFL football team logo, including grills, car floor mats, apparel, housewares, throws, stuffed toys, and even lawn gnomes. Our NFL Fan Shop lets you be as subtle or as bold as you like, and it won't cost a bundle. Show your team spirit with the NFL Fan Shop at Walmart.com ? and save.", "parent_text": "Kids' & Teen Rooms", "keyword_density": {"nfl": "4.2", "fan": "2.3", "nfl fan shop": "5.6", "walmart": "0.9"}, "department_id": 4}
