{"department_text": "Back to School", "nr_products": 27, "level": 0, "url": "http://www.walmart.com/browse/seasonal/usb-flash-drives/1085632_1071204_1105357_1105358/?_refineresult=true&povid=cat1071204-env999999-module053113-LHN_USBFlashDrives", "text": "USB Flash Drives", "department_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "description_title": "USB Memory", "parent_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "keyword_count": {"usb memory": 7, "usb": 18}, "description_wc": 284, "description_text": "USB memory. USB memory like USB flash drives costs less here at Walmart. We have a large selection of USB flash drives and USB memory sticks to choose from, in a wide range of storage sizes to meet all your data storage and data transfer requirements. A USB flash drive or USB thumb drive is the simplest and quickest way to back up your data (whether it's photos, music, school projects, financial documents, work presentations or any other kind of file), take it to go in your pocket, and then transfer it to other computers. What size and sort of USB flash drive do you need? Our selection includes USB 2.0 flash drives and USB thumb drives ranging in data storage space from a few simple gigabytes to 128GB of space and more. Not only that, our prices on 2GB flash drives, 4GB flash drives and even 128GB flash drives are about the lowest around, so you can save money and live better while enjoying the knowledge that your most precious data is backed up and secure using USB memory. When you've decided on the USB flash drive or USB thumb drive you want, don't miss our enormous department full of other low-priced, top-quality electronics and computer supplies, including networking gear , TV and video equipment and everything else you can imagine in the way of cool gadgets and useful digital equipment. So get the USB memory you need in the form of USB flash drives, USB memory sticks or USB thumb drives right here for less. After all, why not save money while you're backing up and saving your data? USB memory costs less at Walmart.", "parent_text": "Back to School", "keyword_density": {"usb memory": "5.0", "usb": "6.4"}, "department_id": 4}
