{"department_text": "Back to School", "nr_products": 8019, "level": 0, "url": "http://www.walmart.com/browse/electronics/school-supplies/3944_546952_1086045/?_refineresult=true%20&povid=cat1071204-env999999-module053113-LHN_SeeallSchoolSupplies", "text": "See all School Supplies", "department_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "description_title": "School Supplies", "parent_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "keyword_count": {"supplies": 9, "school": 13, "school supplies": 5}, "description_wc": 241, "description_text": "From a wide selection of kid's back-to-school supplies and school calculators to teaching and classroom supplies , the school supplies you are looking for are available at Walmart. Choose from a variety of school binders, writing supplies, arts and craft supplies, construction paper, school notebooks , lined paper or backpacks at Walmart. You'll find a wide selection of items for back-to-school organization . Our extensive array of school supplies and products includes binders, textbooks, pre-school supplies and learning tools and activities. Whether you're shopping for Crayola markers, Bic Wite-Out, Paper Mate pencils, Elmer's School Glue, Pacon sketch pads, RoseArt alphabet stampers, an Advantus globe or X-ACTO sharpeners, Walmart has you covered. You'll find what you want, including Swingline staplers, Scotch transparent tape, a Texas Instruments scientific calculator or mathematics and biology school textbooks . Walmart also stocks a variety of dictionaries and thesauruses, various study aids and index cards for your convenience. Look for Every Day Low Prices on school-supply value bundles and sort school supplies online by brand, price, customer preference or special offers, such as rollbacks and clearance. Be sure to look for Walmart's money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. From classroom supplies and multi-purpose paper to school uniforms and Box Top specials, Walmart's selection can meet your needs. Save money. Live better.", "parent_text": "Back to School", "keyword_density": {"supplies": "3.8", "school": "5.5", "school supplies": "4.2"}, "department_id": 4}
{"department_text": "Back to School", "nr_products": 52, "level": 0, "url": "http://www.walmart.com/browse/seasonal/baby-essentials/1085632_1071204_1105280_1105283/?_refineresult=true&povid=cat1071204-env999999-module060413-LHNPreschool_BabyEssentials", "text": "Baby Essentials", "department_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "description_title": "Baby Essentials", "parent_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "keyword_count": {"baby": 17, "baby essentials": 7}, "description_wc": 168, "description_text": "Baby essentials. Find the baby essentials every parent needs at terrific savings here at Walmart. We have a full selection of baby essentials and baby needs to help make parenting easier. Not only that, our low prices on baby essentials will help you save money so you and your whole family can live better. Whether you need baby formula, Pedialyte, Pediasure, \"squeezy packs,\" baby snacks, diapers or any other kind of baby essentials, you'll feel smart when you save on these baby necessities and more. You'll also feel good knowing you can get them from the brands you know and trust, such as Gerber, Parents' Choice and Pampers. Of course, in addition to baby essentials, you'll discover a complete collection of baby toys and games, baby clothing, baby furniture , baby safety gear , maternity clothing and more. Save big on everything in our entire selection of baby products , including all the baby essentials and baby needs to keep babies and their parents happy.", "parent_text": "Back to School", "keyword_density": {"baby": "10.3", "baby essentials": "8.5"}, "department_id": 4}
