{"department_text": "Back to School", "nr_products": 98, "level": 0, "url": "http://www.walmart.com/browse/school-supplies/school-notebooks/3944_546952_1086045_1086391/?_refineresult=true&ic=32_0&path=0%3A3944%3A546952%3A1086045&catNavId=&povid=cat1071204-env999999-module053113-LHN_Notebooks", "text": "Notebooks", "department_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "description_title": "School Notebooks", "parent_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "keyword_count": {"school": 7, "notebooks": 13, "school notebooks": 6}, "description_wc": 228, "description_text": "From college ruled notebooks to graph paper pads, the school notebooks at Walmart are available for less. At Walmart, we carry an assortment of quality school notebooks and school supplies to help meet your needs, such as memo pads, composition books, spiral notebooks, scratch pads and steno pads. We also stock a variety of ruled index cards, single-subject notebooks, five-subject notebooks and more. Be sure to also browse our selection of electronics and office supplies to find other items that you may need. Pick up one of our\u00a0wire-bound notebooks today and help get organized. We have a wide selection of school notebooks from many top brands. You can find Ampad notebooks, Mead composition books, National notebooks and more at Every Day Low Prices. When it comes to school notebooks for you or someone else, we've got you covered. Shopping for school notebooks is easy at Walmart.com with the ability to search by keyword. You can also search for the item you want by brand, category, customer rating, price, popular choice, top sellers, special offers, store availability, clearance and more. Be sure to look for money-saving shipping offers and free store pickup for many products when you shop at Walmart.com. If you\u2019re looking for school notebooks for