{"department_text": "Back to School", "nr_products": 69, "level": 0, "url": "http://www.walmart.com/browse/school-supplies/school-calculators/3944_546952_1086045_1086388/?_refineresult=true&ic=32_0&path=0%3A3944%3A546952%3A1086045&povid=cat1071204-env999999-module071313-LHN_Calculators", "text": "Calculators", "department_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "description_title": "School Calculators", "parent_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "keyword_count": {"calculators": 5, "school": 12, "school calculators": 1}, "description_wc": 184, "description_text": "School calculators. The savings add up when you buy school supplies like a new school calculator at Walmart. We have the calculator you need for your studies, at a price that makes good mathematical sense for your budget. Check out our selection of calculators and find just the calculator you're looking for, for less. What sort of school calculator do you need? Whether it's a graphing calculator, a scientific calculator or just a basic calculator, you'll pay less for it when you get it from us. Not only that, our graphing calculators, scientific calculators and basic calculators for school come from top calculator brands like Texas Instruments, Casio and HP, so you know you're getting great value. When you're done selecting the ideal school calculator, be sure to see our terrific selection of other popular school supplies , including school binders , school notebooks , school writing supplies , laptops, textbooks, learning software, student apparel and so much more. So do the math and save big on your new calculator for school and other school supplies here at Walmart.", "parent_text": "Back to School", "keyword_density": {"calculators": "2.8", "school": "6.7", "school calculators": "1.1"}, "department_id": 4}
{"department_text": "Back to School", "nr_products": 584, "level": 0, "url": "http://www.walmart.com/browse/backpacks/backpacks/5438_1045799_1045801_133211/?_refineresult=true&facet=category%3AKids%27+Backpacks&catNavId=&povid=cat1071204-env999999-module053113-LHN_Kids'Backpakcs", "text": "Kids' Backpacks", "department_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "description_title": "Backpacks", "parent_url": "http://www.walmart.com/cp/1071204?povid=cat121828-env999999-moduleA061213-lLinkGNAV1_Campaign_BacktoSchool", "keyword_count": {"backpacks": 12}, "description_wc": 221, "description_text": "Fun and function combine in backpacks that hold personal, school or business gear and make a fashion statement at the same time. You can shop at Walmart.com for kids' backpacks, school backpacks, daypacks, messenger bags, laptop backpacks, travel backpacks, camera backpacks and more specialized backpacks. It's easy to find the backpacks you're looking for because you can search by category, brand, color, price range, best sellers or customer ratings at Walmart.com. You can choose backpacks from Widkin, Goodhope, Miquelrius, Everest, Maxpedition, Nestle, Caribee, David King, Eastsport and more. Sports fans will want to see backpacks that feature NFL, NCAA, MLB and NBA teams. Kids will love wearing backpacks that feature Hello Kitty, Minnie Mouse, Disney Fairies, Disney Princess, Dora the Explorer, Skylanders, Disney Cars, Teenage Mutant Ninja Turtles, Lalaloopsy, Thomas the Train and more of their favorite characters. Of course, backpacks aren't the only fashionable products you'll find at Walmart.com. We offer girls' clothes, boys' clothes, and baby clothing, as well as women's apparel and men's clothing. You can even browse for specialized apparel, such as maternity clothing, men's workwear and school uniforms at Walmart.com. Many clothes feature money-saving shipping offers that make them even more app