{"department_text": "Made in the USA", "level": 0, "url": "http://www.walmart.com/cp/5431?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments20Pharmacy", "text": "Pharmacy", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_title": "Prescriptions and More at Walmart Pharmacies", "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "keyword_count": {"walmart": 5, "walmart pharmacies": 1, "prescriptions": 1}, "description_wc": 112, "description_text": "Save time and money with savings programs and services at Walmart stores and Walmart.com. Walmart pharmacies accept major Rx insurance plans, such as Express Scripts, TRICARE and many others. It is easy to transfer your existing prescription by simply bringing your current Rx bottle or prescription from a plan, such as Express Scripts or TRICARE, to any Walmart pharmacy. While you are there, you can stock your medicine cabinet and find home medical equipment, too. You will also want to take advantage of $4 prescriptions, our online Wellness Shops and our online Specialty Pharmacy. So take care of all your pharmacy needs and more at Walmart to save money and live better.", "parent_text": "Made in the USA", "keyword_density": {"walmart": "4.5", "walmart pharmacies": "1.8", "prescriptions": "0.9"}, "department_id": 5}
