{"department_text": "Made in the USA", "level": 0, "url": "http://www.walmart.com/cp/Pets/5440?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments19Pets", "text": "Pets", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_title": "Spoil your pet for less at Walmart", "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "keyword_count": {"pet": 13, "walmart": 2}, "description_wc": 292, "description_text": "Keep your pets happy and healthy with quality pet supplies from Walmart.com. We carry a huge selection of pet food and pet supplies, including dog food, cat food, fish food, bird seed, rabbit food and more. In addition to the pet food your pet needs for the best nutrition, you'll also find a full range of pet supplies like bird cages, hamster cages, fish tanks, dog houses, bunny cages and cat baskets. Basically, all the supplies you need for your pets are right here at your fingertips. In dog supplies , shop for dog food from makers you know and trust, like Purina, Puppy Chow, Pedigree, Iams, Milk Bone and others. For your kitty, we carry cat food from Friskies, Meow Mix, Purina and Fancy Feast, to name a few. Cat litter, too, of course. Bird seeds and bird feeders, as well as feeders for small animals like hamsters and rabbits, are just a sampling of the other pet supplies we carry at great prices. Oh, and don't let us forget an ocean's worth of fish food and fish supplies for goldfish, bettas and other freshwater and tropical fish species. To keep your pets from destroying your shoes or furniture, we also offer a huge selection of fun, safe dog toys, chew toys, cat scratchers and other cat supplies that'll keep them busy for hours on end. Even your pet goldfish will enjoy the cool aquarium decorations you can add to his fish tank or fish bowl. And to ward off common pet pests like fleas and ticks, be sure to pick up some of our effective flea and tick control products. Best of all, you'll save a bundle when you get your pet supplies at Walmart.com", "parent_text": "Made in the USA", "keyword_density": {"pet": "4.5", "walmart": "0.7"}, "department_id": 5}
{"department_text": "Made in the USA", "level": 0, "url": "http://www.walmart.com/cp/Toys/4171?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments23Toys", "text": "Toys", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_title": "Toys Cost Less at Walmart", "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "keyword_count": {"walmart": 2, "toys": 13}, "description_wc": 236, "description_text": "From action figures and stuffed animals to kids' electronics and outdoor play , you'll find wonderful toys for kids of all ages at Walmart.com. We feature everyday low prices on dolls and dollhouses, pretend play, arts and crafts, development and learning toys, vehicles, trains and remote control toys and more. Kids can stay active and healthy while having fun with our outdoor play toys, as well as swing sets , bikes and riding toys. You can shop for toys by brand to choose from Disney, Fisher-Price, LEGO, Little Tikes, Leap Frog, Nerf and more. Or browse by age group to find toys for everyone from babies to kids who are 12 and up. You can also shop for toys by price range, customer rating or special offers. For even more ideas, our Toy Finder can help you find the perfect gift and gift ideas, while our Birthday Shop lets you plan a party and find great gifts, too. You'll also want to take advantage of free Site to Store shipping on many outdoor play toys, bikes and riding toys, scooters and more eligible toys. So get that climber and slide set they've always wanted, set up your home for hours of creative pretend play, find toys that will help them learn, or outfit your backyard for some seriously fun outdoor play. Shop for toys at Walmart.com to save money and live better.", "parent_text": "Made in the USA", "keyword_density": {"walmart": "0.9", "toys": "5.6"}, "department_id": 5}
