{"department_text": "Made in the USA", "level": 0, "url": "http://www.walmart.com/cp/1072864?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments12HomeImprovement", "text": "Home Improvement", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_title": "Walmart.com has the tools to make home improvement easy.", "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "keyword_count": {"walmartcom": 2, "make": 1, "tools": 6, "home improvement": 5}, "description_wc": 240, "description_text": "Tired of looking at peeling paint, scuffed old flooring or decor that just feels out of date? Then shop our Home Improvement department for all the tools , paint, hardware and supplies to fix it. Whether you need the tools for a complex electrical or plumbing job inside the walls, or just some paint for a touch-up in the den, you'll find home improvement tools and supplies for less at Walmart.com. If you're looking to liven up your outdoor spaces a bit, you can save big on gardening essentials ranging from planters to fertilizers to irrigation systems to lighting. Of course, you'll also find heavy-duty hardware and power tools such as lawnmowers, chainsaws, leaf blowers and more. For indoor home improvements, check out our beautiful flooring options, dependable plumbing fixtures, state-of-the-art lighting solutions and broad spectrum of paint and decor for every taste. Why pay more for an electrician or plumber when you can save on all the electrical and plumbing tools and supplies you need to do the job yourself? Nothing spruces up a home improvement job quite like a fresh coat of paint , so we've got hundreds of paint choices to suit every scheme and palette, not to mention all the tools you need to paint right the first time. When it comes to home improvement, no one makes it easier to save time and money than W