{"department_text": "Made in the USA", "level": 0, "url": "http://www.walmart.com/cp/health/976760?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments10Health", "text": "Health", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_title": "Save on Health Products at Walmart", "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "keyword_count": {"walmart": 5, "health": 8, "products": 5, "save": 3, "health products": 2, "health products at walmart": 1}, "description_wc": 242, "description_text": "Save money and live better with health products from Walmart. We have smart buys to keep you going strong when it comes to vitamins . Our selection features products for bone and joint health, a healthy heart, and immunity, as well as herbals, minerals, multivitamins, single vitamins and supplements. Our great brands for a healthy lifestyle include Centrum, Equate, Nature Made, One a Day, Spring Valley and many more. You can amp up or slim down to get fit with top brands and big savings from our diet and nutrition selection. It features diet foods, weight loss supplements, energy nutrition, sports nutrition, and even scales. Shop for mobility aids, diabetic supplies, daily living aids and more home health care at Walmart.com. Here you'll find useful items that offer convenience and comfort for a variety of health conditions. Our medicine cabinet enables you to save money on the relief you need. Browse through products for pain relief, ear care, eye care, first aid and sexual wellness, in addition to analgesics, allergy medicines, cold remedies, and flu treatments. It's easy to shop by price range, customer rating, or best sellers to find just the right health products at Walmart.com. Many products qualify for Home Free shipping with your $45 order of eligible items or free Site to Store shipping for pickup at your closest Walmart store. So shop for all of your health needs at Walmart to save money and live better.", "parent_text": "Made in the USA", "keyword_density": {"walmart": "2.1", "products": "2.1", "health": "3.3", "save": "1.2", "health products": "1.7", "health products at walmart": "1.7"}, "department_id": 5}
{"department_text": "Made in the USA", "level": 0, "url": "http://www.walmart.com/cp/Craft-Party-Supply/2637?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments17Party_Occasions", "text": "Party & Occasions", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_title": "Get decorations, party supplies and gifts for less at Walmart.com", "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "keyword_count": {"party supplies": 4, "gifts": 8, "walmartcom": 3, "decorations": 4, "supplies": 6, "decorations party supplies and gifts": 1}, "description_wc": 231, "description_text": "Whether you're shopping for party supplies , holiday decorations, or thoughtful gift ideas, Walmart.com is your Special Occasion Headquarters. With thousands of items to choose from at unbeatable prices, you can easily find what you want\u2014just search by the type of occasion, recipient, holiday or craft project you're shopping for. We offer festive party supplies and decorations for weddings, birthday parties and holidays like Christmas, Halloween and the Fourth of July. You'll also save on terrific gifts for a wide range of occasions, like birthday gifts, graduation gifts and wedding gifts. You can even make your own gifts with our big selection of do-it-yourself arts and crafts supplies or choose from our personalized gifts like jewelry, linens, mugs and more, all with your own personalized touch. So why not save on all your party supplies and decorations at Walmart.com, and have more money left over to spend on great gifts ? You'll find everything you need right here, including gift cards and gift baskets. And when you're feeling creative, be sure to explore our terrific selection of arts and crafts supplies , ranging from photo albums to scrapbooking essentials to Cricut machines. Best of all, with unbeatable prices and quick delivery, Walmart.com makes it easier than ever to save on decorations, party supplies and gifts for all occasions. Now that's cause for celebration!", "parent_text": "Made in the USA", "keyword_density": {"party supplies": "3.5", "gifts": "3.5", "walmartcom": "1.3", "decorations": "1.7", "supplies": "2.6", "decorations party supplies and gifts": "2.2"}, "department_id": 5}
{"department_text": "Made in the USA", "level": 0, "url": "http://www.walmart.com/cp/103150?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments7Furniture", "text": "Furniture", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_title": "Furniture", "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "keyword_count": {"furniture": 20}, "description_wc": 250, "description_text": "Furniture costs less at Walmart. Let us be your source for fashionable, functional and comfortable furniture at fantastic low prices. Whether you're shopping for new bedroom furniture or patio furniture, we offer furniture for every room in your home, not to mention outdoor furniture. What kind of furniture are you looking for? Discover all the furniture options you need, including beds, dining tables, office chairs, patio sets and entertainment centers from brands like Better Homes and Gardens, Canopy and Hometrends. It's all really easy to find, too, when you can shop furniture by categories, such as baby furniture, patio furniture , home office furniture , living room furniture and bedroom furniture. You can even browse furniture by price range or your favorite manufacturer, so finding exactly the furniture you want to complete your home furnishings is just a few clicks away. Maybe it's time for a complete furniture upgrade; time to refresh that worn-out dining table or replace that sagging sofa in the living room with something more comfortable and attractive. And what about that tired mattress you've been tossing and turning on for so many years? Wouldn't it be nice to finally get the good night's sleep you need? You'll find the furniture you've been dreaming about right here, from mattresses to dining tables and so much more. You'll save money on furniture at Walmart, so get all the furniture you want right here and start living better now.", "parent_text": "Made in the USA", "keyword_density": {"furniture": "8.1"}, "department_id": 5}
{"level": 0, "url": "http://www.walmart.com/cp/Electronics/3944?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments6Electronics", "text": "Electronics", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_wc": 0, "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "parent_text": "Made in the USA", "department_text": "Made in the USA", "department_id": 5}
{"department_text": "Made in the USA", "level": 0, "url": "http://www.walmart.com/cp/For-the-Home/4044?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments11Home", "text": "Home", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_title": "Home Furnishings.", "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "keyword_count": {"home": 5}, "description_wc": 211, "description_text": "From the floor to the ceiling, from your rugs to your lighting, everything you need for your home is right here at Walmart.com. Whether you're in the market for all-new decor , looking to upgrade your home furniture, or just want a new mattress or refrigerator, you'll find it all right here for less. Browse our vast selection of top-brand appliances , including the latest refrigerator, dishwasher and microwave oven models at terrific prices. We make it easy to save on your next refrigerator, dishwasher or microwave from top appliances brands you know. And when it's time for a new mattress and bedding , look no further than our attractive mattress and bedding collections. Ready to refresh your decor? You'll discover a huge array of decor options, stylish rugs, great-looking lighting solutions and more. Plus comfortable and attractive home furniture to add new life to all your living spaces, whether inside or outdoors. And, of course, Walmart.com also features all the linens, rugs, bedding, towels and window coverings to complement your new home furniture. Shop Walmart.com for Every Day Low Prices on home furniture, decor, major appliances and accessories, such as bedding, flower pots, rugs and lamps. Save money and live better with Walmart..", "parent_text": "Made in the USA", "keyword_density": {"home": "2.4"}, "department_id": 5}
