{"department_text": "Made in the USA", "level": 0, "url": "http://www.walmart.com/cp/Baby/5427?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments3Baby", "text": "Baby", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_title": "Baby Items and Baby Supplies", "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "keyword_count": {"baby supplies": 7, "baby": 31, "baby items": 7, "baby items and baby": 2, "supplies": 9}, "description_wc": 265, "description_text": "Baby supplies and baby items. The baby supplies and baby items you need cost less at Walmart. We have a whole baby store full of baby supplies and baby items at great savings right here. For baby gear, baby supplies, baby gifts and other baby stuff, check out our full selection of baby items. Find all the important baby supplies you need right here, whether you're a mom yourself or shopping for a mother-to-be. From adorable baby clothing to strollers and toys for babies, everything is priced to save you money. Browse for soft, cuddly baby clothes in a wide range of cute designs for boys and girls. For the nursery, discover safe, sturdy cribs and baby bedding, plus fun and educational toys for babies at every stage of development. And family outings become easier and more fun when you have the right car seat and stroller. When it's diapers you need, you'll find unbeatable prices on all the most-trusted diaper brands, including Pampers and Huggies. It's all part of our huge baby store full of baby supplies, baby items and baby products. Plus, find baby formula, baby bottles and baby care supplies like lotions and soaps, all available at unbeatable prices with a click of your mouse. For baby supplies, baby items, baby gear, baby gifts and baby products like strollers , diapers and potty training supplies, cribs and baby car seats there's only one place to get everything you need for less. Walmart is the headquarters for baby items and baby gifts at big savings.", "parent_text": "Made in the USA", "keyword_density": {"baby supplies": "5.3", "baby": "11.7", "baby items": "5.3", "baby items and baby": "3.0", "supplies": "3.4"}, "department_id": 5}
