{"department_text": "Made in the USA", "level": 0, "url": "http://www.walmart.com/cp/91083?povid=cat1104712-env517708-moduleA051513-lLinkLHNShopDepartments2Auto_Tires", "text": "Auto & Tires", "department_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "description_title": "Save on auto tires, oil and more for your vehicle at Walmart", "parent_url": "http://www.walmart.com/cp/1104053?povid=cat121828-env999999-moduleA030713-lLinkGNAV1_Campaign_MadeInTheUSA", "keyword_count": {"oil": 4, "auto": 3, "tires": 4, "walmart": 6, "vehicle": 2, "save": 4}, "description_wc": 211, "description_text": "From Goodyear and Pirelli to Michelin and Bridgestone, it's easy to find the right tires for your car at Walmart.com. Simply browse by vehicle or tire size. Then place your order and select your Walmart Auto Care Center location for pick-up and installation at Every Day Low Prices. Find the Walmart Auto Care Center location nearest you . While you're there, why not save time and money by getting a complete lube and oil change as well? In addition to changing your oil, our Walmart Auto Care Center technicians will top off your car's brake fluid, transmission fluid, power steering fluid and more. We offer Every Day Low Prices on oil and car care products . And when you buy a new car battery from us, we'll install it and charge it for you at no extra cost. Walmart.com is the place to save on tires from Goodyear, Pirelli, Michelin, Bridgestone and other top brands, as well as tools and equipment to keep your ride running its best. You can find tires, motor oil and more vehicle needs right here at Walmart.com. Our Every Day Low Prices will save you money now, while the improved performance from better tires will save you money down the road.", "parent_text": "Made in the USA", "keyword_density": {"oil": "1.9", "auto": "1.4", "tires": "1.9", "walmart": "2.9", "vehicle": "1.0", "save": "1.9"}, "department_id": 5}
{"department_text": "Gift & Registry", "level": -1, "url": "http://www.walmart.com/cp/132943?povid=catBRegistry-env421225-moduleA070412-lLinkLHNShopbyPrice10_10Dollars&ref_values=305679+500601&povid=catBRegistry-env421225-moduleA070412-lLinkLHNCategories11Health_Safety", "text": "Health & Safety", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "Baby Safety", "parent_url": "http://www.walmart.com/babyregistry", "keyword_count": {"baby": 40, "safety": 15, "baby safety": 11}, "description_wc": 284, "description_text": "Baby safety. At Walmart, one of our missions is to make it easier to ensure baby safety and baby health by offering the best baby safety items at Every Day Low Prices. We take baby safety and baby health seriously and want to make it more affordable for everyone. That's why you'll find so many smart, sensible baby safety, baby health and baby care items here at such great savings. From baby monitors and baby gates to baby bath essentials, our baby safety, baby proofing and baby health selection is right here at your fingertips for less. Whether you're a new parent, a soon-to-be parent, or just shopping for gifts for friends or family, our selection of baby safety and baby proofing items is the easiest way to save on baby health and baby care essentials. In addition to baby proofing and baby safety must-haves like baby monitors, baby gates and baby bath items, you'll find great prices on air purifiers and humidifiers to promote healthy breathing for your baby. Plus, we also carry all the baby medicine and baby vitamins to help keep baby healthy all year long. Baby safety, baby proofing, infant safety and toddler safety are top priorities for us, but baby safety products aren't the only baby-related things we carry. We're also proud to offer baby car seats , diapers and potty gear , baby bedding , jogging strollers , baby learning toys and baby gear , just for starters. See our entire collection of baby items , including baby safety, infant safety, toddler safety, baby proofing and baby health necessities, at prices that'll keep your budget healthy, too.", "parent_text": "Baby", "keyword_density": {"baby": "14.4", "safety": "5.4", "baby safety": "7.9"}, "department_id": 20}
