{"department_text": "Gift & Registry", "level": -1, "url": "http://www.walmart.com/cp/538387?povid=catBRegistry-env421225-moduleA070412-lLinkLHNShopbyPrice10_10Dollars&ref_values=305679+500601&povid=catBRegistry-env421225-moduleA070412-lLinkLHNCategories10Gifts_Baby", "text": "Gifts for Baby", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "Baby Gifts", "parent_url": "http://www.walmart.com/babyregistry", "keyword_count": {"baby": 19, "gifts": 10, "baby gifts": 7}, "description_wc": 218, "description_text": "Baby gifts. Get the perfect baby gift for less at Walmart. Our selection of baby gifts includes lots of terrific baby gift ideas at great low prices. When you're shopping for baby gifts for the special people in your life, our baby gift collection just can't be beat. From jumpers and gift sets to baby blankets and pillows, you'll find all the baby gifts you need right here. Whether you're a grandparent or a busy mother, we've got your baby gifts covered. Our extensive selection of baby gifts includes blankets, bassinets, play mats, play stations and walkers. Plus, you can create your own baby gift registry ? or find a baby gift registry placed by a friend. You can even shop for a baby present by brand, such as Fisher-Price, Gerber, Graco and more. It's easy to find the right baby present at Every Day Low Prices on Walmart.com. Gifts for babies isn't all we carry, though. In addition to smart and adorable gifts for babies, you'll discover an enormous Baby department full of essentials like baby feeding supplies , swim diapers , baby mattresses , Graco car seats and more. Discover Every Day Low Prices on our entire baby collection , including baby gifts, gifts for parents and more.", "parent_text": "Baby", "keyword_density": {"baby": "8.9", "gifts": "4.7", "baby gifts": "6.5"}, "department_id": 20}
{"department_text": "Gift & Registry", "level": -1, "url": "http://instoresnow.walmart.com/Baby-Center-6-12-Months.aspx", "text": "The First Year Guide", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "1. Look for signs that your child is ready.", "parent_url": "http://www.walmart.com/babyregistry", "keyword_count": {"1": 1, "child": 8, "child is ready": 1, "signs": 1}, "description_wc": 202, "description_text": "Potty training can be challenging to both parent and child. You may not know how to get started, or if your child is ready. Stay positive, be patient and follow these 10 tips to help make training a success. Depending on your child\u2019s age, he or she may simply say, \"I want to use the potty.\" Younger toddlers may give you subtle signs such as fussing in a dirty diaper. Some kids may consistently dirty a diaper at the same time of day or in the same place. Try not to start too early. If you experience challenges when you start, try waiting a few weeks then start again. Show your child how the potty seat works using a book, a special DVD or by inviting your child to see how Mommy or Daddy uses the bathroom. Show them that using the bathroom is a natural, normal activity. When you begin potty training, stop using diapers. Training pants encourage your child to follow the body\u2019s cues. Because training pants can be pulled up and down like regular underwear, your child will feel like a big kid. Stick with regular diapers at night until you notice your child [...] Read More", "parent_text": "Baby", "keyword_density": {"1": "0.5", "signs": "0.5", "child is ready": "1.5", "child": "4.0"}, "department_id": 20}
