{"department_text": "Gift & Registry", "nr_products": 180, "level": -2, "url": "http://www.walmart.com/browse/baby/baby-gates/5427_132943_132981/?_refineresult=true&povid=cat132943-env449838-moduleA010513-lLinkLHNSafety1BabyGates", "text": "Baby Gates", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "Baby Gates.", "parent_url": "http://www.walmart.com/cp/132943?povid=catBRegistry-env421225-moduleA070412-lLinkLHNShopbyPrice10_10Dollars&ref_values=305679+500601&povid=catBRegistry-env421225-moduleA070412-lLinkLHNCategories11Health_Safety", "keyword_count": {"baby": 22, "gates": 16, "baby gates": 9}, "description_wc": 267, "description_text": "Baby gates. Save on baby gates at Walmart. Our selection of baby gates features all sorts of baby gate varieties to fit your home, and our prices on baby gates are hard to beat. Keep your baby (and your budget!) safe with great savings on baby gates. We offer baby gates for less. It's important to protect your baby with the right baby gate for your home. A safety gate on the front door can keep baby from wandering outdoors unnoticed. A stair gate at the top of a flight of steps can prevent dangerous falls. And if you're lucky enough to have a pool, you'll definitely need a baby safety gate to secure your pool area, too. We have baby gates, safety gates, pool security gates and stair gates by top trusted manufacturers like Evenflo, Regalo and North State, plus collapsible playards and playpens you can set up almost anywhere to keep your baby safe and secure. A baby gate is a simple and effective way to prevent accidents, and ours are all priced to save you money. Shop Walmart for safety gates, baby gates, expandable door gates and stair gates. Of course, we carry much more than just baby safety gates. In addition to the perfect baby gate, check out our entire selection of baby items for less , including nursery decor, baby formula, diapers, maternity clothing, high chairs and rockers , baby gyms and playmats and tons more. With prices this good on baby gates and everything else for babies and their parents, there's no need to shop anywhere else.", "parent_text": "Health & Safety", "keyword_density": {"baby": "8.3", "gates": "6.0", "baby gates": "6.8"}, "department_id": 20}
{"level": -1, "url": "http://instoresnow.walmart.com/Baby-Center-Article_ektid76570.aspx", "text": "New Mother Guide", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "parent_url": "http://www.walmart.com/babyregistry", "description_wc": 404, "description_text": "Most parents of newborns have a lot of ups and downs. You feel happy, proud and excited in one day. You feel sad, lonely or depressed the next. Don\u2019t worry, that\u2019s just the \"after-baby blues.\" What brings on the after-baby blues? It could be that: Your body has been hard at work for the past nine months. If you feel like you deserve a break, it\u2019s because you do! There are a few things you can do to feel better faster: Get enough sleep, eat right, exercise and take care of yourself. You need to get plenty of rest, especially in the first few weeks. Try to: Getting enough sleep is a problem for all parents. Newborns sleep about 15 to 16 hours a day. But, babies sleep on a different schedule than adults. A two-week-old baby will only sleep for three or four hours before waking up to eat. By four months, some babies will sleep up to eight hours at a stretch. But other babies can take even longer to learn to sleep through the night. However, you still need your sleep. If your baby likes to sleep during the day and is awake at night, try to: Eating right and exercising are very important. Are you breastfeeding? Your doctor, nutritionist or nurse / midwife can give you the best advice about what you should eat to nourish your baby. Some basic rules for all moms are: Your baby depends on you for everything. A few simple steps can help you stay in control: Many new moms are afraid to let dads take care of the baby. Dads are parents, too. Some dads jump right into the act, while others aren\u2019t sure what to do. Help your partner learn about babies. Ask him to change the diapers, dress the baby and give the baby a bath. Dads can be wonderful at gently rocking a baby to sleep for the night. Just be sure to reassure Dad when he\u2019s doing a good job. Many new parents think that having a baby will make them feel closer than ever. Sometimes, it does. Many parents also feel like their relationship is being put to the test. It\u2019s harder to get along when you\u2019re tired. Plus, you don\u2019t have much time for each other. Learn how to make time for each other with these tips:", "parent_text": "Baby", "department_text": "Gift & Registry", "department_id": 20}
