{"department_text": "Gift & Registry", "nr_products": 144, "level": -2, "url": "http://www.walmart.com/browse/Feeding/Pacifiers-Teethers/_/N-92cs?_refineresult=true&_refineresult=true&ic=16_0&path=0%3A5427&ref=+422956&catNavId=132943&povid=cat132943-env198927-moduleA072012-lLinkLHNHealth7Pacifiers_Teethers", "text": "Pacifiers & Teethers", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "Pacifiers and Teethers", "parent_url": "http://www.walmart.com/cp/132943?povid=catBRegistry-env421225-moduleA070412-lLinkLHNShopbyPrice10_10Dollars&ref_values=305679+500601&povid=catBRegistry-env421225-moduleA070412-lLinkLHNCategories11Health_Safety", "keyword_count": {"pacifiers and teethers": 4}, "description_wc": 160, "description_text": "Find soothing solutions for teething babies and fussy babies at Every Day Low Prices from Walmart.com. We offer a comforting assortment of more than 100 different pacifiers and teethers from Fisher-Price, Garanimals, NUK, Razbaby, The First Years, and more trusted brands. It's easy to shop for colorful pacifiers and teethers at Walmart.com by brand, price range, customer rating, or best sellers. You also may be interested in browsing our selection of baby feeding products . You'll find formula, baby food, bottle feeding necessities, bibs and burp cloths, diaper bags, and high chairs and booster seats. In addition to money-saving shipping offers on select items, you'll find that many of our pacifiers and teethers are also available for free store pickup at your nearby Walmart store when you use Site to Store online ordering. Shop for pacifiers and teethers, as well as baby feeding essentials, at Every Day Low Prices from Walmart. Save money. Live better.", "parent_text": "Health & Safety", "keyword_density": {"pacifiers and teethers": "7.5"}, "department_id": 20}
