d prices you get at Walmart.", "parent_text": "Health & Safety", "keyword_density": {"baby": "12.6", "baby shampoo": "7.4", "baby soap": "7.4", "baby shampoo and baby soap": "14.0"}, "department_id": 20}
{"level": -1, "url": "http://instoresnow.walmart.com/Baby-Center.aspx", "text": "Baby & Me", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "parent_url": "http://www.walmart.com/babyregistry", "description_wc": 219, "description_text": "Baby and toddler how-to\u2019s, tips, news, blogs, advice and product guides for expecting, new and experienced parents. If you\u2019re pregnant or a new parent looking for information, ideas, advice and top-rated products for baby or toddler, Walmart has you covered with Every Little Step. This new parent baby blog and news resource is your go-to baby and toddler guide for expecting mothers and new and experienced parents alike. Learn all about top-rated baby gear such as the best strollers, the best cribs and the best car seats, explore the latest in baby health and safety for bathing and sleeping, find tips and inspiration for decorating baby\u2019s nursery, and get trusted advice about topics like pregnancy and prenatal care, maternity clothing, exercising while pregnant, changing diapers, breast vs. bottle feeding, basic baby nutrition, developmental activities and toys for baby and toddler \u2013 plus baby care basics that all new parents should know. You choose Walmart for trusted brands for baby and toddler, now you can trust Walmart for baby and toddler information, how-to\u2019s, tips, inspiration, advice and product buying guides for baby gear and other baby essentials. Life is full of firsts with baby and toddler, and Walmart is here for new parents, moms and dads Every Little Step of the way.", "parent_text": "Baby", "department_text": "Gift & Registry", "department_id": 20}
