{"department_text": "Gift & Registry", "level": -1, "url": "http://www.walmart.com/cp/112776", "text": "Wedding Planning Guide", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "Wedding Products Cost Less at Walmart", "parent_url": "http://www.walmart.com/weddingregistry", "keyword_count": {"walmart": 2, "wedding products": 1, "wedding": 5}, "description_wc": 109, "description_text": "Create an elegant and modern wedding without breaking the bank at Walmart.com. Whether you're deciding on save-the-date cards and invitations or shopping for an engagement ring and wedding band, and organizing a gift registry, we've got it covered. You'll find all the wedding products you're looking for, such as ring sets in gold, silver and platinum; wedding favors; and photo albums. Celebrate this joyous day with personalized gifts, including engraved wine boxes, split key chains, vows heart canvas and more. You can shop by category, by price point, and more at everyday low prices. So discover your wedding needs at Walmart.com \u2014 and save.", "parent_text": "Wedding", "keyword_density": {"walmart": "1.8", "wedding products": "1.8", "wedding": "4.6"}, "department_id": 20}
{"department_text": "Gift & Registry", "level": -1, "url": "http://instoresnow.walmart.com/article.aspx?Center=CelebrationCenter&id=28906", "text": "Birthday Parties", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "Birthday parties are fun for everyone. And they\u2019re easy to throw because there are so many ways to celebrate. Day or night, casual or formal, they can be any way you want.", "parent_url": "http://www.walmart.com/wishlist", "keyword_count": {"re": 1, "birthday": 3, "everyone": 1, "way": 1, "celebrate": 2}, "description_wc": 81, "description_text": "The age and interests of the birthday person will determine how you celebrate. Think about the following: People know it\u2019s party time when the house is decorated. Keep them in the mood from the moment they arrive to the minute they leave: A birthday party is a wonderful way to celebrate a friend or family member\u2019s life. Use some of these ideas for hosting your next birthday party, and you\u2019ll have everyone looking forward to next year\u2019s!", "parent_text": "Wish List", "keyword_density": {"re": "1.2", "birthday": "3.7", "everyone": "1.2", "celebrate": "2.5", "way": "1.2"}, "department_id": 20}
{"department_text": "Gift & Registry", "level": -1, "url": "http://www.walmart.com/cp/Home/4044?povid=catWRegistry-env7235449147-moduleA070412-lLinkLHN5ShopHome", "text": "Shop Home", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "description_title": "Home Furnishings.", "parent_url": "http://www.walmart.com/weddingregistry", "keyword_count": {"home": 5}, "description_wc": 211, "description_text": "From the floor to the ceiling, from your rugs to your lighting, everything you need for your home is right here at Walmart.com. Whether you're in the market for all-new decor , looking to upgrade your home furniture, or just want a new mattress or refrigerator, you'll find it all right here for less. Browse our vast selection of top-brand appliances , including the latest refrigerator, dishwasher and microwave oven models at terrific prices. We make it easy to save on your next refrigerator, dishwasher or microwave from top appliances brands you know. And when it's time for a new mattress and bedding , look no further than our attractive mattress and bedding collections. Ready to refresh your decor? You'll discover a huge array of decor options, stylish rugs, great-looking lighting solutions and more. Plus comfortable and attractive home furniture to add new life to all your living spaces, whether inside or outdoors. And, of course, Walmart.com also features all the linens, rugs, bedding, towels and window coverings to complement your new home furniture. Shop Walmart.com for Every Day Low Prices on home furniture, decor, major appliances and accessories, such as bedding, flower pots, rugs and lamps. Save money and live better with Walmart..", "parent_text": "Wedding", "keyword_density": {"home": "2.4"}, "department_id": 20}
{"level": -1, "url": "http://instoresnow.walmart.com/Celebration-Center.aspx", "text": "Celebration Center", "department_url": "http://www.walmart.com/cp/1094765?povid=cat121828-env999999-moduleA072012-lLinkGNAV2_GiftRegistry", "parent_url": "http://www.walmart.com/wishlist", "description_wc": 247, "description_text": "Important Walmart Disclaimer: All content, including but not limited to, recipe and health information provided in In Stores Now, is for educational purposes only. Such content is intended to supplement, not substitute for, the diagnosis, treatment and advice of a medical professional. Such content does not cover all possible side effects of any new or different health program. Consult your medical professional for guidance before changing or undertaking a new diet or exercise program. Advance consultation with your physician is particularly important if you are under eighteen (18) years old, pregnant, nursing, or have health problems. If you have dietary restrictions and/or allergies, always read the ingredient list carefully for all food products prior to consumption. Allergens and their derivatives can have various names and may be present in some food brands but not others. If the ingredient list is not available on the food product, check with the food manufacturer, or do not consume the product. If you have a food allergy, speak to your physician and/or a registered dietitian for a comprehensive list of foods and their derivatives to avoid prior to using any recipe from Walmart.com. Neither the author nor Walmart.com assumes any responsibility for errors, omissions or contrary interpretation of the subject matter herein. Product information is provided by the supplier or manufacturer of the product and should not be construed as advice. Walmart does not sponsor, recommend or endorse any third party, product, service or information provided on this site.", "parent_text": "Wish List", "department_text": "Gift & Registry", "department_id": 20}
